module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var county = [{name: "縣市名", data: ["雲林縣", "桃園縣", "台東縣", "台北縣", "台北市", "台南縣", "台南市", "台中縣", "台中市", "屏東縣", "南投縣", "苗栗縣", "基隆市", "高雄縣", "高雄市", "宜蘭縣", "花蓮縣", "新竹縣", "新竹市", "嘉義縣", "嘉義市", "彰化縣", "連江縣", "澎湖縣", "金門縣"]}];
    var value = [{name: "數值", data: d3.range(county[0].data.length).map(function() { return Math.random(); }) }];
    return {county: county, value: value};
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "該縣市的數值" },
    county: { type: [], require: true, desc: "縣市的名字，用來對應地圖" }
  },
  config: {
    fontSize: {},
    colorEmpty: {},
    fill: {},
    stroke: {},
    legendLabel: {}
  },
  init: function() {
    var that = this;
    this.names = ["雲林縣", "桃園市", "台東縣", "新北市", "台北市", "台南市", "台中市", "屏東縣", "南投縣", "苗栗縣", "基隆市", 
                  "高雄市", "宜蘭縣", "花蓮縣", "新竹縣", "新竹市", "嘉義縣", "嘉義市", "彰化縣", "連江縣", "澎湖縣", "金門縣"];
    this.svg = d3.select(this.root).append("svg");
    this.popup = plotd3.html.popup(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.properties.COUNTYNAME);
      popup.select(".value").text(
        (d.properties.value == undefined ? "無數值"
        :parseInt(d.properties.value*100)/100)
      );
    });
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.countyfile = this.assets["twCounty2010.topo.json"];
    this.counties = [];
    d3.json(this.countyfile.datauri, function(ret) {
      var features = topojson.feature(ret, ret.objects.layer1).features;
      that.counties = features;
      for(var idx = 0; idx < features.length; idx++) {
        features[idx].properties.COUNTYNAME = that.normalname(features[idx].properties.COUNTYNAME);
      }
      that.parse();
      that.resize();
      that.bind();
      that.render();
    });
  },
  parse: function() {
    var that = this;
    if(!this.counties) return;
    this.data.map(function(d,i) {d.county = d.county.trim(); });
    if(!this.dimension.value.fields.length) this.data.map(function(d,i) { d.value = 0; });
    for(var idx = 0; idx < this.counties.length; idx++) {
      matched = this.data.filter(function(it) {
        return it.county == that.counties[idx].properties.COUNTYNAME;
      })[0];
      if(matched) this.counties[idx].properties.value = matched.value;
    }
    for(var idx = 0; idx < this.data.length; idx++ ) {
      var item = this.data[idx];
      item.county = this.normalname(item.county); 
    }
    this.data = this.data.filter(function(d,i) { return that.names.indexOf(d.county)>=0; });
    this.valueRange = d3.extent(this.data.map(function(d,i) { return d.value; }));
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[1]++;
  },
  normalname: function(it) {
    if(!it) return it;
    it = it.replace("臺","台");
    if(it == "台北縣") return "新北市";
    if(it == "台中縣") return "台中市";
    if(it == "高雄縣") return "高雄市";
    if(it == "台南縣") return "台南市";
    if(it == "桃園縣") return "桃園市";
    return it;
  },
  bind: function() {
    var that = this,sel;
    sel = that.svg.selectAll("path.county.data").data(this.counties);
    sel.exit().remove();
    sel = sel.enter().append("path").attr({class: "county data"});
    this.popup.nodes(sel);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.cscale = d3.scale.linear()
      .domain(that.valueRange)
      .range(["#eee",that.config.fill]); 
    this.legend = plotd3.rwd.legend()
      .orient("right")
      .scale(this.cscale)
      .label(this.config.legendLabel || this.dimension.value.fieldName || "")
      .fontSize(this.config.fontSize || 12);
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    var rateW = that.width * 16;
    var rateH = that.height * 14;
    this.projection = d3.geo.mercator().center([121,23.6])
      .scale(rateW < rateH ? rateW : rateH)
      .translate([width / 2, height / 2])
      .precision(.1);
    this.path = d3.geo.path().projection(
      function(coord) {
        if(coord[1]>25.5) coord[1] = coord[1] - 1;
        if(coord[0]<119) coord[0] = coord[0] + 1.2;
        return that.projection(coord);
      }
    );
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: ["translate(", this.width - this.legendSize[0] - 20, (this.height - this.legendSize[1])/2, ")"].join(" ")
    });
    this.svg.selectAll("path.county.data")
      .attr({
        "d": that.path,
        "fill": function(it) {
          var v = it.properties.value;
          if(!v) return that.config.colorEmpty;
          return that.cscale(v);
        },
        "stroke": function(it) {
          if(!it.properties.value) return that.config.colorEmpty;
          return that.config.stroke;
        },
        opacity: function(it) {
          if(!it.properties.value) return 0.2;
          return 1;
        },
        "stroke-width": 1
      });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var continent = plotdb.data.sample.continent;
    var len = continent.length;
    var list = d3.range(len * len);
    return {
      src: [{name: "Source Continent", data: list.map(function(d,i) { return continent.get(parseInt(d/len)); })}],
      des: [{name: "Target Continent", data: list.map(function(d,i) { return continent.get(d%len); })}],
      value: [{name: "Value", data: list.map(function(d,i) { return Math.round(Math.random() * 90 + 10); })}] 
    };
  },
  dimension: {
    src: { type: [], require: true, desc: "source" },
    des: { type: [], require: true, desc: "target" },
    value: { type: [plotdb.Number], require: true, desc: "amount of flow" }
  },
  config: {
    fontFamily: {},
    background: {},
    textFill: {},
    fillOpacity: {},
    fontSize: {},
    padding: {},
    margin: {},
    palette: {rebindOnChange: true},
    otherLabel: {},
    otherLimit: {},
    thick: { name: "Bar Thickness", type: [plotdb.Number], default: 10},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.defs = this.svg.append("defs");
    this.yRange = [0,1];
    this.overlap = plotd3.rwd.overlap();
  },
  getGID: function(src, des) {
    return encodeURIComponent(src)+"/"+encodeURIComponent(des); 
  },
  hover: null,
  setHover: function(item) {
    this.hover = item;
    this.render();
    if(this.handler) clearTimeout(this.handler);
    this.handler = 0;
  },
  clearHover: function() {
    var that = this;
    if(this.handler) clearTimeout(this.handler);
    this.handler = setTimeout(function() {
      that.hover = null;
      that.handler = 0;
      that.render();
    }, 10);
  },
  parse: function() {
    var that = this;
    var chash = {src: {}, des: {}};
    if(!this.dimension.value.fields.length) this.data.map(function(d,i) { d.value = 1; });
    this.data.forEach(function(d,i) {
      chash.src[d.src] = (chash.src[d.src] || 0) + d.value;
      chash.des[d.des] = (chash.des[d.des] || 0) + d.value;
    });
    this.data.forEach(function(d,i) {
      if(chash.src[d.src] < that.config.otherLimit) d.src = that.config.otherLabel;
      if(chash.des[d.des] < that.config.otherLimit) d.des = that.config.otherLabel;
    });
    this.srcRange = d3.map(this.data, function(it) { return it.src; }).keys();
    this.desRange = d3.map(this.data, function(it) { return it.des; }).keys();
    this.srcAmount = {};
    this.desAmount = {};
    this.srctotal = 0;
    this.destotal = 0;
    this.srcRange.sort();
    this.desRange.sort();
    this.srcCharCount = d3.max(this.srcRange.map(function(it) { return it.length; }));
    this.desCharCount = d3.max(this.desRange.map(function(it) { return it.length; }));
    for(var idx = 0; idx < this.srcRange.length; idx++) {
      var name = this.srcRange[idx];
      this.srcAmount[name] = {size: 0, name: name, _offset: 0, des: {}}
    }
    for(var idx = 0; idx < this.desRange.length; idx++) {
      var name = this.desRange[idx];
      this.desAmount[name] = {size: 0, name: name, _offset: 0};
    }
    this.data.forEach(function(it) {
      that.srcAmount[it.src].size += it.value;
      that.desAmount[it.des].size += it.value;
      that.srctotal += it.value;
      that.destotal += it.value;
      if(!that.srcAmount[it.src].des[it.des]) {
        that.srcAmount[it.src].des[it.des] = 0;
      }
      that.srcAmount[it.src].des[it.des] += it.value;
    });
    var lastY = 0;
    for(var idx = 0; idx < this.srcRange.length; idx++) {
      var node = this.srcAmount[this.srcRange[idx]];
      node.y = lastY;
      lastY = node.y + node.size;
    }
    lastY = 0;
    for(var idx = 0; idx < this.desRange.length; idx++) {
      var node = this.desAmount[this.desRange[idx]];
      node.y = lastY;
      lastY = node.y + node.size;
    }
    this.yRange = [0, lastY];
    this.parsed = {};
    this.parsed.src = this.srcRange.map(function(it) { return that.srcAmount[it]; });
    this.parsed.des = this.desRange.map(function(it) { return that.desAmount[it]; });
    this.parsed.links = [];
    this.gradients = {};
    this.gids = [];
    for(var idx = 0; idx < this.srcRange.length; idx++) {
      var node = this.srcAmount[this.srcRange[idx]];
      var keys = d3.map(node.des).keys();
      keys.sort();
      for(var jdx = 0; jdx < keys.length; jdx++) {
        var src = this.srcAmount[this.srcRange[idx]];
        var des = this.desAmount[keys[jdx]];
        var size = src.des[keys[jdx]];
        this.parsed.links.push({
          source: src,
          target: des,
          size: size,
          srcy: src._offset,
          desy: des._offset
        });
        src._offset += size;
        des._offset += size;
        if(!this.gradients[this.srcRange[idx]]) this.gradients[this.srcRange[idx]] = {};
        if(!this.gradients[this.srcRange[idx]][keys[jdx]]) {
          var node = this.gradients[this.srcRange[idx]][keys[jdx]] = {};
          node.id = this.getGID(this.srcRange[idx],keys[jdx]); 
          this.gids.push(node);     
        }
      }
    }
  },

  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("path.connect").data(this.parsed.links);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "connect"})
        .on("mouseover", function(d,i) { that.setHover({src: d.source.name, des: d.target.name}); })
        .on("mouseout", function(d,i) { that.clearHover(); });
    sel = this.svg.selectAll("rect.src.data").data(this.parsed.src);
    sel.exit().remove();
    sel.enter().append("rect").attr({class: "src data"}).on("mouseover", function(d,i) { that.setHover({src: d.name}); });
    sel = this.svg.selectAll("rect.des.data").data(this.parsed.des);
    sel.exit().remove();
    sel.enter().append("rect").attr({class: "des data"}).on("mouseover", function(d,i) { that.setHover({des: d.name}); });
    sel = this.svg.selectAll("text.src").data(this.parsed.src);
    sel.exit().remove();
    sel.enter().append("text").attr({class: "src"});
    sel = this.svg.selectAll("text.des").data(this.parsed.des);
    sel.exit().remove();
    sel.enter().append("text").attr({class: "des"});
    this.svg.selectAll("rect").on("mouseout", function(d,i) { that.clearHover(); });
    sel = this.defs.selectAll("linearGradient").data(this.gids);
    sel.exit().remove();
    sel.enter().append("linearGradient").each(function(d,i) {
      var node = d3.select(this);
      d.g1 = node.append("stop").attr({offset: "0%"});
      d.g2 = node.append("stop").attr({offset: "100%"});
    });
    this.defs.selectAll("linearGradient").attr({
      x1: "0%", y1: "0%", x2: "100%", y2: "0%", id: function(d,i) { return d.id; }
    });
    for(var idx = 0; idx < this.srcRange.length; idx++) {
      var src = this.srcRange[idx];
      var node = this.srcAmount[src];
      var keys = d3.map(node.des).keys();
      for(var jdx = 0; jdx < keys.length; jdx++) {
        var des = keys[jdx];
        var hsl1 = d3.hsl(this.cScale(src));
        var hsl2 = d3.hsl(this.cScale(des));
        hsl1.s /= 2;
        hsl2.s /= 2;
        this.gradients[src][des].g1.style({"stop-color": hsl1.toString()});
        this.gradients[src][des].g2.style({"stop-color": hsl2.toString()});
      }
    }
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.yScale = d3.scale.linear()
      .domain(this.yRange)
      .range([this.config.margin, height - this.config.margin]);
    this.resized = true;
  },
  render: function() {
    var that = this;
    var barWidth = this.config.thick;
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });
    this.svg.selectAll("text.src").attr({
      y: function(it) { 
        return ( that.yScale(it.y + it.size) + that.yScale(it.y) ) / 2;
      },
      "text-anchor": "end",
      "dominant-baseline": "central"
    }).text(function(it) { return it.name; });
    this.svg.selectAll("text.des").attr({
      y: function(it) { 
        return ( that.yScale(it.y + it.size) + that.yScale(it.y) ) / 2;
      },
      "text-anchor": "start",
      "dominant-baseline": "central"
    }).text(function(it) { return it.name; });
    var srcWidth = d3.max(this.svg.selectAll("text.src")[0].map(function(d,i) { return d.getBoundingClientRect().width; })) + this.config.padding;
    var desWidth = d3.max(this.svg.selectAll("text.des")[0].map(function(d,i) { return d.getBoundingClientRect().width; })) + this.config.padding;
    this.svg.selectAll("text.src").attr({ x: this.config.margin + srcWidth - this.config.padding });
    this.svg.selectAll("text.des").attr({ x: this.width - this.config.margin - desWidth + this.config.padding });
    this.svg.selectAll("rect.src").attr({
      x: this.config.margin + srcWidth,
      y: function(it) { return that.yScale(it.y); },
      width: barWidth,
      height: function(it) { return that.yScale(it.y + it.size) - that.yScale(it.y); },
      fill: function(it) { return that.cScale(it.name); }
    });
    this.svg.selectAll("rect.des").attr({
      x: this.width - barWidth - this.config.margin - desWidth,
      y: function(it) { return that.yScale(it.y); },
      width: barWidth,
      height: function(it) { return that.yScale(it.y + it.size) - that.yScale(it.y); },
      fill: function(it) { return that.cScale(it.name); }
    });
    this.svg.selectAll("path.connect").attr({
      d: function(it) {
        var x1 = that.config.margin + barWidth + srcWidth;
        var x2 = that.width - that.config.margin - barWidth - desWidth;
        var x3 = x1 * 0.67 + x2 * 0.33;
        var x4 = x1 * 0.33 + x2 * 0.67;
        var y1 = that.yScale(it.source.y + it.srcy);
        var y2 = that.yScale(it.source.y + it.srcy + it.size);
        var y3 = that.yScale(it.target.y + it.desy);
        var y4 = that.yScale(it.target.y + it.desy + it.size);

        var ret = [
          "M",x1, y2,
          "L",x1, y1,
          "C",x3, y1, x4, y3, x2, y3,
          "L",x2, y4,
          "C",x4, y4, x3, y2, x1, y2
        ];
        return ret.join(" ");
      },
      fill: function(it) {
        return ["url(#",that.getGID(it.source.name, it.target.name),")"].join("");
      },
    }).transition().duration(500).attr({
      opacity: 0.3
    });
    this.svg.selectAll("rect.src").transition().duration(500).attr({
      opacity: function(d,i) { return (!that.hover || d.name == that.hover.src ? 1: 0.1); }
    });
    this.svg.selectAll("rect.des").transition().duration(500).attr({
      opacity: function(d,i) { return (!that.hover || d.name == that.hover.des ? 1: 0.1); }
    });
    this.svg.selectAll(".connect").transition().duration(500).attr({
      opacity: function(d,i) {
        return (!that.hover || ((d.source.name == that.hover.src || !that.hover.src) && 
                                (d.target.name == that.hover.des || !that.hover.des) ) ? that.config.fillOpacity : 0.1);
      }
    });
    if(this.resized) {
      this.overlap.nodes(this.svg.selectAll("text.src"),function(d,i) { return d.size; });
      this.overlap.nodes(this.svg.selectAll("text.des"),function(d,i) { return d.size; });
      this.resized = false;
    }
    this.svg.selectAll("text.src").transition().attr({
      opacity: function(d,i) { return (!that.hover || !that.hover.src ? (d.overlap?0:1) : (that.hover.src == d.name ? 1 : 0.1)); }
    });
    this.svg.selectAll("text.des").transition().attr({
      opacity: function(d,i) { return (!that.hover || !that.hover.des ? (d.overlap?0:1) : (that.hover.des == d.name ? 1 : 0.1)); }
    }); 
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(10);
    return {
      value: [{name: "Score", data: list.map(function() { return parseInt(Math.random() * 100); })}],
      name: [{name: "Name", data: list.map(function(i) { return plotdb.data.sample.name[i % plotdb.data.sample.name.length]; })}]
    };
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "length of bar" },
    name: { type: [], require: false, desc: "tag of bar" }
  },
  config: {
    fontFamily: {},
    background: {},
    textFill: {},
    fontSize: {},
    padding: {},
    margin: {},
    palette: {},
    rAxisShow: {},
    rAxisTickSizeInner: {},
    yAxisTickPadding: {},
    yAxisTickCount: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.barGroup = this.svg.append("g");
    this.textGroup = this.svg.append("g");
    this.tickGroup = this.svg.append("g").attr({class: "axis angle"});
    this.tooltip = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name);
      popup.select(".value").text(d.value);
    });
  },
  parse: function() {
    this.values = this.data.map(function(it) { return it.value; });
    this.tickValues = d3.range(0, 1.0001, 1/9).map(function(it) { return d3.quantile([0,Math.PI*1.5], it); });
    this.data.sort(function(a,b) {
      return b.value - a.value;
    });
    this.overlap = plotd3.rwd.overlap();
  },
  bind: function() {
    var that = this, sel;
    sel = this.barGroup.selectAll("path.bar").data(this.data);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "bar"});
    sel = this.textGroup.selectAll("text").data(this.data);
    sel.exit().remove();
    sel.enter().append("text").text(function(it) { return it.name; });
    sel = this.tickGroup.selectAll("g.tick").data(this.tickValues);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "tick"}).each(function(it) {
      d3.select(this).append("line");
      d3.select(this).append("text");
    });
    this.bars = this.barGroup.selectAll("path.bar");
    this.texts = this.textGroup.selectAll("text");
    this.ticks = this.tickGroup.selectAll("g.tick");
    this.tooltip.nodes(this.bars);
  },
  resize: function() {
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.size = (
      ( this.width > this.height ? this.height : this.width ) / 2
      - this.config.margin
      - (this.config.rAxisShow ? (this.config.fontSize + this.config.rAxisTickSizeInner) : 0)
      - 2
    );

    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.aScale = d3.scale.linear().domain(d3.extent(this.values)).range([0.05, Math.PI * 1.5]);
    this.rScale = d3.scale.linear().domain([0, this.data.length]).range([this.size, 0]);
    this.colors = d3.scale.ordinal()
      .range(this.config.palette.colors.map(function(it) { return it.hex; }));
    this.padding = this.config.padding;
    this.barWidth = this.size / this.data.length - this.padding;
    if(this.barWidth < 4) {
      this.padding = (this.size/this.data.length) - 4;
      if(this.padding <= 0) this.padding = 1;
      this.barWidth = this.size/this.data.length - this.padding;

    }
  },
  render: function() {
    var that = this;
    var centerAttr = {
      transform: ["translate(", this.width/2 , " ", this.height/2, ")"].join("")
    };
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });
    this.barGroup.attr(centerAttr);
    this.textGroup.attr(centerAttr);
    this.tickGroup.attr(centerAttr);
    this.tickGroup.attr({
      display: (this.config.rAxisShow ? "block" : "none")
    });
    this.texts.attr({
      y: function(d,i) { return -(that.rScale(i) - that.barWidth / 2); },
      x: -this.padding
    }).style({
      "text-anchor": "end",
      "dominant-baseline": "central",
      fill: function(it) {
        var color = that.colors(it.name);
        var hsl = d3.hsl(color);
        if(hsl.l > 0.5) return hsl.darker().darker().toString();
        return color;
      },
      "font-size": this.config.fontSize
    });
    this.bars.attr({
      d: function(d,i) {
        var largeArc = (that.aScale(d.value) > Math.PI ? 1 : 0);
        var r1 = that.rScale(i);
        var r2 = that.rScale(i) - that.barWidth;
        var x1 = (Math.sin(0) * r1);
        var y1 = -(Math.cos(0) * r1);
        var x2 = (Math.sin(0) * r2);
        var y2 = -(Math.cos(0) * r2);
        var x3 = (Math.sin(that.aScale(d.value)) * r1);
        var y3 = -(Math.cos(that.aScale(d.value)) * r1);
        var x4 = (Math.sin(that.aScale(d.value)) * r2);
        var y4 = -(Math.cos(that.aScale(d.value)) * r2);
        var ret = [
          "M", x1, y1,
          "A", r1, r1, 0, largeArc, 1, x3, y3,
          "L", x4, y4,
          "A", r2, r2, 0, largeArc, 0, x2, y2, 
          "Z"
        ].join(" ");
        return ret;
      }
    }).style({
      fill: function(d,i) { return that.colors(i);},
      stroke: "none"
    });
    this.tickGroup.selectAll("text").attr({
      "text-anchor": "middle",
      "font-size": that.config.fontSize * 0.8,
      transform: function(it) {
        return [
          "translate(",
          Math.sin(it) * (that.rScale(0) + 1+that.config.rAxisTickSizeInner + that.config.fontSize * 0.4),
          -Math.cos(it) * (that.rScale(0) +1+that.config.rAxisTickSizeInner + that.config.fontSize * 0.4),
          ") rotate(",
          (180 * it / Math.PI),
          ")"
        ].join(" ");
      }
    }).text(function(d,i) { return parseInt(100 * d) / 100; });
    this.tickGroup.selectAll("line").attr({
      x1: function(it) { return Math.sin(it) * (that.rScale(0) + 1); },
      y1: function(it) { return -Math.cos(it) * (that.rScale(0) + 1); },
      x2: function(it) { return Math.sin(it) * (that.rScale(0) +1+that.config.rAxisTickSizeInner); },
      y2: function(it) { return -Math.cos(it) * (that.rScale(0) +1+that.config.rAxisTickSizeInner); },
      stroke: "#000",
      "stroke-width": 1
    });
    this.overlap.nodes(this.texts);
    this.texts.attr({
      opacity: function(d,i) { return (d.overlap ? 0 : 1); }
    });
  }
});

