    fontSize: {},
    palette: {default: {colors: [{hex: "#6aa84f"},{hex:"#f1c232"},{hex:"#e06666"}]}},
    fill: {default: "#424242"}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.data = [];
    this.store = {};
    this.store.checked = {};
    d3.json(this.assets["bluepa.json"].datauri, function(e,d) {
      that.data = d;
      that.resize();
      that.parse();
      that.bind();
      that.render();
    });
  },
  parse: function() {
    var that = this;
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("g.row").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "row"}).each(function(d,i) {
      var node = d3.select(this);
      var sel = node.append("g").attr({class: "num"});
      sel.append("rect");
      sel.append("text");
    });
    this.dataGroup.selectAll("g.row").each(function(d,i) {
      var node = d3.select(this),sel;
      sel = node.selectAll("g.cell").data(d);
      sel.exit().remove();
      sel.enter().append("g").attr({class: "cell"}).append("rect");
      node.selectAll("g.cell").each(function(d,i) {
        var node = d3.select(this),sel;
        sel = node.selectAll("text.zh").data(d[0]);
        sel.exit().remove();
        sel.enter().append("text").attr({class: "zh"});
        sel = node.selectAll("text.en").data(d[1]);
        sel.exit().remove();
        sel.enter().append("text").attr({class: "en"});
      });
    });
    this.dataGroup.selectAll("g.row").each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("g.cell").on("click", function(d2,j) {
        if(i==0) return;
        that.store.checked[j] = i;
        that.render();
      });
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
  },
  render: function() {
    var that = this;
    this.dataGroup.selectAll("text.zh").attr({
      "font-size": this.config.fontSize * 1.1,
      "font-weight": "bold",
      "text-anchor": "middle",
      fill: this.config.fill
    }).text(function(d,i) { return d; });
    this.dataGroup.selectAll("text.en").attr({
      "font-size": this.config.fontSize * 0.9,
      "text-anchor": "middle",
      fill: this.config.fill
    }).text(function(d,i) { return d; });
    var maxSize = d3.max(this.dataGroup.selectAll("text")[0].map(function(d,i) { return d.getBoundingClientRect().width; })) * 1.1;
    this.blockHeight = maxSize * this.data.length;
    this.blockWidth = maxSize * d3.max(this.data.map(function(d,i) { return d.length; })) + 3 * this.config.fontSize;
    this.dataGroup.attr({
      transform: ["translate(", (this.width - this.blockWidth)/2, (this.height - this.blockHeight)/2, ")"].join(" ")
    });
    this.dataGroup.selectAll("g.row").attr({
      transform: function(d,i) {
        return [
        "translate(", 0, i * maxSize, ")"
        ].join(" ");
      }
    });
    this.dataGroup.selectAll("g.row").each(function(d,i) {
      var node = d3.select(this);
      if(i>0) node.selectAll("g.num").each(function(d,j) {
        var node = d3.select(this);
        node.select("rect").attr({
          fill: that.config.palette.colors[i - 1].hex,
          width: 3 * that.config.fontSize,
          height: maxSize,
          stroke: "#fff",
          "stroke-width": 2
        });
        node.select("text").attr({
          x: 1.5 * that.config.fontSize,
          y: maxSize/2 + that.config.fontSize * 0.8,
          "text-anchor": "middle",
          "font-size": 2 * that.config.fontSize,
          fill: "#fff"
        }).text(i - 1);
      });
      node.selectAll("g.cell").attr({
        transform: function(d,i) {
          return [
            "translate(", i * maxSize + 3 * that.config.fontSize, 0, ")"
          ].join(" ");
        }
      }).each(function(d,i) {
        var node = d3.select(this);
        var len = d[0].length + d[1].length;
        node.selectAll("text").attr({
          x: maxSize/2,
          y: function(d,i) { return (maxSize - len * that.config.fontSize * 1.1)/2 + (i+1) * that.config.fontSize * 1.1; }
        });
      });
    });
    this.dataGroup.selectAll("g.row").each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("g.cell").each(function(d,j) {
        var node = d3.select(this);
        node.selectAll("text").attr({
          fill: function() { return (that.store.checked[j] == i ? "#fff" : that.config.fill); }
        });
        node.select("rect").attr({
          x: 0, y: 0, 
          width: maxSize, height: maxSize,
          fill: function() {
            if(i==0) return "#fff";
            return (that.store.checked[j] == i ? that.config.palette.colors[i - 1].hex : "#eee");
          },
          stroke: "#fff",
          "stroke-width": 2
        });
      });
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(30);
    return {
      name: [{name: "Order", data: list.map(function(d,i) { return i; })}],
      value: [{name: "Value", data: list.map(function(d,i) {
        return Math.round(Math.sin(i/10) * 100 - Math.sin(i)*10 + Math.sin(i*i/2)*5);
      })}]
    };
  },
  dimension: {
    order: { type: [plotdb.Order], require: false, desc: "" },
    value: { type: [plotdb.Number], require: true, desc: "" }
  },
  config: {
    padding: { name: "Padding", type: [plotdb.Number], default: 10, rebindOnChange: false },
    margin: { },
    lineSmoothing: {},
    fill: {},
    stroke: {default: "#8c0000"},
    strokeWidth: {},
    fontSize: { },
    yAxisShow: {},
    yAxisLabel: {},
    yAxisTickSizeInner: {},
    yAxisTickSizeOuter: {},
    yAxisTickPadding: {},
    yAxisShowDomain: {default: true},
    yAxisTickCount: {},
    yAxisLabelPosition: {},
    xAxisShow: {},
    xAxisLabel: {},
    xAxisTickSizeInner: {},
    xAxisTickSizeOuter: {},
    xAxisTickPadding: {},
    xAxisShowDomain: {default: true},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.area = this.dataGroup.append("path").attr({class: "data area"});
    this.line = this.dataGroup.append("path").attr({class: "data line connect"});
    this.areaBuilder = d3.svg.area()
      .x(function(d,i) { return that.xScale(d.order); })
      .y0(function(d,i) { return that.yScale(0); })
      .y1(function(d,i) { return that.yScale(d.value); });
    this.lineBuilder = d3.svg.area()
      .x(function(d,i) { return that.xScale(d.order); })
      .y(function(d,i) { return that.yScale(d.value); });
  },
  parse: function() {
    var that = this;
    plotdb.Order.sort(this.data, "order");
    this.valueRange = d3.extent(this.data, function(d,i) { return d.value; });
    this.orders = this.data.map(function(d,i) { return typeof(d.order.raw)!="undefined" ? d.order.raw : d.order; });
    if(this.valueRange[0]>0) this.valueRange[0] = 0;
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[1]++;
  },
  bind: function() {
    var that = this;
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.areaBuilder.interpolate(this.config.lineSmoothing);
    this.lineBuilder.interpolate(this.config.lineSmoothing);
    this.yScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([this.height - this.config.margin, this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .label(this.config.yAxisLabel || " ")
      .labelPosition(this.config.yAxisLabelPosition)
      .tickValues(this.yScale.ticks(this.config.yAxisTickCount))
      .tickSize(this.config.yAxisTickSizeInner, this.config.yAxisTickSizeOuter)
      .tickPadding(this.config.yAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = (this.config.yAxisShow ? this.yAxis.offset() : 0);
    this.xScale = d3.scale.ordinal()
      .domain(this.orders)
      .rangePoints([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .label(this.config.xAxisLabel || " ")
      .labelPosition(this.config.xAxisLabelPosition)
      .tickSize(this.config.xAxisTickSizeInner, this.config.xAxisTickSizeOuter)
      .tickPadding(this.config.xAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = (this.config.xAxisShow ? this.xAxis.offset() : 0);
    this.yScale.range([this.height - this.config.margin - this.xAxisHeight, this.config.margin]);
    this.yAxisGroup.call(this.yAxis);
  },
  render: function() {
    var that = this;
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });
    this.xAxisGroup.selectAll(".domain").attr({ display: (this.config.xAxisShowDomain ? "block" : "none")});
    this.yAxisGroup.selectAll(".domain").attr({ display: (this.config.yAxisShowDomain ? "block" : "none")});
    this.xAxisGroup.attr({
      "transform": "translate(0," + this.yScale.range()[0] + ")",
      display: this.config.xAxisShow ? "block" : "none"
    });
    this.yAxisGroup.attr({
      "transform": "translate(" + this.xScale.range()[0] + ",0)",
      display: this.config.yAxisShow ? "block" : "none"
    });
    this.area.attr({
      d: this.areaBuilder(this.data),
      fill: this.config.fill
    });
    this.line.attr({
      d: this.lineBuilder(this.data),
      fill: "none",
      stroke: this.config.stroke,
      "stroke-width": this.config.strokeWidth
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(30);
    var count = d3.range(5);
    return {
      name: [{name: "Order", data: list.map(function(d,i) { return i; })}],
      values: count.map(function(e,j) {
        return {
          name: plotdb.data.sample.name.get(j),
          data: list.map(function(d,i) {
          return Math.round(Math.sin((i + j)/12) * (100 - j)*(6 - j) - Math.sin(i)*(10+j) + Math.sin(i*i*j/2)*5);
        })};
      })
    };
  },
  dimension: {
    order: { type: [plotdb.Order], require: false, desc: "" },
    values: { type: [plotdb.Number], require: true, desc: "", multiple: true }
  },
  config: {
    padding: { name: "Padding", type: [plotdb.Number], default: 10, rebindOnChange: false },
    margin: { },
    lineSmoothing: {},
    fillOpacity: {name: "Opacity", type: [plotdb.Number], default: 0.4, category: "Chart Settings"},
    palette: {},
    legendLabel: {},
    legendShow: {},
    strokeWidth: {},
    fontSize: { },
    yAxisShow: {},
    yAxisLabel: {},
    yAxisTickSizeInner: {},
    yAxisTickSizeOuter: {},
    yAxisTickPadding: {},
    yAxisShowDomain: {default: true},
    yAxisTickCount: {},
    yAxisLabelPosition: {},
    xAxisShow: {},
    xAxisLabel: {},
    xAxisTickSizeInner: {},
    xAxisTickSizeOuter: {},
    xAxisTickPadding: {},
    xAxisShowDomain: {default: true},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.areaBuilder = d3.svg.area()
      .x(function(d,i) { return that.xScale(d.order); })
      .y0(function(d,i) { return that.yScale(0); })
      .y1(function(d,i) { return that.yScale(d.value); });
    this.lineBuilder = d3.svg.area()
      .x(function(d,i) { return that.xScale(d.order); })
      .y(function(d,i) { return that.yScale(d.value); });
  },
  parse: function() {
    var that = this;
    plotdb.Order.sort(this.data, "order");
    var extents = this.data.map(function(d,i) { return d3.extent(d.values); }).reduce(function(a,b) { return a.concat(b); }, []);
    this.valueRange = d3.extent(extents);
    this.series = d3.range(this.dimension.values.fields.length);
    this.orders = this.data.map(function(d,i) { return typeof(d.order.raw)!="undefined" ? d.order.raw : d.order; });
    if(this.valueRange[0]>0) this.valueRange[0] = 0;
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[1]++;
    this.parsed = this.series.map(function(d,i) {
      return that.data.map(function(d,j) { return {order: d.order, value: d.values[i]}; });
    });
  },
  bind: function() {
    var that = this, sel;
    sel = this.dataGroup.selectAll("path.data.area").data(this.parsed);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "data area"});
    sel = this.dataGroup.selectAll("path.data.connect.line").data(this.parsed);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "data connect line"});
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.legend = plotd3.rwd.legend()
      .scale(this.cScale)
      .orient("bottom")
      .tickValues(this.dimension.values.fieldName)
      .size([this.width - 2 * this.config.margin, 200])
      .label(this.config.legendLabel || " ")
      .fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend).selectAll(".legend").on("mouseover", function(d,i) {
      that.activeGroup = i; that.render();
    }).on("mouseout", function(d,i) {
      that.activeGroup = null; that.render();
    });
    this.legendSize = (this.config.legendShow ? this.legend.offset() : [0,0]);
    this.areaBuilder.interpolate(this.config.lineSmoothing);
    this.lineBuilder.interpolate(this.config.lineSmoothing);
    this.yScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([
      this.height - this.config.margin - 
        (this.config.legendShow ? this.legendSize[1] + this.config.fontSize : 0),
      this.config.margin
    ]);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .label(this.config.yAxisLabel || " ")
      .labelPosition(this.config.yAxisLabelPosition)
      .tickValues(this.yScale.ticks(this.config.yAxisTickCount))
      .tickSize(this.config.yAxisTickSizeInner, this.config.yAxisTickSizeOuter)
      .tickPadding(this.config.yAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = (this.config.yAxisShow ? this.yAxis.offset() : 0);
    this.xScale = d3.scale.ordinal()
      .domain(this.orders)
      .rangePoints([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .label(this.config.xAxisLabel || " ")
      .labelPosition(this.config.xAxisLabelPosition)
      .tickSize(this.config.xAxisTickSizeInner, this.config.xAxisTickSizeOuter)
      .tickPadding(this.config.xAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = (this.config.xAxisShow ? this.xAxis.offset() : 0);
    this.yScale.range([
      this.height - this.config.margin - this.xAxisHeight -
      (this.config.legendShow ? this.legendSize[1] + this.config.fontSize : 0),
      this.config.margin
    ]);
    this.yAxisGroup.call(this.yAxis);
  },
  render: function() {
    var that = this;
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });
    this.legendGroup.attr({
      transform: [
        "translate(",
        (this.width - this.legendSize[0])/2, this.height - this.legendSize[1] - this.config.margin,
        ")"].join(" "),
      display: (this.config.legendShow ? "block" : "none")
    });
    this.xAxisGroup.selectAll(".domain").attr({ display: (this.config.xAxisShowDomain ? "block" : "none")});
    this.yAxisGroup.selectAll(".domain").attr({ display: (this.config.yAxisShowDomain ? "block" : "none")});
    this.xAxisGroup.attr({
      "transform": "translate(0," + this.yScale.range()[0] + ")",
      display: this.config.xAxisShow ? "block" : "none"
    });
    this.yAxisGroup.attr({
      "transform": "translate(" + this.xScale.range()[0] + ",0)",
      display: this.config.yAxisShow ? "block" : "none"
    });
    this.dataGroup.selectAll("path.area").attr({
      d: function(d,i) {
        return that.areaBuilder(d);
      },
      fill: function(d,i) {
        return that.cScale(that.dimension.values.fieldName[i]);
      }
    });
    this.dataGroup.selectAll("path.area").transition().duration(400).attr({
      opacity: function(d,i) {
        return that.config.fillOpacity / (that.activeGroup == null || that.activeGroup == i ? 1 : 10)
      }
    });
    this.dataGroup.selectAll("path.line").attr({
      d: this.lineBuilder,
      fill: "none",
      stroke: function(d,i) {
        return that.cScale(that.dimension.values.fieldName[i]);
      },
      "stroke-width": this.config.strokeWidth
    });
  }
});

