var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var count = 20;
    var value1 = [{name: "Last Year", data: d3.range(count).map(function() { return Math.random() * 1.5 + 1; })}];
    var value2 = [{name: "This Year", data: d3.range(count).map(function() { return Math.random() * 1 + 1.5; })}];
    var name = [{name: "Name", data: d3.range(count).map(function(it) { return plotdb.data.sample.name[it % plotdb.data.sample.name.length]; })}];
    /*var category = [{name: "Dept.",
      data: d3.range(count).map(function(it) { return plotdb.data.sample.category[it % plotdb.data.sample.category.length]; })}];
    */
    return {
      value1: value1, value2: value2, name: name/*, category: category*/
    };
  },
  dimension: {
    value1: { type: [plotdb.Number], require: true, desc: "value 1" },
    value2: { type: [plotdb.Number], require: true, desc: "value 2" },
    name: { type: [], require: true, desc: "value name"},
    //category: { type: [], require: false, desc: "category"}
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    yAxisLabel: {},
    sort: { type: [plotdb.Choice(["None", /*"Category",*/ "Value1", "Value2", "Length"])], default: "None", rebindOnChange: true },
    value1: { name: "Old Value", type: [plotdb.Color], default: "#940",
            hint: plotdb.Color.subtype.positive},
    value2: { name: "New Value", type: [plotdb.Color], default: "#049",
            hint: plotdb.Color.subtype.negative},
    value1Label: { name: "Old Label", type: [plotdb.String], default: "" },
    value2Label: { name: "New Label", type: [plotdb.String], default: "" }
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
  },
  parse: function() {
    var that = this;
    if(this.config.sort == "Value1") {
      this.data.sort(function(a,b) { return b.value1 - a.value1; });
    } else if(this.config.sort == "Value2") {
      this.data.sort(function(a,b) { return b.value2 - a.value2; });
    /*} else if(this.config.sort == "Category" && this.dimension.category.fields.length) {
      this.data.sort(function(a,b) {
        if(a.category > b.category) return -1;
        if(b.category > a.category) return 1;
        return 0;
      });
    */} else if(this.config.sort == "Length") {
      this.data.sort(function(a,b) {
        return (b.value2 - b.value1) - (a.value2 - a.value1);
      });
    }
    this.indexes = this.data.map(function(d,i) { return d.idx = i; });
    this.values = this.data.map(function(it) { return [it.value1, it.value2]; }).reduce(function(a,b) { return a.concat(b); }, []);
    this.valuerange = d3.extent(this.values);
    if(!this.valuerange[0]) this.valuerange[0] = 0;
    if(!this.valuerange[1]) this.valuerange[1] = 1;
    //this.catrange = d3.map(this.data, function(it) { return it.category || ""; }).keys().filter(function(it) { return it.length; });
    this.nameMaxLen = d3.max(this.data.map(function(it) { return (it.name || "").length; }));
