        return Math.random() * 30 +35;
      })}]
    };
  },
  dimension: {
    category: { type: [plotdb.Order], require: false, desc: "Category" },
    name: { type: [plotdb.String], require: false, desc: "Name ( used in tooltip )" },
    value: { type: [plotdb.Number], require: true, desc: "Value" }
  },
  config: {
    barWidth: {},
    margin: {},
    fontSize: {},
    xAxisLabel: {},
    yAxisLabel: {},
    fill: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.dataGroup = this.svg.append("g").attr({class: "data-groups"});
    this.tooltip = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      if(typeof(d.value) === "undefined") {
        popup.select(".title").text(d.key + " / Median");
        popup.select(".value").text(Math.round(100 * d.Q2)/100); 
      } else {
        popup.select(".title").text(d.category + (d.name? " / " + d.name : ""));
        popup.select(".value").text(Math.round(100 * d.value)/100);
      }
    });
    this.areaBuilder = d3.svg.area()
      .interpolate("basis")
      .x0(function(d,i) { return that.barWidth/2 - (d.count / (d.data.maxStep || 1)) * that.barWidth/2; })
      .x1(function(d,i) { return that.barWidth/2 + (d.count / (d.data.maxStep || 1)) * that.barWidth/2; })
      .y(function(d,i) { return that.yScale(i * d.data.step + d.data.min); });
  },
  parse: function() {
    var that = this,i,node,values,j;
    if(!this.dimension.category.fields.length) this.data.map(function(d,i) {
      d.category = "(no category)";
    });
    this.parsed = d3.nest().key(function(d,i) { return d.category; }).entries(this.data);
    plotdb.Order.sort(this.parsed, "key");
    this.categories = this.parsed.map(function(d,i) { return d.key; });
    this.valueRange = [];
    for(i=0;i<this.parsed.length;i++) {
      node = this.parsed[i];
      node.values.sort(function(a,b) { return a.value - b.value; });
      values = node.values.map(function(d,i) { return d.value; });
      node.min = d3.min(values);
      node.max = d3.max(values);
      this.valueRange.push.apply(this.valueRange, [node.min, node.max])
      node.Q1 = d3.quantile(values, 0.25);
      node.Q2 = d3.quantile(values, 0.50);
      node.Q3 = d3.quantile(values, 0.75);
      node.IQR = (node.Q3 - node.Q1) * 1.5
      node.W1 = -1;
      node.W3 = -1;
      node.outliers = [];
      for(j=0;j<values.length;j++) {
        if(values[j] < node.Q1 - node.IQR) node.outliers.push(node.values[j]);
        if(values[j] > node.Q3 + node.IQR) node.outliers.push(node.values[j]);
        if(values[j] >= node.Q1 - node.IQR && node.W1 < 0) node.W1 = j;
        if(values[j] > node.Q3 + node.IQR && node.W3 < 0) node.W3 = j - 1;
      }
      if(node.W1 >=0 ) node.W1 = values[node.W1] || 0; else node.W1 = values[0];
      if(node.W3 >=0 ) node.W3 = values[node.W3] || 0; else node.W3 = values[values.length - 1];
      node.lines = [node.W1, node.Q1, node.Q2, node.Q3, node.W3];
      node.histogram = [];
      var count = 30;
      node.step = (node.max - node.min)/count;
      for(var j=0;j<count;j++) {
        node.histogram[j] = 0;
      }
      for(var j=0,k;j<values.length;j++) {
        if(values[j] < node.min) continue;
        k = parseInt((values[j] - node.min)/(node.step || 1))
        if(k>=count) continue;
        node.histogram[k] = (node.histogram[k] || 0) + 1;
      }
      node.maxStep = d3.max(node.histogram);
      node.histogram = node.histogram.map(function(d,i) { return {data: node, count: d}; });
    }
    this.valueRange = d3.extent(this.valueRange);
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[1]++;
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("g.data-group").data(this.parsed);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      var central = node.append("circle").attr({class: "data center"});
      that.tooltip.nodes(central);
      node.append("path").attr({class: "range"});
      node.append("line").attr({class: "data top"});
      node.append("line").attr({class: "data bottom"});
    });
    this.dataGroup.selectAll("g.data-group").each(function(d,i) {
      var node = d3.select(this),sel;
      sel = node.selectAll("circle.data.outlier").data(d.outliers);
      sel.exit().remove();
      sel = sel.enter().append("circle").attr({class: "data outlier"});
      that.tooltip.nodes(sel);
    });
    this.resize();
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.tooltip.fontSize(this.config.fontSize);
    this.labelWidth = d3.max(this.dataGroup.selectAll("text.label.data").attr({"font-size": this.config.fontSize})[0].map(function(d,i) {
      return d.getBoundingClientRect().width;
    }));
    this.yScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([this.height - this.config.margin, this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .label(this.config.yAxisLabel || this.dimension.value.fieldName || " ")
      .labelPosition("in")
      .fontSize(this.config.fontSize);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.ordinal()
      .domain(this.categories)
      .rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
