var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var count = 30;
    var value = [{name: "value", data: d3.range(count).map(function() { 
      var v = Math.random();
      if(v < 0.7) return Math.random() + 1;
      if(v < 0.9) return Math.random() * 5 + 3;
      return Math.random() * 10 + 6;
      return Math.random(); 
    })}];
    var name = [{name: "name", data: d3.range(count).map(function() { return plotdb.data.sample.name.rand(); })}];
    var category = [{name: "category", data: d3.range(count).map(function() { return plotdb.data.sample.category.rand(); })}];
    return {
      value: value,
      name: name,
      category: category
    };
  },

  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "size of circle" },
    name: { type: [], require: false, desc: "tag of circle" },
    category: { type: [], require: false, desc: "category of circle"},
  },
  config: {
    fontFamily: {},
    background: {},
    fontSize: {},
    margin: {},
    bubblePadding: {},
    palette: {},
    legendShow: {},
    labelShadowSize: {},
    showLabel: {},
    sort: { type: [plotdb.Choice(["value","category","name"])], default: "value", rebindOnChange: true},
    catInBubble: { name: "Cat in Bubble", type: [plotdb.Boolean], default: true,  },
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.popup = plotd3.html.popup(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name);
      popup.select(".value").text(parseInt(100 * d.value)/100);
    });
  },
  parse: function() {
    if(this.dimension.category.fields.length) {
      this.categories = d3.map(this.data, function(d,i) { return d.category; }).keys();
    } else {
      this.categories = [];
    }
  },
  bind: function() {
    var that = this,sel;
    this.resize();
    sel = this.svg.selectAll("circle").data(this.nodes);
    sel.exit().remove();
    sel = sel.enter().append("circle").attr({opacity: 1});
    this.popup.nodes(sel);
    sel = this.svg.selectAll("g.label").data(this.nodes);
    sel.exit().remove();
    sel = sel.enter().append("g").attr({class: "label"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("text").attr({class: "name shadow"});
      node.append("text").attr({class: "category shadow"});
      node.append("text").attr({class: "name"});
      node.append("text").attr({class: "category"});
    });
    this.popup.nodes(sel);
    this.circles = this.svg.selectAll("circle");
    this.labels = this.svg.selectAll("g.label");
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.legendWidth = (d3.max(this.categories.map(function(d) { return ((d || "")+"").length;})) + 2) * that.config.fontSize;
    if(isNaN(this.legendWidth)) this.legendWidth = 0;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.legend = plotd3.rwd.legend()
      .orient("right")
      .scale(this.cScale)
      .size([220, this.height - this.config.margin * 2])
      .tickValues(this.categories)
      .fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend).selectAll(".legend").on("mouseover",function(d,i) {
      that.activeGroup = d;
      that.render();
    }).on("mouseout",function(d,i) { 
      that.activeGroup = null;
      that.render();
    });
    this.legendSize = this.legend.offset();
    this.sortby = this.config.sort;
    this.bubble = d3.layout.pack()
    .sort(function(a,b) {
      if(a[that.sortby] < b[that.sortby]) return 1;
      else if(a[that.sortby] > b[that.sortby]) return -1;
      return 0;
    }).padding(this.config.bubblePadding).size([width - (this.config.legendShow ? this.legendWidth : 0),height]);
    this.nodes = this.bubble.nodes({children: this.data}).filter(function(it) { return it.depth; });
    for(var i = 0,n,f1,f2; i < this.nodes.length; i++) {
      n = this.nodes[i];
      f1 = n.r * 1.8 / (""+(n.name || "")).length;
      f2 = n.r * 1.8 / (""+(n.category || "")).length;
      n.f1 = (f1 > that.config.fontSize * 1.2 ? that.config.fontSize * 1.2 : f1);
      if(f1 < 14) n.f1 = 14;
      n.f2 = (f2 > that.config.fontSize * 0.9 ? that.config.fontSize * 0.9 : f2);
      n.f2 = (n.f1 < n.f2? n.f1: n.f2);
      if(n.f2 < 12) n.f2 = 12;

    }
  },
  render: function() {
    var that = this;
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });

    this.legendGroup.attr({
      transform: ["translate(", this.width - this.legendSize[0] - this.config.margin, (this.height - this.legendSize[1])/2, ")"].join(" "),
      display: (this.config.legendShow ? "block" : "none")
    });
    this.circles.attr({
      cx: function(it) { return it.x; },
      cy: function(it) { return it.y; },
      r:  function(it) { return it.r; }
    }).style({
      fill: function(it) { 
        return that.cScale(it.category);
      },
      stroke: function(it) {
        return d3.hsl(that.cScale(it.category)).darker().toString();
      }
    });
    this.circles.transition().attr({ opacity: function(d) {
      if(!that.activeGroup || d.category == that.activeGroup) return 1;
      return 0.1;
    }});
    this.labels.attr({
      transform: function(d,i) { return ["translate(",d.x,d.y,")"].join(" "); },
    }).each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("text").attr({
        "text-anchor": "middle",
        "dominant-baseline": "central",
        dy: function() {
          if(!that.config.catInBubble) return 0;
          return ( d3.select(this).classed("name") ? -1 : 1 ) * (d.f1 + d.f2) / 4;
        },
        "font-size": function() {
          return d3.select(this).classed("name") ? d.f1 : d.f2;
        },
        "font-weight": function() {
          return d3.select(this).classed("name") ? "bold" : "light";
        },
        opacity: function() {
          if(!that.config.showLabel) return 0;
          if(!that.config.catInBubble && d3.select(this).classed("category")) return 0;
          return 1;
        },
        fill: function() {
          var hsl = d3.hsl(that.cScale(d.category));
          if(hsl.l > 0.65) return "#000"; else return "#fff";
        },
        stroke: function(it) {
          if(!d3.select(this).classed("shadow")) return "none";
          var hsl = d3.hsl(that.cScale(it.category));
          if(hsl.l > 0.65) return "#fff"; else return "#000";
        },
        "stroke-width": function(d,i) {
          if(!d3.select(this).classed("shadow")) return 2;
          return that.config.labelShadowSize || 0;
        },
      }).text(function() { return d3.select(this).classed("name") ? d.name : d.category; });
    });
    this.labels.attr({
      opacity: function(d,i) {
        var node = d3.select(this);
        var wName = node.select("text.name")[0][0].getBBox().width;
        var wCat = node.select("text.category")[0][0].getBBox().width;
        if(wName >= d.r * 2.2 || wCat >= d.r * 2.2) return 0;
        return 1;
      }
    });
  }
});

