    palette: { name: "Palette", type: [plotdb.Palette], default: plotdb.Palette.default}
  },
  snap: function(d,i) {
    d.x = d.px = Math.round(d.x/60)*60;
    d.y = d.py = Math.round(d.y/30)*30;
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.dataGroup = this.svg.append("g");
    this.nodes = JSON.parse(JSON.stringify(taiwanMRT.nodes));
    this.links = JSON.parse(JSON.stringify(taiwanMRT.links));
    this.force = d3.layout.force().nodes(this.nodes).links(this.links).on("tick",function() { that.tick(); });
    this.force.friction(0).charge(0).gravity(0).linkStrength(0);
    for(var i=0;i<this.nodes.length;i++) {
      this.nodes[i].ix = taiwanMRT.nodes[i].x;
      this.nodes[i].iy = taiwanMRT.nodes[i].y;
    }
