    size: { type: [plotdb.Number], require: true, desc: "size of event bubble"},
    name: { type: [], require: true, desc: "name of event bubble" }
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    legendLabel: {},
    colorEmpty: {},
    colorPositive: {},
    colorNeutral: {},
    colorNegative: {},
    stroke: {},
    threshold: {},
    scale: { name: "Radius Scale", type: [plotdb.Choice(["linear","sqrt"])], default: "linear"},
    minRadius: { name: "Min Radius", type: [plotdb.Number], default: 0},
    maxRadius: { name: "Max Radius", type: [plotdb.Number], default: 30},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.sampleDataPath = this.assets["quake.json"].datauri;
    this.svg.call(d3.behavior.drag()
      .origin(function() {
        r = that.projection.rotate();
        return {x: r[0], y: 0};
      })
      .on("drag", function() {
        var rotate = that.projection.rotate();
        var y = rotate[1] - d3.event.dy;
        if(y < -30) y = -30;
        if(y > 30) y = 30;
        that.rotate = rotate;
        that.projection.rotate([d3.event.x, y, rotate[2]]);
        that.render();
      }));
    this.grids = this.svg.append("path")
      .attr({class: "grid sphere"})
      .datum(d3.geo.graticule());
    this.svg.append("path").attr({class: "sphere frame"});
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.svg.append("path").attr({class: "sphere frame"});
    this.spheres = this.svg.selectAll("path.sphere.frame").datum({type: "Sphere"});
    this.tooltip = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name);
      popup.select(".value").text(d.size);
      return false;
    }).active(function(d,i) { return d.active; });
    this.rotate = [0,0,0];
    this.parsed = {};
    this.sizeRange = [0,1];
    d3.json(this.sampleDataPath, function(quake) {
      that.sampleData = quake;
      that.parse();
      that.resize();
      that.bind();
      that.render();
    });
  },
  parse: function() {
    var that = this;
    //this.data.map(function(d,i) { d.country = worldmap.getName(d.country) || d.country; });
    //this.data.forEach(function(d,i) { that.parsed[d.country] = d.value; });
    this.countries = topojson.feature(worldmap.features, worldmap.features.objects.countries).features;
    for(var i=0,node;i<this.countries.length;i++) {
      node = this.countries[i];
      node.name = worldmap.getName(node.id);
      //node.value = this.parsed[node.name];
    }
    if(!this.sampleData) return;
    if(!this.data.length) {
      this.data = this.sampleData.map(function(d,i) {
        return {latitude: d[1], longitude: d[0], size: d[2], name: ""};
      });
      this.sizeRange = d3.extent(this.data.map(function(d) { return d.size; }));
    } else {
      if(!this.dimension.size.fields.length) {
        this.data.map(function(d,i) { d.size = 10; });
        if(!this.dimension.size.fields.length) this.sizeRange = [0,10];
      } else {
        this.sizeRange = d3.extent(this.data.map(function(d) { return d.size; }));
        if(this.sizeRange[0] == this.sizeRange[1]) this.sizeRange[1]++;
      }
    }
    //this.valueRange = d3.extent(this.countries.map(function(d) { return d.value; }));
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("path.country").data(this.countries);
    sel.exit().remove();
    sel = sel.enter().append("path").attr({class: "country"});
    this.tooltip.nodes(sel);
    sel = this.dataGroup.selectAll("circle.data").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("circle").attr({class: "data"});
    this.svg.selectAll("circle.data").sort(function(a,b) { return a.size - b.size; });
    this.tooltip.nodes(sel);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.minRadius = this.config.minRadius;
    this.maxRadius = this.config.maxRadius;
    if(this.minRadius > this.maxRadius) this.minRadius = this.maxRadius;
    this.threshold = this.config.threshold;
    if(this.threshold < this.sizeRange[0]) this.threshold = this.sizeRange[0];
    if(this.threshold > this.sizeRange[1]) this.threshold = this.sizeRange[1];

    if(this.config.scale == "sqrt") this.rScale = d3.scale.sqrt();
    else this.rScale = d3.scale.linear();
    this.rScale
      .domain([this.sizeRange[0], this.sizeRange[1]])
      .range([0, this.maxRadius]);
    this.cScale = d3.scale.linear()
      .domain([this.sizeRange[0], this.threshold, this.sizeRange[1]])
      .range([this.config.colorNegative, this.config.colorNeutral, this.config.colorPositive]);
    this.legend = plotd3.rwd.legend()
      .orient("right")
      .scale(this.cScale)
      .fontSize(this.config.fontSize);
    this.legend.label(this.config.legendLabel || this.dimension.size.fieldName || "");
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    var mw = width - this.legendSize[0] - this.config.fontSize, mh = height;
    this.size = (mw>mh?mh:mw) - 2 * this.config.margin;
    if(this.size < 50) this.size = 50;
    this.tooltip.fontSize(this.config.fontSize);
    var rate = this.size * 0.50076;
    this.projection = d3.geo.orthographic().scale(rate).translate([(width - this.legendSize[0] - this.config.fontSize)/2,height/2]).clipAngle(90);
    this.path = d3.geo.path().projection(this.projection);
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: ["translate(", (this.width - this.config.margin - this.legendSize[0]), (this.height - this.legendSize[1])/2, ")"].join(" ")
    });
    this.spheres.attr({
      d: this.path,
      fill: function(d,i) { return (!i?"rgba(0,0,0,0.05)":"none"); },
      stroke: "rgba(0,0,0,0.5)",
      "stroke-width": 2
    });
    this.grids.attr({
      d: that.path,
      fill: "none",
      stroke: "rgba(0,0,0,0.1)",
      "stroke-width": 1
    });
    this.svg.selectAll("path.country").attr({
      d: that.path,
      class: function(it) {
        return "country "+it.properties.name;
      },
      "fill": function(it) {
        if(typeof(it.value)=="undefined" || it.value == null) return that.config.colorEmpty;
        return that.cScale(it.value);
      },
      "stroke": function(it) {
        return that.config.stroke;
      },
      "stroke-width": 1
    });
    this.svg.selectAll("circle").attr({
      transform: function(d,i) {
        var ret = that.projection([d.longitude, d.latitude]);
        return ["translate(", ret[0], ret[1], ")"].join(" ");
      },
      cx: 0, cy: 0,
      r: function(d,i) { 
        var r = that.rScale(d.size);
        return r < that.minRadius ? that.minRadius : r;
      },
      opacity: function(d,i) {
        var r = ((Math.round(-that.rotate[0]) + 180) % 360);
        var t = that.rotate[1];
        var t = that.rotate[1] * d.latitude / 90;
        var r1 = r - 90 + t, r2 = r + 90- t;
        var lon = (d.longitude + 180);
        var delta = Math.abs(lon - r);
        var ret = (
          (lon > r1 && lon < r2) ||
          (lon > r1 + 360) ||
          (lon < r2 - 360)) ? 1 : 5/delta;
        d.active = (ret==1 ? true : false);
        return ret;
      },
      "stroke-width": 1,
      stroke: function(d,i) { return that.cScale(d.size); },
      fill: function(d,i) { 
        var rgb = d3.rgb(that.cScale(d.size));
        return "rgba(" + rgb.r + "," + rgb.g + "," + rgb.b +", 0.2)";
      }
    });
  }
});

