      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.rscale = d3.scale.linear().domain(this.valuerange).range([0, this.size/2]);
    this.ascale = d3.scale.linear()
      .domain([this.orderrange[0],this.orderrange[1] + 1])
      .range([0, Math.PI * 2]);
    this.gridRadiusTicks = this.rscale
      .ticks( ((this.size/2)/20)>5 ? 5 : parseInt(this.size/40) )
      .concat(this.valuerange);
    this.gridAngleTicks = this.ascale.ticks(10);
    this.gridAngleTicks.splice(this.gridAngleTicks.length - 1, 1);
    var update = this.grids.selectAll("circle.grid.radius").data(this.gridRadiusTicks)
    update.enter().append("g").attr({class: "grid radius"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("circle");
      node.append("g").attr({class: "tick"}).append("text").text(parseInt(10 * d)/10);
    });
    update.exit().remove();
    var update = this.grids.selectAll("circle.grid.angle").data(this.gridAngleTicks)
    update.enter().append("g").attr({class: "grid angle"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("line");
      node.append("g").attr({class: "tick"}).append("text").text(parseInt(10 * d) / 10);
    });
    update.exit().remove();
    this.gradient.attr({
      cx: this.width / 2,
      cy: this.height / 2,
      r: this.size / 2,
      "gradientUnits": "userSpaceOnUse"
    });
    update = this.gradient.selectAll("stop").data(this.config.palette.colors);
    update.exit().remove();
    update.enter().append("stop").attr({
      offset: function(d,i) {
        return (100 * i / ((that.config.palette.colors.length - 1) || 1))+"%";
      },
      "stop-color": function(d,i) {
        return d.hex;
      }
    });
  },
  render: function() {
    var that = this;
    this.svg.selectAll("path.data").attr({
      d: function(d,i) {
        var angle = that.ascale(d.order);
        var x1 = that.width  / 2 + that.rscale(d.min) * Math.cos(angle - that.dangle / 2); 
        var y1 = that.height / 2 + that.rscale(d.min) * Math.sin(angle - that.dangle / 2); 
        var x2 = that.width  / 2 + that.rscale(d.min) * Math.cos(angle + that.dangle / 2); 
        var y2 = that.height / 2 + that.rscale(d.min) * Math.sin(angle + that.dangle / 2);
        var x3 = that.width  / 2 + that.rscale(d.max) * Math.cos(angle - that.dangle / 2); 
        var y3 = that.height / 2 + that.rscale(d.max) * Math.sin(angle - that.dangle / 2); 
        var x4 = that.width  / 2 + that.rscale(d.max) * Math.cos(angle + that.dangle / 2); 
        var y4 = that.height / 2 + that.rscale(d.max) * Math.sin(angle + that.dangle / 2); 
        return ["M", x1, y1, 
         "L", x2, y2, 
         "L", x4, y4,
         "L", x3, y3,"Z"].join(" ");
      },
      fill: "url(#radialGradient)",
      opacity: 0.8
    });
    this.grids.selectAll("g.grid.radius").each(function(d,i) {
      var node = d3.select(this);
      node.select("circle").attr({
        cx: that.width / 2,
        cy: that.height / 2,
        r: function(it) { return that.rscale(it); },
        fill: "none",
        stroke: "#000",
        opacity: 0.3,
        "stroke-dasharray": "8 0"
      });
      node.select("text").attr({
        "font-size": that.config.fontSize,
        "text-anchor": "middle",
        "dominant-baseline": "bottom",
        x: function(d,i) { return that.width / 2; },
        y: function(d,i) { return that.height / 2 - that.rscale(d); },
        dy: -that.config.fontSize / 2,
        opacity: 0.5
      });
    });
    this.grids.selectAll("g.grid.angle").each(function(d,i) {
      var node = d3.select(this);
      node.select("line").attr({
        x1: function(it) { return that.width  / 2 + that.rscale(that.valuerange[0]) * Math.cos(that.ascale(it)) },
        y1: function(it) { return that.height / 2 + that.rscale(that.valuerange[0]) * Math.sin(that.ascale(it)) },
        x2: function(it) { return that.width  / 2 + that.rscale(that.valuerange[1]) * Math.cos(that.ascale(it)) },
        y2: function(it) { return that.height / 2 + that.rscale(that.valuerange[1]) * Math.sin(that.ascale(it)) },
        fill: "none",
        stroke: "#000",
        opacity: 0.3,
        "stroke-dasharray": "2 3"
      });
      node.select("text").attr({
        "font-size": that.config.fontSize,
        transform: function(d,i) {
          var r = that.rscale(that.valuerange[1]) + that.config.fontSize;
          console.log(d);
          return [
            "translate(",( that.width / 2 ), ( that.height / 2) ,")",
            "rotate(",that.ascale(d) * 180 / Math.PI,")",
            "translate(",r,0,")"].join(" ");
        },
        "text-anchor": "start",
        "dominant-baseline": "central",
        opacity: 0.5
      });
    });
  }
});

