      popup.select(".value div:nth-of-type(2)").text((that.config.xAxisLabel || that.dimension.x.fieldName) + ": " + (Math.round(100*d.x)/100));
      popup.select(".value div:nth-of-type(3)").text((that.config.yAxisLabel || that.dimension.y.fieldName) + ": " + (Math.round(100*d.y)/100));
    });
