      .scale(this.xScale)
      .orient("bottom")
      .tickValues(this.xTicks)
      .fontSize(this.config.fontSize)
      .labelPosition("in");
    this.xAxis.label(this.config.xAxisLabel || this.dimension.x.fieldName || "");
    this.xAxisGroup.call(this.xAxis);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .tickValues(this.yTicks)
      .boundaryTickInside(true)
      .fontSize(this.config.fontSize)
      .labelPosition("in");
    this.yAxis.label(this.config.yAxisLabel || this.dimension.y.fieldName || "");
    this.yAxisGroup.call(this.yAxis);
  },
  render: function() {
    var that = this;
    var m = this.config.margin;
    var yOffset = this.yScale(this.config.yCriteria);
    var xOffset = this.xScale(this.config.xCriteria);
    this.legendGroup.attr({
      transform: ["translate(", (this.width - this.legendSize[0])/2, (this.height - this.config.margin - this.legendSize[1]), ")"].join(" ")
