      stroke: "#000",
      "stroke-width": 2
    });
    this.frameInner.attr({
      x: this.config.margin + this.maxRadius,
      y: this.config.margin + this.maxRadius,
      width: this.width - this.config.margin * 2 - this.maxRadius * 2,
      height: this.height - this.config.margin * 2 - this.maxRadius * 2 - this.legendSize[1] - this.config.fontSize,
      fill: "none",
      stroke: "#000",
