var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var count = 20;
    var value1 = [{name: "Last Year", data: d3.range(count).map(function() { return Math.random() * 1.5 + 1; })}];
    var value2 = [{name: "This Year", data: d3.range(count).map(function() { return Math.random() * 1 + 1.5; })}];
    var name = [{name: "Name", data: d3.range(count).map(function(it) { return plotdb.data.sample.name[it % plotdb.data.sample.name.length]; })}];
    var category = [{name: "Dept.",
      data: d3.range(count).map(function(it) { return plotdb.data.sample.category[it % plotdb.data.sample.category.length]; })}];
    return {
      value1: value1, value2: value2, name: name, category: category
    };
  },
  dimension: {
    value1: { type: [plotdb.Number], require: true, desc: "value 1" },
    value2: { type: [plotdb.Number], require: true, desc: "value 2" },
    name: { type: [], require: true, desc: "value name"},
    category: { type: [], require: false, desc: "category"}
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    palette: {},
    xAxisTickSizeInner: {},
    xAxisTickSizeOuter: {},
    xAxisTickPadding: {},
    sort: { type: [plotdb.Choice(["None", "Category", "Value1", "Value2", "Length"])], default: "None", rebindOnChange: true },
    value1: { name: "Old Value", type: [plotdb.Color], default: "#940",
            hint: plotdb.Color.subtype.positive},
    value2: { name: "New Value", type: [plotdb.Color], default: "#049",
            hint: plotdb.Color.subtype.negative},
    value1Label: { name: "Old Label", type: [plotdb.String], default: "" },
    value2Label: { name: "New Label", type: [plotdb.String], default: "" }
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
  },
  parse: function() {
    var that = this;
    if(this.config.sort == "Value1") {
      this.data.sort(function(a,b) { return b.value1 - a.value1; });
    } else if(this.config.sort == "Value2") {
      this.data.sort(function(a,b) { return b.value2 - a.value2; });
    } else if(this.config.sort == "Category" && this.dimension.category.fields.length) {
      this.data.sort(function(a,b) {
        if(a.category > b.category) return -1;
        if(b.category > a.category) return 1;
        return 0;
      });
    } else if(this.config.sort == "Length") {
      this.data.sort(function(a,b) {
        return (b.value2 - b.value1) - (a.value2 - a.value1);
      });
    }
    this.indexes = this.data.map(function(d,i) { return d.idx = i; });
    this.values = this.data.map(function(it) { return [it.value1, it.value2]; }).reduce(function(a,b) { return a.concat(b); }, []);
    this.valuerange = d3.extent(this.values);
    if(!this.valuerange[0]) this.valuerange[0] = 0;
    if(!this.valuerange[1]) this.valuerange[1] = 1;
    this.catrange = d3.map(this.data, function(it) { return it.category || ""; }).keys().filter(function(it) { return it.length; });
    this.nameMaxLen = d3.max(this.data.map(function(it) { return (it.name || "").length; }));
    this.catmap = this.data.map(function(d,i) { return [d.category, i]; });
    this.catextent = [];
    for(var i = 0; i < this.catrange.length; i++) {
      var list = this.catmap.filter(function(it) {  return it[0] == that.catrange[i]; });
      this.catextent.push([this.catrange[i], list[0][1], list[list.length - 1][1]]);
    }
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("g.data-group").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data-group"})
    .each(function(d,i) {
      var node = d3.select(this);
      node.append("line").attr({class: "connect", opacity: 1});
      node.append("circle").attr({class: "data value1", opacity: 1}).on("mouseover", function() {
        that.activeGroup = 1; that.render(); 
      }).on("mouseout", function() { that.activeGroup = 0; that.render(); });
      node.append("circle").attr({class: "data value2", opacity: 1}).on("mouseover", function() {
        that.activeGroup = 2; that.render(); 
      }).on("mouseout", function() { that.activeGroup = 0; that.render(); });
    });
    sel = this.svg.selectAll("g.category").data(this.catextent);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "category"})
    .each(function(d,i) {
      var node = d3.select(this);
      node.append("line");
      node.append("text");
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var svgbox = this.svg[0][0].getBoundingClientRect();
    var width = this.width = box.width;
    this.xAxisHeight = this.config.fontSize * 2;
    var height = (this.config.fontSize * 1.5 + 10 + this.config.padding )* this.data.length + this.xAxisHeight + that.config.margin * 2;
    height = (box.height - svgbox.top > height - svgbox.top ? box.height - svgbox.top - 3: height - svgbox.top - 3);
    this.height = height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    var legendScale = d3.scale.ordinal()
      .domain([
        this.config.value1Label || this.dimension.value1.fieldName || "before",
        this.config.value2Label || this.dimension.value2.fieldName || "after"])
      .range([this.config.value1, this.config.value2]);
    this.legend = plotd3.rwd.legend().orient("top").scale(legendScale).fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    this.legendSize[1] += this.config.fontSize;
    this.legendGroup.selectAll(".legend").on("mouseover", function(d,i) {
      that.activeGroup = i + 1;
      that.render();
    }).on("mouseout", function(d,i) {
      that.activeGroup = null;
      that.render();
    });
    var rate = this.config.padding / (this.config.fontSize * 1.5 + 10 + this.config.padding);
    this.yScale = d3.scale.ordinal()
      .domain(this.indexes)
      .rangePoints([
        this.xAxisHeight + this.legendSize[1] + this.config.margin + this.config.fontSize,
        this.height - this.config.margin - this.config.fontSize
      ], rate, rate);
    this.yAxis = plotd3.rwd.axis().orient("left").scale(this.yScale).fontSize(this.config.fontSize)
    .tickFormat(function(it) { 
      return that.data[it].name; 
    });
    this.yAxisGroup.call(this.yAxis);
    this.yAxisGroup.selectAll(".tick line").remove();
    this.yAxisGroup.selectAll(".domain").remove();
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.linear().domain(this.valuerange).range([
      this.yAxisWidth + this.config.margin + 2 * this.config.fontSize, width - this.config.margin - this.config.fontSize * 0.5
    ]);
    this.xAxis = plotd3.rwd.axis()
      .orient("top")
      .scale(this.xScale)
      .tickSize(this.config.xAxisTickSizeInner,this.config.xAxisTickSizeOuter)
      .tickPadding(this.config.xAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    ticks = this.xAxis.tickValues();
    var update = this.gridGroup.selectAll("line.grid.vertical").data(ticks);
    update.exit().remove();
    update.enter().append("line").attr({class: "grid vertical"});
    this.cscale = plotdb.Palette.scale.ordinal(this.config.palette);
  },
  render: function() {
    var that = this;
    var maxWidth = 0;
    this.legendGroup.attr({ transform: [
      "translate(", (this.width - this.legendSize[0])/2, this.config.margin, ")"
    ].join(" ")});
    this.yAxisGroup.attr({ transform: "translate(" + (this.yAxisWidth + this.config.margin) +",0)" });
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize
    });
    this.svg.selectAll("line.grid.vertical").attr({
      y1: this.xAxisHeight + this.config.margin + this.legendSize[1],
      y2: that.height - that.config.margin,
      x1: function(it) { return that.xScale(it); },
      x2: function(it) { return that.xScale(it); },
      stroke: "#999",
      "stroke-dasharray": "2 4"
    });
    this.xAxisGroup.attr({
      transform: "translate(0,"+ ( this.xAxisHeight + this.config.margin + this.legendSize[1]) + ")"
    });
    this.svg.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return [
          "translate(",
          0,
          ",",
          that.yScale(d.idx),
          ")"
        ].join("");
      }
    }).each(function(d,i) {
      var node = d3.select(this);

      node.select("circle.value1").attr({
        cx: function(it) { return that.xScale(it.value1); },
        cy: 0,
        r: that.config.fontSize * 0.5,
        fill: that.config.value1,
        stroke: that.config.value1
      }).transition().attr({
        opacity: function() { if(!that.activeGroup || that.activeGroup == 1) return 1; else return 0.1; }
      });
      node.select("circle.value2").attr({
        cx: function(it) { return that.xScale(it.value2); },
        cy: 0,
        r: that.config.fontSize * 0.5,
        fill: that.config.value2,
        stroke: that.config.value2
      }).transition().attr({
        opacity: function() { if(!that.activeGroup || that.activeGroup == 2) return 1; else return 0.1; }
      });
      node.select("line").attr({
        x1: function(it) { return that.xScale(it.value1); },
        x2: function(it) { return that.xScale(it.value2); },
        y1: 0, y2: 0,
        stroke: function(it) {
          return (it.value1 > it.value2 ? that.config.value1 : that.config.value2 )
        }
      }).transition().attr({
        opacity: function(d) {
          var v = ((d.value1 - d.value2)>=0 ? 1 : 2);
          if(!that.activeGroup || that.activeGroup == v) return 1; else return 0.1;
        }
      });
    });
    this.svg.selectAll("g.category line").attr({
      x1: that.yAxisWidth + that.config.margin + 1 + that.config.fontSize / 2,
      x2: that.yAxisWidth + that.config.margin + 1 + that.config.fontSize / 2,
      y1: function(d,i) { return that.yScale(d[1]) - that.config.fontSize; },
      y2: function(d,i) { return that.yScale(d[2]) + that.config.fontSize; },
      stroke: function(d,i) { return that.cscale(d[0]); },
      "stroke-width": that.config.fontSize + 2
    }).style({
      display: (this.config.sort == "Category" && this.dimension.category.fields.length ? "block" : "none")
    });
    this.svg.selectAll("g.category text").attr({
      x: that.yAxisWidth + that.config.margin + 1 + that.config.fontSize / 2,
      y: function(d,i) { return that.yScale(d[1]) - that.config.fontSize * 0.5; },
      "writing-mode": "tb",
      "font-size": 0.8 * that.config.fontSize,
      fill: function(d,i) {
        var c = d3.hsl(that.cscale(d[0]));
        return (c.l > 0.7 ? "#000" : "#fff");
      },
    }).style({
      display: (this.config.sort == "Category" && this.dimension.category.fields.length ? "block" : "none")
    }).text(function(d,i) { return d[0]; });
  }
});

