module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(200);
    return {
      size: [{name: "Size", data: list.map(function(d,i) { return Math.round(Math.random() * 90 + 10); })}],
      rate: [{name: "Score", data: list.map(function(d,i) {
        return (100 * d3.range(24).map(function() { return Math.random(); }).reduce(function(a,b) { return a + b; }, 0)/24);
      })}],
      name: [{name: "Name", data: list.map(function(d,i) { return plotdb.data.sample.name.rand(); })}],
      category: [{name: "Dept.", data: list.map(function(d,i) { return plotdb.data.sample.category.rand(); })}]
    };
  },
  dimension: {
    size: { type: [plotdb.Number], require: true, desc: "Size of circle" },
    rate: { type: [plotdb.Percent], require: true, desc: "X position of circle" },
    name: { type: [], require: false, desc: "Name of Data" },
    category: { type: [plotdb.String], require: true, desc: "Category of Data"}
  },
  config: {
    fontSize: {},
    margin: {},
    palette: {},
    maxRadius: { type: [plotdb.Number], default: 20 }
  },
  init: function() {
    var that = this;
    d3.select(this.root).style({position: "relative"});
    this.svg = d3.select(this.root).append("svg");
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.central = true;
    this.popup = plotd3.html.popup(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title span").text(d.name);
      popup.select(".title small").text(" ( " + d.category + " ) ");
      popup.select(".value div").text(Math.round(100 * d.rate)/100);
      popup.select(".value span").text(d.size);
    });
    this.popup.getPopupNode().call(function(d,i) {
      this.select(".title").append("span");
      this.select(".title").append("small");
      this.select(".value").append("div");
      this.select(".value").append("span");
    });
  },
  parse: function() {
    var that = this;
    for(var idx = 0; idx < this.data.length ;idx ++ ){
      this.data[idx].radius = Math.sqrt( this.data[idx].size );
    }
    this.radiusRange = this.data.map(function(it) { return it.radius; });
    this.categories = d3.map(this.data, function(it) { return it.category || ""; }).keys();
    var ratescale = d3.scale.linear()
      .domain(d3.extent(this.data.map(function(it) { return it.rate;})))
      .range([0,100]);
    for(var idx = 0; idx < this.data.length; idx ++) {
      this.data[idx].rate = ratescale(this.data[idx].rate);
    }
    this.categoryObj = this.categories.map(function(it) {
      return {key: it, y: (that.categories.indexOf(it) + 1) / ( that.categories.length + 2)};
    });
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("text.central").data(this.categoryObj);
    sel.exit().remove();
    sel.enter().append("text").attr({class: "central"});
    sel = this.svg.selectAll("line.central.grid").data(this.categoryObj);
    sel.exit().remove();
    sel.enter().append("line").attr({class: "central grid"});
    sel = this.svg.selectAll("circle.data").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("circle").attr({class: "data", opacity: 1});
    this.popup.nodes(sel);
    d3.select(".pdb-root .btn-whole").on("click", function() {
      that.central = true;
      for(var idx = 0; idx < that.data.length; idx++ )  {
        that.data[idx].cy = that.height / 2;
      }
      that.prerender();
    });
    d3.select(".pdb-root .btn-category").on("click", function() {
      that.central = false;
      for(var idx = 0; idx < that.data.length; idx++ )  {
        item = that.data[idx];
        item.cy = (that.categories.indexOf(item.category) + 1 )* that.height / (that.categories.length + 2);
      }
      that.prerender();
    });
    this.prerender();
  },
  tick: function() {
    // collision detection, for prevent circles from overlapping
    var alpha = this.force.alpha();
    // if(alpha < 0.08) this.force.stop();
    for(i = 0; i < this.data.length ; i++) {
      var item = this.data[i];
      if(Math.abs(item.y - item.cy) > 0) {
        item.y = item.y + (item.cy - item.y ) * (this.central?alpha:0.2) / 5.0;
      }
      if(Math.abs(item.x - item.cx) > 0) {
        item.x = item.x + ( item.cx - item.x ) * alpha / 2.0;
      }
    }
    var count = this.data.length/5;
    /*
    for(i = 0 ; i < this.data.length ; i++) {
      for(j = 0 ; j < this.data.length ; j++) {*/
    var i2,j2; //randomized collision detection
    for(i=0;i<count;i++) {
      i2 = parseInt(Math.random() * this.data.length);
      for(j=0;j<count;j++) {
        j2 = parseInt(Math.random() * this.data.length);
        it = this.data[i2];
        jt = this.data[j2];
        if(i2==j2) continue; // not collide with self
        //if(i==j) continue; // not collide with self
        r = it.r + jt.r;
        itx = it.x;
        ity = it.y;
        jtx = jt.x;
        jty = jt.y;
        d = Math.sqrt( (itx - jtx) * (itx - jtx) + (ity - jty) * (ity - jty) );
        if(r > d) { // distance smaller than radius means collision
          dr = ( r - d ) / ( d * 1 );
          it.x = it.x + ( itx - jtx ) * dr * 0.1;
          it.y = it.y + ( ity - jty ) * dr * 0.1;
        }
    }};
    var maxx = this.width - this.config.margin * 2 - this.maxRadius * 2 - this.categorySize;
    for(var i=0,node;i<this.data.length;i++) {
      node = this.data[i];
      if(node.x<0) node.x = 0;
      if(node.x > maxx) node.x = maxx;
    }
    this.render(this.root, this.data, this.config);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    this.width = box.width;
    this.height = box.height;
    this.maxRadius = this.config.maxRadius;
    this.svg.attr({
      viewBox: [0,0,this.width,this.height].join(" "),
      width: this.width, height: this.height,
      preserveAspectRatio: "xMidYMid"
    });
    d3.select(this.root).select(".button-group").style({"font-size": this.config.fontSize+"px"});
    this.popup.fontSize(this.config.fontSize);
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.legend = plotd3.rwd.legend()
      .scale(this.cScale)
      .orient("bottom")
      .tickValues(this.categories)
      .fontSize(this.config.fontSize)
      .size([this.width - this.config.margin * 2, this.config.fontSize * 3.3]);
    this.legendGroup.call(this.legend).selectAll(".legend").on("mouseover", function(d,i) {
      that.activeGroup = d; that.prerender(true);
    }).on("mouseout", function(d,i) {
      that.activeGroup = null; that.prerender(true);
    });
    this.legendSize = this.legend.offset();
    this.rScale = d3.scale.linear().domain(d3.extent(this.radiusRange)).range([0,this.config.maxRadius]);
    this.xScale = d3.scale.linear().domain([0,100])
      .range([0, this.width - this.config.margin * 2 - this.maxRadius * 2]);
    for(var idx = 0; idx < this.data.length ;idx ++ ){
      var item = this.data[idx];
      item.cx = this.xScale(item.rate);
      item.x = item.cx;
      if(that.central) item.cy = that.height / 2;
      else item.cy = (
        (this.categories.indexOf(item.category) + 1 ) * that.height / (this.categories.length + 2)
      );
      item.y = item.cy;
	  item.px = item.x;
	  item.py = item.y;
      item.r = this.rScale(item.radius);
    }
    this.force = d3.layout.force().nodes(this.data)
      .size([this.width,this.height]).gravity(0.05).charge(-20).friction(0.8)
      .on("tick", function(){ that.tick(); });
    this.prerender();
  },
  prerender: function(noReForce) {
    var that = this;
    this.categorySize = d3.max(this.svg.selectAll("text.central")
      .text(function(it) { return it.key;})
      .attr({"font-size": this.config.fontSize})[0].map(function(d,i) {
         return d.getBBox().width;
      }));
    this.xScale.range([
      //this.config.margin + this.categorySize + this.maxRadius, this.width - this.config.margin - this.maxRadius
      0, this.width - this.config.margin * 2 - this.maxRadius * 2 - this.categorySize
    ]);
    for(var idx = 0; idx < this.data.length ;idx ++ ){
      var item = this.data[idx];
      item.cx = this.xScale(item.rate);
    }
    var fw = this.width - 2 * this.config.margin - this.categorySize - 2 * this.maxRadius;
    this.legendGroup.attr({
      transform: ["translate(",
        (this.width - this.legendSize[0] - this.config.margin),
        (this.height - this.legendSize[1] - this.config.margin), ")"
      ].join(" ")
    });
    this.svg.selectAll("circle").attr({
      r:  function(d) { return d.r; }
    }).attr({
      fill: function(d) { return that.cScale(d.category); },
      stroke: "#444",
    }).transition().duration(500).style({
      opacity: function(d,i) { return (!that.activeGroup || that.activeGroup == d.category ? 1 : 0.1); }
    });
    this.svg.selectAll("line.central")
      .attr({
        x1: this.config.margin + this.categorySize + this.config.fontSize/2,
        x2: this.width - this.config.margin,
        "stroke-dasharray": "1 2",
        stroke: "#777"
      }).transition().duration(700).attr({
        y1: function(it) { 
          return that.height * (that.central?0.5:it.y);
        },
        y2: function(it) {
          return that.height * (that.central?0.5:it.y);
        },
        opacity: function(it) {
          return (that.central?0.1:0.8);
        }
      });
    this.svg.selectAll("text.central")
      .attr({
        x: this.config.margin + this.categorySize,
        dy: this.config.fontSize/2,
        "text-anchor": "end",
        "baseline-dominant": "central"
      }).transition().duration(700).attr({
        y: function(it) {
          return (that.central?0.5:it.y) * that.height;
        },
        opacity: function(it) {
          return (that.central?0:0.8);
        }
      });
    if(!noReForce) {
      this.force.size([fw, this.height]);
      this.force.start();
    }
  },
  render: function() {
    var that = this;
    this.svg.selectAll("circle").attr({
      cx: function(it) { return it.x + that.config.margin + that.categorySize + that.maxRadius; },
      cy: function(it) { return it.y; },
    })
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(182).map(function(d,i) {
      return new Date(new Date().getTime() - 86400 * 1000 * 365 + d * 86400 * 1000);
    });
    return {
      order: [{name: "Date", data: list.map(function(d) {
        return moment(d).format("YYYY/MM/DD");
      })}],
      value: [{name: "Value", data: list.map(function(d) {
        var m = d.getMonth();
        var d = d.getDay();
        return Math.sin(m) * 10 + Math.sin(d) * 100 + Math.random() * 10;
      })}]
    };
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "Y axis" },
    order: { type: [plotdb.Order], require: false, desc: "X axis" }
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    xAxisLabel: {},
    yAxisLabel: {},
    showNode: {},
    stroke: { name: "Line Color" },
    start: { name: "Start Node", type: [plotdb.Color], default: "#ee4422"},
    other: { name: "Middle Nodes", type: [plotdb.Color], default: "#dddddd"},
    end: { name: "End Node", type: [plotdb.Color], default: "#999999"},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.trend = this.svg.append("path").attr({class: "overall",opacity: 0.1}).on("mouseover", function() {
      that.activeGroup = 1; that.render();
    }).on("mouseout", function() {
      that.activeGroup = null; that.render();
    });
    this.valueRange = [0,1];
  },
  parse: function() {
    var that = this;
    plotdb.Order.sort(this.data, "order");
    this.valueRange = d3.extent(this.data, function(d,i) { return d.value; });
    //this.valueRange = d3.extent(this.data.map(function(it) { return d3.extent(it.value); }).reduce(function(a,b) { return a.concat(b); }, []));
    this.orders = this.data.map(function(d,i) { return d.order.raw; });
    this.groupSize = 7;//this.dimension.value.fields.length;
    this.parsed = d3.range(7).map(function(d) { return {order: d, value: [], mean: 0}; });
    this.data.map(function(it) {
      var d = new Date(it.order.raw).getDay();
      var node = that.parsed[d];
      node.value.push(it.value);
    });
    this.parsed.map(function(d,i) {
      d.mean = d3.mean(d.value);
    });
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[1]++;
    var d = this.valueRange[1] - this.valueRange[0];
    this.valueRange[1] += d * 0.1;
    this.valueRange[0] -= d * 0.1;
  },
  bind: function() {
    var that = this, sel;
    sel = this.dataGroup.selectAll("g.data-group").data(this.parsed);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      if(i == 0) node.append("text").text("avg.");
      node.append("rect").attr({class: "background"});
      node.append("path").attr({class: "connect"});
      node.append("line").attr({class: "mean"});
      node.selectAll("circle").data(d.value)
          .enter().append("circle").attr({class: "node"});
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10;
    this.xAxisHeight = 3 * this.config.fontSize;
    this.yAxisWidth = 10 * this.config.fontSize;
    this.blockWidth = ( width - 2 * this.config.margin - this.yAxisWidth ) / (this.parsed.length || 1);
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.legendScale = d3.scale.ordinal()
      .domain(["start","end"])
      .range([this.config.start, this.config.end]);
    this.legend = plotd3.rwd.legend()
      .scale(this.legendScale)
      .orient("bottom")
      .fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    this.yScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([this.height - this.config.margin - this.legendSize[1], this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .orient("left")
      .scale(this.yScale)
      .labelPosition("center")
      .fontSize(this.config.fontSize);
    this.yAxis.label(this.config.yAxisLabel || " ");
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.ordinal()
      .domain(d3.range(7)) //this.orders)
      .rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin], 0.25, 0.25);
    this.xAxis = plotd3.rwd.axis()
      .orient("bottom")
      .scale(this.xScale)
      //.tickValues(this.orders)
      .labelPosition("in")
      .tickFormat(function(d,i) {
        return ["Sun","Mon","Tue","Wed","Thr","Fri","Sat"][d];
      })
      .fontSize(this.config.fontSize);
    this.xAxis.label(this.config.xAxisLabel || this.dimension.order.fieldName || " ");
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = this.xAxis.offset();
    this.yScale.range([this.height - this.config.margin - this.xAxisHeight - this.legendSize[1], this.config.margin]);
    this.yAxisGroup.call(this.yAxis);
    this.segWidth = this.xScale.rangeBand();
    this.xiScale = d3.scale.linear()
      .domain([0, this.parsed[0].value.length - 1])
      .range([0, this.segWidth]);

    this.line = d3.svg.line().interpolate("linear")
      .x(function(d,i) { return that.xiScale(i); })
      .y(function(it) {  return that.yScale(it);});
    this.area = d3.svg.area().interpolate("basis")
      .x(function(d,i) { return that.xScale(d.order) + that.segWidth * i / (that.parsed[0].value.length + 1) - that.segWidth/2; })
      .y0(function(d,i) { return that.yScale(d3.min(d.value)); })
      .y1(function(d,i) { return that.yScale(d3.max(d.value)); });
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: ["translate(", (this.width - this.legendSize[0])/2, (this.height - this.config.margin - this.legendSize[1]), ")"].join(" ")
    });
    this.yAxisGroup.attr({
      transform: ["translate(", (this.yAxisWidth + this.config.margin), 0, ")"].join(" ")
    });
    this.xAxisGroup.attr({
      transform: ["translate(", 0, (this.height - this.xAxisHeight - this.config.margin - this.legendSize[1]), ")"].join(" ")
    });
    this.trend.attr({
      transform: "translate(" + (this.segWidth/2) + " 0)",
      d: function() { return that.area(that.data); },
      fill: "black",
    }).transition().attr({
      opacity: function() { return (that.activeGroup ? 0.8 : 0.1) },
    });
    this.dataGroup.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return ["translate(", that.xScale(d.order), 0, ")"].join(" ")
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      if(i==0) node.select("text").attr({
        "font-size": that.config.fontSize,
        x: that.segWidth/2,
        y: that.yScale(d.mean) + that.config.fontSize * 0.3,
        "text-anchor": "middle"
      });
      node.select("rect.background").attr({
        x: -that.segWidth * 0.125, y: that.config.margin,
        width: that.segWidth * 1.25,
        height: that.height - that.xAxisHeight - that.config.margin * 2 - that.legendSize[1],
        fill: "#000",
        opacity: function() { return (i % 2 ? 0 : 0.05); }
      });
      node.select("path").attr({
        d: that.line(d.value),
        stroke: that.config.stroke,
        fill: "none"
      });
      node.select("line").attr({
        x1: 0,
        y1: that.yScale(d.mean),
        x2: that.segWidth,
        y2: that.yScale(d.mean),
        stroke: "#000",
        opacity: 0.2,
        "stroke-width": 5
      });
      node.selectAll("circle.node").attr({
        cx: function(d,i) { return that.xiScale(i) },
        cy: function(d,i) { return that.yScale(d) },
        r: function(it,i) {
          return (i==0 || i==d.value.length - 1 ? 4 : 3);
        },
        fill: function(it,i) {
          if(i==0) return that.config.start;
          if(i == d.value.length - 1) return that.config.end;
          return that.config.other;
        },
        stroke: that.config.stroke,
        "stroke-width": function(it,i) {
          return (i == 0 || i == d.value.length - 1 ? 2 : 1);
        },
        opacity: (that.config.showNode ? 1 : 0)
      });
    });
    this.dataGroup.transition().attr({
      opacity: function() { return that.activeGroup ? 0.3 : 1; }
    });
  }
});

