      },
      cy: function(d,i) {
        return that.height - that.xAxisHeight - that.config.padding - that.config.margin - that.barWidth / 2;
      },
      r: that.barWidth / 2,
      fill: function(d,i) { return that.cScale(d.name); }
    });
  }
