    w = this.title[0][0].getBoundingClientRect().width;
    if(w > this.width - 2 * this.config.margin) {
      s = this.smSize * (this.width - 2 * this.config.margin) / w;
      this.title.attr({
        "font-size": s
      });
    }
    h1 = this.value[0][0].getBoundingClientRect().height;
    h2 = this.title[0][0].getBoundingClientRect().height;
    if(h1 + h2 > this.height - 2 * this.config.margin) {
      var rate = (this.height - 2 * this.config.margin) / (h1 + h2);
      this.value.attr({ "font-size": this.size * rate });
      this.title.attr({ "font-size": this.smSize * rate });
      h1 = h1 * rate;
      h2 = h2 * rate;
    }
    var dy = (this.height - h1 - h2)/2;
    this.value.attr({ y: dy + h1/2});
    this.title.attr({ y: dy + h1 + h2/2});
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var date = [{name: "date", data: d3.range(360).map(function(d,i) { 
      return new Date(new Date().getTime() - d * 86400000);
    })}];
    var value = [{name: "value", data: d3.range(360).map(function(d,i) { return Math.random(); })}];
    return {value: value, date: date};
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "color" },
    date: { type: [plotdb.Date], require: true, desc: "date" }
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    fill: { name: "Color" },
    emptyAs0: {},
    today: { name: "from Today", type: [plotdb.Boolean], default: true, rebindOnChange: true},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.popup = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      var date = [
        (d.dateobj.getYear() + 1900),
        that.pad(d.dateobj.getMonth() + 1, 2),
        that.pad(d.dateobj.getDate(), 2)
      ].join("/");
      popup.select(".title").text(date).style({margin: 0});
      popup.select(".value").text(parseInt(100*(d.value || 0))/100);
    });
    this.datagroup = this.svg.append("g").attr({class: "data-group"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
  },
  parse: function() {
    var that = this;
    var now = new Date();
    this.lastweek = parseInt((now.getTime() - now.getDay() * 86400000 ) / ( 7 * 86400000));
    var datehash = {};
    var origin = new Date("1970/01/01").getTime();
    this.data.map(function(d,i) {
      d.dateobj = new Date(d.date.raw);
      d.day = d.dateobj.getDay();
      d.time = d.dateobj.getTime() - origin;
      d.time = d.time - (d.time % 86400 * 1000);
      d.key = parseInt(d.time / (86400 * 1000));
      if(datehash[d.key]) datehash[d.key].value += d.value;
      else datehash[d.key] = d;
    });
    this.data.sort(function(a,b) { return b.time - a.time; });
    var latest = ((this.config.today?new Date().getTime():this.data[0].dateobj.getTime()));
    var latest = latest - (latest % 86400000);
    var datelist = d3.range(365).map(function(d) { 
      var key = parseInt((latest - 86400 * 1000 * d) / ( 86400 * 1000));
      var ret = datehash[key];
      var date = new Date(key * 86400 * 1000);
      if(ret) {
        ret.day = date.getDay();
        return ret;
      }
      return {
        dateobj: new Date(key * 86400 * 1000),
        day: date.getDay(),
        time: date.getTime(),
        key: key,
        value: undefined
      };
    });
    this.data = datelist;
    if(this.data.length > 365) this.data.splice(365, this.data.length);
    this.weeklabel = ["M","W","F"].map(function(d,i) { return {key: d, day: (i+1) };});
    this.monthlabel = [];
    var months = ["JAN","FEB","MAR","APR","MAY","JUN","JUL","AUG","SEP","OCT","NOV","DEC"];
    var year = new Date().getYear(), month = new Date().getMonth();
    for(var i = 0,d,week; i < 12; i++) {
      d = new Date(year+1900,month,1);
      week = this.lastweek - parseInt((d.getTime() - d.getDay() * 86400000 ) / ( 7 * 86400000));
      this.monthlabel.push({date: d, week: week, key:months[month]});
      month -= 1;
      if(month < 0) { month = 11; year -= 1; }
    }
    this.weeks = d3.map(this.data, function(d) {
      return that.lastweek - parseInt((d.dateobj.getTime() - d.dateobj.getDay() * 86400000) / ( 7 * 86400000));
    }).keys().map(function(d,i) { return parseInt(d); });
    this.data.map(function(d,i) {
      d.week = that.lastweek - parseInt((d.dateobj.getTime() - d.dateobj.getDay() * 86400000) / ( 7 * 86400000));
    });
    this.valuerange = d3.extent(this.data.map(function(d,i) { return d.value; }));
  },
  pad: function(v,len) {
    var clen = (v+"").length;
    var ret = v+"";
    if(clen < len) for(var i=0;i<len - clen;i++) ret = "0" + ret;
    return ret;
  },
  bind: function() {
    var that = this,sel;
    sel = this.xAxisGroup.selectAll("g.tick").data(this.monthlabel);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "tick"}).each(function(d,i) {
      d3.select(this).append("text").text(d.key);
    });
    sel = this.yAxisGroup.selectAll("g.tick").data(this.weeklabel);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "tick"}).each(function(d,i) {
      d3.select(this).append("text").text(d.key);
    });
    sel = this.datagroup.selectAll("rect.data").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("rect").attr({class: "data"});
    this.popup.nodes(sel);
    /*
    .on("mouseout",function(d,i) {
      that.popup.style({display: "none"});
    }).on("mousemove",function(d,i) {
      var x = d3.event.clientX;
      var y = d3.event.clientY;
      that.popup.style({display: "block"});
      var date = [
        (d.dateobj.getYear() + 1900),
        that.pad(d.dateobj.getMonth() + 1, 2),
        that.pad(d.dateobj.getDate(), 2)
      ].join("/");
      that.popup.select(".title").text(date).style({margin: 0});
      that.popup.select(".value").text(parseInt(100*(d.value || 0))/100);
      setTimeout(function() {
      var pbox = that.popup[0][0].getBoundingClientRect();
      var isleft = ( x < that.width / 2 );
      if(!isleft) x = x - pbox.width - that.size * 2;
      else x = x + that.size * 2;
      y = y - pbox.height / 2;
      that.popup.attr({
        class: "pdb-popup " + (isleft ? "right":"left")
      }).style({
        display: "block",
        top: y + "px",
        left: x + "px"
      });
      }, 0);
    });*/
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    //this.popup.style({"font-size": that.config.fontSize + "px"});
    this.size = that.config.fontSize;
    this.yscale = d3.scale.ordinal().domain(d3.range(7))
      .rangeBands([10, 100],0.1,0.1);
    this.xscale = d3.scale.ordinal().domain(this.weeks)
      .rangeBands([
        that.width / 2 + (that.weeks.length * (that.size + that.config.padding) / 2),
        that.width / 2 - (that.weeks.length * (that.size + that.config.padding) / 2),

      ], 0.1, 0.1);
    this.cscale = d3.scale.linear().domain([0, this.valuerange[1]]).range(["#eee", that.config.fill]);
  },
  render: function() {
    var that = this;
    var offset = [
      "translate(",
      0,
      (that.height / 2 - that.size * 3 - that.config.padding * 3.5),
      ")"
    ].join(" ");
    this.xAxisGroup
    .attr({ transform: offset })
    .selectAll("g.tick").attr({
      transform: function(d,i) {
        return [
          "translate(",
          that.xscale(d.week) + that.size/2,
          -that.size / 1.5,
          ")"].join(" ");
      },
      opacity: function(d,i) {
        return (isNaN(that.xscale(d.week)) ? 0 : 1);
      }
    });
    this.yAxisGroup
    .attr({ transform: offset })
    .selectAll("g.tick").attr({
      transform: function(d,i) {
        return [
          "translate(",
          that.xscale(that.weeks[that.weeks.length - 1]) -that.size / 1.5,
          d.day * 2 * (that.size + that.config.padding) - that.size * 0.5,
          ")"
        ].join(" ");
      }
    });
    this.svg.selectAll(".axis .tick text").attr({
      "text-anchor": "middle",
      "dominant-baseline": "middle",
      "font-size": that.size,
      "font-family": "arial",
      fill: "#999",
    });
    this.datagroup
    .attr({ transform: offset })
    .selectAll("rect.data").attr({
      x: function(d,i) {
        return that.xscale(d.week); },
      y: function(d,i) { return d.day * (that.size + that.config.padding); },
      width: that.size,
      height: that.size,
      fill: function(d,i) {
        if(!that.config.emptyAs0 && !d.value && typeof(d.value)=="undefined") return "none";
        if(!d.value) return that.cscale(0);
        return that.cscale(d.value);
      }
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(10);
    return {
      name: [{name: "Name", data: list.map(function(d,i) { return plotdb.data.sample.name.get(i); })}],
      value: [{name: "Value", data: list.map(function(d,i) { return Math.round(Math.random() * 8 + 2); })}]
    };
  },
  dimension: {
    name: { type: [plotdb.String], require: false, desc: "" },
    value: { type: [plotdb.Number], require: true, desc: "" }
  },
  config: {
    padding: {},
    margin: {},
    palette: {},
    fontSize: {},
    lineSmoothing: {},
    aspectRatio: {type: [plotdb.Boolean]},
    strokeWidth: {default: 20}
  },
  init: function() {
    var that = this;
    this.id = "plotdb-" + Math.random() * 100000000;
    this.svg = d3.select(this.root).append("svg");
    this.samplePathContainer = d3.select(this.root).append("div").style({
      opacity: 0.01, position: "absolute", width: "1px",height: "1px", overflow: "hidden"
    });
    this.defs = this.svg.append("defs");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.popup = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name);
      popup.select(".value").text(Math.round(100 * d.length)/100);
    });
    this.popup.coord(function(d,i) {
      var ret = that.dataGroup.selectAll("text.text")[0][d.idx].getBoundingClientRect();
      return [ret.left, ret.top, ret.width, ret.height];
    });
    this.lineBuilder = d3.svg.line()
      .x(function(d,i) { return that.xScale(d.x); })
      .y(function(d,i) { return that.yScale(d.y); });
    this.ptrs = [];
    this.pathRange = {x: [], y: []};
    d3.text(this.assets["drawn.svg"].datauri, function(e,d) {
      that.samplePathContainer[0][0].innerHTML = d;
      that.samplePath = that.samplePathContainer.select("path")[0][0];
      var len = that.samplePath.getTotalLength();
      var ptrcount = 1000;
      that.ptrLen = len / ptrcount;
      for(var i=0;i<ptrcount;i++) {
        that.ptrs.push(that.samplePath.getPointAtLength(len * i/ptrcount));
      }
      that.pathRange.x = d3.extent(that.ptrs.map(function(d,i) { return d.x;}));
      that.pathRange.y = d3.extent(that.ptrs.map(function(d,i) { return d.y;}));
      that.resize();
      that.parse();
      that.bind();
      that.render();
    });
  },
  parse: function() {
    if(!this.ptrs) return;
    if(!this.dimension.value.fields.length) this.data.map(function(d,i) { d.value =1 ; });
    var that = this,offset = 0, obj, len = that.ptrs.length,sum;
    this.parsed = {data: []};
    this.parsed.sum = sum = (d3.sum(this.data, function(d,i) { return d.value; }) || 1);
    for(var i=0;i<this.data.length;i++) {
      obj = {offset: offset, data: [], name: this.data[i].name, id: this.id + "-path-" + i, idx: i};
      obj.length = this.data[i].value / this.parsed.sum;
      this.parsed.data.push(obj);
      for(var j= Math.round(len * offset) - 1; j <= Math.round(len * (offset + obj.length)); j++) {
        if(that.ptrs[j]) obj.data.push(that.ptrs[j]);
      }
      offset += obj.length;
    }
  },
  bind: function() {
    if(!this.parsed) return;
    var that = this,sel;
    sel = this.dataGroup.selectAll("path.data").data(this.parsed.data);
    sel.exit().remove();
    sel = sel.enter().append("path").attr({
      class: "data"
    });
    this.popup.nodes(sel);
    sel = this.defs.selectAll("path").data(this.parsed.data);
    sel.exit().remove();
    sel.enter().append("path").attr({
      id: function(d,i) { return d.id; }
    });
    sel = this.dataGroup.selectAll("text.label.shadow").data(this.parsed.data);
    sel.exit().remove();
    sel = sel.enter().append("text").attr({
      class: "label shadow"
    }).append("textPath").attr({
      "xlink:href": function(d,i) { return "#" + d.id; }
    }).text(function(d,i) { return d.name; });
    this.popup.nodes(sel);

    sel = this.dataGroup.selectAll("text.label.text").data(this.parsed.data);
    sel.exit().remove();
    sel = sel.enter().append("text").attr({
      class: "label text"
    }).append("textPath").attr({
      "xlink:href": function(d,i) { return "#" + d.id; }
    }).text(function(d,i) { return d.name; });
    this.popup.nodes(sel);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.pathRange.x[1] - this.pathRange.x[0]
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.lineBuilder
      .interpolate(this.config.lineSmoothing);
    var ratio = (this.pathRange.x[1] - this.pathRange.x[0]) / (this.pathRange.y[1] - this.pathRange.y[0]);
    var yrange = [this.height - this.config.margin, this.config.margin];
    var xrange = [this.config.margin, this.width - this.config.margin];
    if(this.config.aspectRatio) {
      if(this.width / this.height > ratio) {
        var w = ratio * this.height;
        xrange = [this.width / 2 - w /2, this.width / 2 + w/2];
      } else {
        var h = this.width / ratio;
        yrange = [this.height / 2 + h /2, this.height / 2 - h/2];
      }
    }
    this.xScale = d3.scale.linear()
      .domain(this.pathRange.x)
      .range(xrange);
    this.yScale = d3.scale.linear()
      .domain(this.pathRange.y)
      .range(yrange);
  },
  render: function() {
    var that = this;
    var strokeWidth = this.config.strokeWidth;
    if(this.width < 480 && strokeWidth>10) strokeWidth = 10;
    this.defs.selectAll("path").attr({
      d: function(d,i) {
        return that.lineBuilder(d.data);
      }
    });
    var defsPaths = this.defs.selectAll("path")[0];
    this.dataGroup.selectAll("path.data").attr({
      d: function(d,i) {
        return that.lineBuilder(d.data);
      },
      fill: "none",
      stroke: function(d,i) { return that.cScale(d.name); },
      "stroke-width": strokeWidth,
    });
    this.dataGroup.selectAll("path.data").attr({
      "stroke-dasharray": function(d,i) {
        var len = this.getTotalLength();
        var v = that.ptrLen * 2;
        return "0 " + v + " " + (this.getTotalLength()) + " " + v;
      }
    });
    this.dataGroup.selectAll("text.label").attr({
      x: function(d,i) {
        return defsPaths[d.idx].getTotalLength()/2;
      },
      "text-anchor": "middle",
      "font-size": this.config.fontSize,
      "dy": this.config.fontSize * 0.4,
      fill: function(d,i) {
        var c = d3.hsl(that.cScale(d.name));
        return (c.l > 0.65 ? "#000" : "#fff"); 
      }
    });
    this.dataGroup.selectAll("text.label.shadow").attr({
      stroke: function(d,i) {
        var c = d3.hsl(that.cScale(d.name));
        return (c.l > 0.65 ? "#fff" : "#000"); 
      },
      "stroke-width": 2
    });
  }
});

