var module = {};
module.exports = plotdb.chart.create({
  sample: d3.range(7).map(function(it) {
    return {
      value: d3.range(5).map(function(it) { return Math.random(); }),
      order: it
    };
  }),
  dimension: {
    value: { type: [plotdb.Number], require: true, multiple: true, desc: "Y axis" },
    order: { type: [plotdb.Number], require: false, desc: "X axis" }
  },
  config: {
    fontSize: { name: "Font Size", type: [plotdb.Number], default: 12 },
    margin: { name: "Margin", type: [plotdb.Number], default: 10 },
    padding: { name: "Padding", type: [plotdb.Number], default: 10 },
    start: { name: "Start Node", type: [plotdb.Color], default: "#ee4422"},
    other: { name: "Middle Nodes", type: [plotdb.Color], default: "#dddddd"},
    end: { name: "End Node", type: [plotdb.Color], default: "#999999"},
    line: { name: "Line Color", type: [plotdb.Color], default: "#444444"},
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.valuerange = d3.extent(this.data.map(function(it) { return d3.extent(it.value); }));
    this.orderrange = d3.map(this.data, function(it) { return it.order; });
    this.groupSize = this.data.length;
  },
  bind: function() {
    var that = this;
    this.svg.selectAll("g.data-group").data(this.parsed)
    .enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("path").attr({class: "connect"});
      node.append("text").attr({class: "label"});
      node.append("line").attr({class: ""});
      node.selectAll("circle").data(d.values)
          .enter().append("circle").attr({class: "node"});
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10;
    this.xAxisHeight = 3 * this.config.fontSize;
    this.yAxisWidth = 10 * this.config.fontSize;
    this.blockWidth = ( width - 2 * this.config.margin - this.yAxisWidth ) / 7;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.yscale = d3.scale.linear().domain([0, this.valuerange[1]*1.01]).range([
      height - this.xAxisHeight - this.config.margin,
      this.config.margin
    ]);
    this.yticks = this.yscale.ticks(10);
    this.xscale = d3.scale.linear().domain([0,this.groupSize]).range([
      this.config.padding / 2, this.blockWidth - this.config.padding
    ]);
    this.line = d3.svg.line().interpolate("linear")
      .x(function(d,i) { return that.xscale(i); })
      .y(function(it) { return that.yscale(it.value);});
    this.yAxis = d3.svg.axis().orient("left").scale(this.yscale);
    this.yAxisGroup.call(this.yAxis);
    var update = this.gridGroup.selectAll("line.grid.horizontal").data(this.yticks);
    update.exit().remove();
    update.enter().append("line").attr({class: "grid horizontal"});
  },
  render: function() {
    var that = this;
    this.gridGroup.attr({
      transform: "translate(0," + this.config.margin +")"
    });

    this.gridGroup.selectAll("line.grid.horizontal").attr({
      x1: this.config.margin + this.yAxisWidth,
      x2: this.width - this.config.margin,
      y1: function(it) { return that.yscale(it); },
      y2: function(it) { return that.yscale(it); },
      stroke: "#bbb",
      "stroke-dasharray": "2 4"
    });
    this.yAxisGroup.attr({
      transform: "translate(" + ( that.yAxisWidth + that.config.margin - that.config.fontSize ) + ","+this.config.margin+")"
    });
    this.svg.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return "translate(" + ( that.yAxisWidth + that.config.margin + that.blockWidth * i ) + ","+ that.config.margin + ")";
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.select("path").attr({
        d: that.line(d.values),
        stroke: that.config.line,
        fill: "none"
      });
      node.select("text").attr({
        y: that.height - that.xAxisHeight - that.config.margin + that.config.fontSize,
        x: that.blockWidth / 2 + that.config.padding / 2,
        "text-anchor": "middle",
        "dominant-baseline": "central"
      }).text(["Sun","Mon","Tue","Wed","Thr","Fri","Sat"][d.key]);
      node.select("line").attr({
        x1: that.config.padding / 2,
        y1: that.yscale(d.mean),
        x2: that.blockWidth - that.config.padding / 2,
        y2: that.yscale(d.mean),
        stroke: "#000",
        opacity: 0.2,
        "stroke-width": 2
      });
      node.selectAll("circle.node").attr({
        cx: function(d,i) { return that.xscale(i) },
        cy: function(d,i) { return that.yscale(d.value) },
        r: function(it,i) {
          return (i==0 || i==d.values.length - 1 ? 4 : 3);
        },
        fill: function(it,i) {
          if(i==0) return that.config.start;
          if(i == d.values.length - 1) return that.config.end;
          return that.config.other;
