    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.lineBuilder = d3.svg.line()
      .x(function(d,i) { return that.xScale(i); })
      .y(function(d,i) { return that.yScales[i](d); });
  },
  parse: function() {
    var that = this;
    this.axesCount = this.dimension.values.fields.length;
    this.axesName = this.dimension.values.fieldName;
    this.valueRanges = d3.range(this.axesCount).map(function(j) {
      var ret = d3.extent(that.data.map(function(d,i) { return d.values[j]; }));
      if(ret[0] == ret[1]) ret[1]++;
      return ret;
    });
    this.yScales = this.valueRanges.map(function(d,i) {
      var scale = d3.scale.linear().domain(d); 
      return scale;
    });
    this.yAxes = this.yScales.map(function(d,i) {
      var axis = plotd3.rwd.axis()
        .scale(d)
        .orient("left")
        .fontSize(that.config.fontSize);
      return axis;
    });
  },
  bind: function() {
    var that = this,sel;
    sel = this.yAxesGroup.selectAll("g.axis.vertical").data(this.yAxes);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "axis vertical"});
    sel = this.dataGroup.selectAll("path.data.connect").data(this.data);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "data connect"});
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.xScale = d3.scale.ordinal().domain(d3.range(this.axesCount)).rangePoints([this.config.margin, this.width - this.config.margin],1,1);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .fontSize(this.config.fontSize)
      .tickFormat(function(d,i) { return that.axesName[d] || ""; })
      .orient("bottom");
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.xAxisGroup.selectAll(".tick line").remove();
    this.xAxisHeight = this.xAxis.offset();
    this.yScales.map(function(scale,i) {
      scale.domain(that.valueRanges[i]).range([that.height - that.config.margin - that.xAxisHeight, that.config.margin]); 
    });
    this.yAxes.map(function(axis,i) {
      axis
        .scale(that.yScales[i])
        .orient("left")
        .fontSize(that.config.fontSize);
    });
  },
  render: function() {
    var that = this;
    this.xAxisGroup.attr({
      transform: ["translate(", 0, this.height - this.config.margin - this.xAxisHeight, ")"].join(" ")
    });
    this.yAxesGroup.selectAll("g.axis.vertical").each(function(d,i) {
      d3.select(this).call(d);
    });
    this.yAxesGroup.selectAll("g.axis.vertical").attr({
      transform: function(d,i) {
        return [
          "translate(",
          that.xScale(i),
          0,
          ")"
        ].join(" ");
      }
    });
    this.dataGroup.selectAll("path.data").attr({
      d: function(d,i) {
        return that.lineBuilder(d.values);
      },
      fill: "none",
      stroke: function(d,i) {
        return that.cScale(d.category);
      },
      "stroke-width": 1
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    return {
      name: [{name: "name", data: d3.range(20).map(function(it) { return plotdb.data.sample.name[it % plotdb.data.sample.name.length]; })}],
      value: [{name: "value", data: d3.range(20).map(function(it) { 
        return parseInt(90 * Math.random() + 10);
      }) }]
    };
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "value of data" },
    name: { type: [], require: false, desc: "name of data" }
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    fill: { name: "Color" },
    sort: { type: [plotdb.Choice(["None","Ascending","Descending"])], default: true, rebindOnChange: true}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
  },
  parse: function() {
    if(!this.dimension.value.fields.length) this.data.map(function(d) { d.value = 0; });
    this.valueRange = d3.extent(this.data.map(function(it) { return it.value; }));
    this.nameLen = d3.max(this.data.map(function(it) { return ("" + it.name).length; }));    
    if(this.valueRange[0] == this.valueRange[1]) this.valueRange[0]-=1;
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("g.data").data(this.parsed);
    sel.exit().remove();
    sel = sel.enter().append("g").attr({class: "data"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("text").attr({class: "tick"});
      node.append("text").attr({class: "data label"});
      node.append("rect").attr({class: "data"});
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.xScale = d3.scale.linear()
      .domain([(this.valueRange[0] < 0 ? this.valueRange[0] : 0), this.valueRange[1]])
      .range([this.config.margin, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .orient("top")
      .scale(this.xScale)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = this.xAxis.offset();
    var mh = height - this.xAxisHeight - this.config.margin * 2;
    if( mh / this.data.length > this.config.fontSize + this.config.padding)
      this.barHeight = (mh - this.xAxisHeight) / this.data.length - this.config.padding;
    else 
      this.barHeight = this.config.fontSize;
    height = this.height = (
      ( this.barHeight + this.config.padding ) * this.data.length
      + this.config.margin * 2 + this.xAxisHeight
    );
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.parsed = this.data.map(function(it) { return it; });
    if(this.config.sort!="None") this.parsed.sort(this.config.sort == "Descending"
        ? function(a,b) { return b.value - a.value; }
        : function(a,b) { return a.value - b.value; }
    );
    this.xScale.range([this.config.margin, this.width - this.config.margin]);
    this.xAxisGroup.call(this.xAxis);
  },
  render: function() {
    var that = this;
    this.svg.selectAll("g.data").each(function(d,i) {
      var node = d3.select(this);
      node.select("text.tick").attr({"font-size": that.config.fontSize}).text(d.name);
      node.select("text.data.label").attr({"font-size": that.config.fontSize}).text(d.value);
    });
    this.yAxisWidth = d3.max(this.svg.selectAll("g.data text.tick")[0].map(function(d,i) { return d.getBBox().width; }));
    this.yLabelWidth = [];
    this.svg.selectAll("g.data text.label").each(function(d,i) {
      that.yLabelWidth.push(this.getBBox().width + that.config.fontSize/2 + that.xScale(d.value < 0 ? 0 : d.value)
        - that.yAxisWidth - that.config.fontSize/2 - that.config.margin);
    });
    this.yLabelWidth = d3.max(this.yLabelWidth);
    var mw = this.width - this.config.margin * 2 - this.yAxisWidth - this.config.fontSize/2;
    mw = mw * mw/this.yLabelWidth;
    this.xScale.range([
      this.config.margin + this.yAxisWidth + this.config.fontSize/2, 
      mw + this.config.margin + this.yAxisWidth + this.config.fontSize/2
    ]);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisGroup.attr({
      transform: ["translate(",0,that.xAxisHeight,")"].join(" ")
    });
    this.svg.selectAll("g.data").attr({
      transform: function(d,i) {
        return ["translate(",
          0,
          that.config.margin + that.xAxisHeight + i * (that.barHeight + that.config.padding),
          ")"].join(" ");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.select("text.tick").attr({
        x: that.config.margin + that.yAxisWidth,
        y: that.barHeight / 2,
        "text-anchor": "end",
        "dominant-baseline": "central",
        "font-size": that.config.fontSize
      });
      node.select("text.data.label").attr({
        x: function(d,i) {
          return (d.value<0?-1:1) * that.xScale(d.value) + that.config.fontSize/2;
        },
        dy: (that.config.fontSize + that.barHeight)/2 - 2 
      });
      node.select("rect").attr({
        x: function(d,i) {
          if(d.value<0) return that.xScale(d.value);
          return that.xScale(0);
        },
        y: 0,
        rx: 2, ry: 2,
        width: function(d,i) {
          return (d.value<0?-1:1) * (that.xScale(d.value) - that.xScale(0));
        },
        height: that.barHeight,
        fill: that.config.fill
      });
    });
  }
});

