    this.datehash = {};
    for(var i=0,j=0;i<12;i++) {
      if(lastMonth - i < 0) j = 1;
      var y = lastYear - j, m = (12 + lastMonth - i)%12
      var date = {index: new Date(y, m, 1), days: []};
      this.dates = [date].concat(this.dates);
      this.datehash[date.index.getYear() + "-" + date.index.getMonth()] = date;
      var k = 0;
      while(true) {
        var d = new Date(y, m, 1 + k);
        if(d.getMonth() != m) break;
        date.days.push(d);
        k++;
      }
