    });
    this.tooltip.fontSize(this.config.fontSize);
    this.labelWidth = d3.max(this.dataGroup.selectAll("text.label.data").attr({"font-size": this.config.fontSize})[0].map(function(d,i) {
      return d.getBoundingClientRect().width;
    }));
    this.yScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([this.height - this.config.margin, this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .label(this.config.yAxisLabel || this.dimension.value.fieldName || " ")
      .labelPosition("in")
      .fontSize(this.config.fontSize);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.ordinal()
      .domain(this.categories)
      .rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .label(this.config.xAxisLabel || this.dimension.category.fieldName || " ")
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = this.xAxis.offset();
    this.yScale.range([this.height - this.config.margin - this.xAxisHeight - this.config.fontSize, this.config.margin + this.config.fontSize]);
    this.barWidth = this.xScale.rangeBand();
    this.padding = 0;
    if(this.barWidth > this.config.barWidth) {
      this.padding = this.barWidth - this.config.barWidth;
    }
    if(this.padding<=0) {
      if(this.barWidth <= 10) this.padding = this.barWidth * 0.4;
      else this.padding = 4;
    }
    var minPadding = this.labelWidth * 2 + this.config.fontSize * 3;
    this.noLabel = (this.padding < minPadding);
    var rate = this.padding / this.barWidth;
    this.xScale.rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin],rate,rate);
    this.barWidth = this.xScale.rangeBand();
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.yScale.range([this.height - this.config.margin - this.xAxisHeight - this.config.fontSize, this.config.margin + this.config.fontSize]);
    this.yAxisGroup.call(this.yAxis).select(".domain").remove();
  },
  render: function() {
    var that = this;
    this.yAxisGroup.attr({
      transform: ["translate(", this.config.margin + this.yAxisWidth, 0, ")"].join(" ")
    });
    this.xAxisGroup.attr({
      transform: ["translate(", 0, this.height - this.config.margin - this.xAxisHeight, ")"].join(" ")
    });
    this.dataGroup.selectAll("g.data-group").attr({
      transform: function(d,i) { return [ "translate(", that.xScale(d.key), 0, ")"].join(" ");}
    }).each(function(d,i) {
