    this.line2 = this.svg.append("path").datum(this.data).attr({class: "data"});
    this.aligned = true;
    d3.select(this.root).selectAll("input").on("click",function(d,i) {
      that.aligned = (i==0);
      that.resize();
      that.render();
    });
  },
  parse: function() {
    plotdb.Order.sort(this.data, "order");
    this.orders = this.data.map(function(it,i) { return it.order; });
    this.xrange = d3.extent(this.data.map(function(it,i) { return it.order; }));
    var yrange1 = d3.extent(this.data.map(function(it) { return it.value1; }));
    var yrange2 = d3.extent(this.data.map(function(it) { return it.value2; }));
    this.yrange = d3.extent(yrange1.concat(yrange2));
    this.ydrange = d3.extent(this.data.map(function(it) { return it.value1 - it.value2; }).concat([0]));
    var dydrange = (this.ydrange[1] - this.ydrange[0])/20;
    var dyrange = (this.yrange[1] - this.yrange[0])/20;
    if(dydrange==0) dydrange = 1;
    if(dyrange==0) dyrange = 1;
    this.ydrange[0] -= dydrange;
    this.ydrange[1] += dydrange;
    this.yrange[0] -= dyrange;
    this.yrange[1] += dyrange;
   },
  bind: function() {
    var that = this;
    this.clip1.datum(this.data);
    this.clip2.datum(this.data);
    this.path1.datum(this.data);
    this.path2.datum(this.data);
    this.line1.datum(this.data);
    this.line2.datum(this.data);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var svgbox = d3.select(this.root).select("svg")[0][0].getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    var m = that.config.margin;
    d3.select(this.root).selectAll("label").style({"font-size": this.config.fontSize+"px"});
    var fbox = d3.select(this.root).select(".pdb-form").style({
      "padding-top": m + "px"
    })[0][0].getBoundingClientRect();
    height = this.height = height - (fbox.bottom - fbox.top);
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    var legendScale = d3.scale.ordinal()
      .domain([
        this.dimension.value1.fieldName,
        this.dimension.value2.fieldName,
        this.dimension.value1.fieldName + " > " + this.dimension.value2.fieldName,
        this.dimension.value1.fieldName + " < " + this.dimension.value2.fieldName,
      ])
      .range([
        d3.rgb(that.config.colorPositive).darker(1).toString(),
        d3.rgb(that.config.colorNegative).darker(1).toString(),
        that.config.colorPositive,
        that.config.colorNegative
      ]);
    this.legend = plotd3.rwd.legend()
      .orient("bottom").scale(legendScale)
      .size([this.width - 2 * this.config.margin, 100])
      .fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend);
    this.legendSize = (this.config.legendShow ? this.legend.offset() : [0,0]);
    this.legendGroup.selectAll(".legend")
      .on("mouseover", function(d,i) { that.activeGroup = i + 1; that.render(); })
      .on("mouseout", function(d,i) { that.activeGroup = 0; that.render(); });
    this.yScale = d3.scale.linear().domain(this.aligned ? this.ydrange : this.yrange).range([height - this.legendSize[1] - m, m]);
    this.yAxis = plotd3.rwd.axis()
      .orient("left")
      .scale(this.yScale)
      .tickValues(this.yScale.ticks(this.config.yAxisTickCount))
      .tickSize(this.config.yAxisTickSizeInner, this.config.yAxisTickSizeOuter)
      .tickPadding(this.config.yAxisTickPadding)
      .fontSize(this.config.fontSize);
    if(this.config.yAxisLabel) {
      this.yAxis.label(this.config.yAxisLabel);
    } else if(this.dimension.value1.fieldName && this.dimension.value2.fieldName) {
      this.yAxis.label(this.dimension.value1.fieldName + " v.s. " + this.dimension.value2.fieldName);
    }
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = (this.config.yAxisShow? this.yAxis.offset() : 0);
    this.xScale = d3.scale.ordinal()
      .domain(this.orders)
      .rangePoints([this.yAxisWidth + m, width - m]);
    this.xAxis = plotd3.rwd.axis()
      .orient("bottom").scale(this.xScale).fontSize(this.config.fontSize)
      .label(this.config.xAxisLabel || "")
      .labelPosition(this.config.xAxisLabelPosition)
      .tickSize(this.config.xAxisTickSizeInner, this.config.xAxisTickSizeOuter)
      .tickPadding(this.config.xAxisTickPadding);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = (this.config.xAxisShow ? this.xAxis.offset() : 0);
    this.yScale.range([
      height - m - this.xAxisHeight - this.legendSize[1] - (this.config.legendShow? this.config.fontSize : 0),
      m
    ]);
    this.yAxisGroup.call(this.yAxis);
    this.line = d3.svg.line()
      .interpolate("basis")
      .x(function(it) { return that.xScale(it.order); });
    this.area = d3.svg.area()
      .interpolate("basis")
      .x(function(it) { return that.xScale(it.order); });
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: [
        "translate(",
        (this.width - this.legendSize[0])/2,
        (this.height - this.config.margin - this.legendSize[1]),
        ")"
      ].join(" "),
      display: this.config.legendShow ? "block" : "none"
    });
    this.xAxisGroup.selectAll(".domain").attr({ display: (this.config.xAxisShowDomain ? "block" : "none")});
    this.yAxisGroup.selectAll(".domain").attr({ display: (this.config.yAxisShowDomain ? "block" : "none")});

    this.yAxisGroup.attr({
      transform: function(d,i) {
        return ["translate(",that.yAxisWidth + that.config.margin,",",0,")"].join("");
      },
      display: this.config.yAxisShow ? "block" : "none"
    });
    this.xAxisGroup.attr({
      transform: function(d,i) {
        return ["translate(0,",that.height - that.xAxisHeight - that.config.margin - that.legendSize[1] - that.config.fontSize,")"].join("");
      },
      display: this.config.xAxisShow ? "block" : "none"
    });
    this.path1.transition("path").duration(500).attr({
      d: this.area
        .y1(function(it) {
          return that.yScale((that.aligned?it.value1 - it.value2:it.value1));
        })
        .y0(function(it) { return that.height; })
    });
    this.clip2.transition("path").duration(500).attr({
      d: this.area
        .y1(function(it) { return that.aligned?0:that.yScale(it.value1); })
        .y0(function(it) { return that.yScale((that.aligned?0:it.value2)); })
    });

    this.path2.transition("path").duration(500).attr({
        d: this.area
          .y1(function(it) {return 0;})
          .y0(function(it) {
            return that.yScale(that.aligned?it.value1 - it.value2:it.value1);
          })
    });
    this.clip1.transition("path").duration(500).attr({
      d: this.area
        .y1(function(it) { return that.yScale(that.aligned?0:it.value2); })
        .y0(function(it) { return that.height; })

    });
    this.path1.attr({
      "clip-path": "url(#clip2)",
    }).transition("fill").attr({ 
      fill: (!this.activeGroup || this.activeGroup == 3 ? this.config.colorPositive : "#f9f9f9")
    });
    this.path2.attr({
      "clip-path": "url(#clip1)",
    }).transition("fill").attr({
      fill: (!this.activeGroup || this.activeGroup == 4 ? this.config.colorNegative : "#f9f9f9")
    });
    this.line1.transition("line").duration(500).attr({
      d: this.line.y(function(it) {
        return (that.yScale(that.aligned?it.value1 - it.value2:it.value1));
      }),
      fill: "none",
      "stroke-width": 3
    })
    this.line1.transition("stroke").attr({
      stroke: ((this.aligned && this.activeGroup==1)|| !this.activeGroup || this.activeGroup == 1
        ? d3.rgb(that.config.colorPositive).darker(1).toString()
        : "#eee")
    });
    this.line2.transition("line").duration(500).attr({
      d: this.line.y(function(it) {
        return (that.yScale(that.aligned?0:it.value2));
      }),
      fill: "none",
      "stroke-width": 3
    })
    this.line2.transition("stroke").attr({
      stroke: (!this.activeGroup || (this.aligned && this.activeGroup == 1) || (!this.aligned && this.activeGroup == 2)
        ? d3.rgb((this.aligned?this.config.colorPositive:this.config.colorNegative)).darker(1).toString()
        : "#eee")
    });
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({ "font-size": that.config.fontSize });
  }
});

