var module = {};
module.exports = plotdb.chart.create({
  sample: d3.range(100).map(function(it) {
    var now = new Date().getTime();
    return {
      value: Math.random() + Math.abs(( it % 7 ) / 3),
      date: new Date(now - 86400 * 1000 * it)
    };
  }),
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "Value ( y-axis ) " },
    date: { type: [plotdb.Date], require: true, desc: "Date of value ( x-axis )" }
  },
  config: {
    fontSize: { name: "Font Size", type: [plotdb.Number], default: 12 },
    margin: { name: "Margin", type: [plotdb.Number], default: 10 },
    padding: { name: "Padding", type: [plotdb.Number], default: 10 },
    start: { name: "Start Node", type: [plotdb.Color], default: "#ee4422"},
    other: { name: "Middle Nodes", type: [plotdb.Color], default: "#dddddd"},
    end: { name: "End Node", type: [plotdb.Color], default: "#999999"},
    line: { name: "Line Color", type: [plotdb.Color], default: "#444444"},

  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.valuerange = d3.extent(this.data.map(function(it) { return it.value; }));
    this.parsed = d3.nest().key(function(it) { return new Date(it.date).getDay(); }).entries(this.data);
    this.groupSize = d3.max(this.parsed.map(function(it) { return it.values.length; }));
    this.parsed.map(function(it) { it.mean = d3.mean(it.values,function(it) { return it.value; }); });
  },
  bind: function() {
    var that = this;
    this.svg.selectAll("g.data-group").data(this.parsed)
    .enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("path").attr({class: "connect"});
      node.append("text").attr({class: "label"});
      node.append("line").attr({class: ""});
      node.selectAll("circle").data(d.values)
          .enter().append("circle").attr({class: "node"});
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10;
    this.xAxisHeight = 3 * this.config.fontSize;
    this.yAxisWidth = 10 * this.config.fontSize;
    this.blockWidth = ( width - 2 * this.config.margin - this.yAxisWidth ) / 7;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.yscale = d3.scale.linear().domain([0, this.valuerange[1]*1.01]).range([
      height - this.xAxisHeight - this.config.margin,
      this.config.margin
    ]);
    this.yticks = this.yscale.ticks(10);
    this.xscale = d3.scale.linear().domain([0,this.groupSize]).range([
      this.config.padding / 2, this.blockWidth - this.config.padding
    ]);
    this.line = d3.svg.line().interpolate("linear")
      .x(function(d,i) { return that.xscale(i); })
      .y(function(it) { return that.yscale(it.value);});
    this.yAxis = d3.svg.axis().orient("left").scale(this.yscale);
    this.yAxisGroup.call(this.yAxis);
    var update = this.gridGroup.selectAll("line.grid.horizontal").data(this.yticks);
    update.exit().remove();
    update.enter().append("line").attr({class: "grid horizontal"});
  },
  render: function() {
    var that = this;
    this.gridGroup.attr({
      transform: "translate(0," + this.config.margin +")"
    });

    this.gridGroup.selectAll("line.grid.horizontal").attr({
      x1: this.config.margin + this.yAxisWidth,
      x2: this.width - this.config.margin,
      y1: function(it) { return that.yscale(it); },
      y2: function(it) { return that.yscale(it); },
      stroke: "#bbb",
      "stroke-dasharray": "2 4"
    });
    this.yAxisGroup.attr({
      transform: "translate(" + ( that.yAxisWidth + that.config.margin - that.config.fontSize ) + ","+this.config.margin+")"
    });
    this.svg.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return "translate(" + ( that.yAxisWidth + that.config.margin + that.blockWidth * i ) + ","+ that.config.margin + ")";
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.select("path").attr({
        d: that.line(d.values),
        stroke: that.config.line,
        fill: "none"
      });
      node.select("text").attr({
        y: that.height - that.xAxisHeight - that.config.margin + that.config.fontSize,
        x: that.blockWidth / 2 + that.config.padding / 2,
        "text-anchor": "middle",
        "dominant-baseline": "central"
      }).text(["Sun","Mon","Tue","Wed","Thr","Fri","Sat"][d.key]);
      node.select("line").attr({
        x1: that.config.padding / 2,
        y1: that.yscale(d.mean),
        x2: that.blockWidth - that.config.padding / 2,
        y2: that.yscale(d.mean),
        stroke: "#000",
        opacity: 0.2,
        "stroke-width": 2
      });
      node.selectAll("circle.node").attr({
        cx: function(d,i) { return that.xscale(i) },
        cy: function(d,i) { return that.yscale(d.value) },
        r: function(it,i) {
          return (i==0 || i==d.values.length - 1 ? 4 : 3);
        },
        fill: function(it,i) {
          if(i==0) return that.config.start;
          if(i == d.values.length - 1) return that.config.end;
          return that.config.other;
        },
        stroke: that.config.line,
        "stroke-width": function(it,i) {
          return (i == 0 || i == d.values.length - 1 ? 2 : 1);
        }
      });
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var dir = [{name: "direction", data: d3.range(100).map(function() { return Math.random(); })}];
    var dis = [{name: "distance", data: d3.range(100).map(function() { return Math.random(); })}];
    var size = [{name: "size", data: d3.range(100).map(function() { return Math.random(); })}];
    var color = [{name: "color", data: d3.range(100).map(function() { return Math.random(); })}];
    var name = [{name: "name", data: d3.range(100).map(function() { 
      return plotdb.data.sample.name[parseInt(plotdb.data.sample.name.length * Math.random())];
    })}];
    return {
      direction: dir,
      distance: dis,
      size: size,
      color: color,
      name: name
    };
  },
  dimension: {
    direction: { type: [plotdb.Number], require: true, desc: "direction of bubble. support only data have similar characteristic with angle." },
    distance: { type: [plotdb.Number], require: true, desc: "length of bubble from centroid of chart" },
    size: { type: [plotdb.Number], require: true, desc: "bubble size" },
    color: { type: [plotdb.Number], require: true, desc: "color of bubble" },
    name: { type: [], desc: "name of bubble" }
  },
  config: {
    fontFamily: {},
    background: {},
    textFill: {},
    margin: {},
    fontSize: {},
    palette: {},
    fill: {},
    stroke: {},
    strokeWidth: {},
    nodeStroke: {},
    nodeStrokeWidth: {},
    title: {category: "Chart Settings"},
    discrete: { name: "Isometric", type: [plotdb.Boolean], default: true, category:"Chart Settings"},
    discreteDiv: { name: "Vector Count", type: [plotdb.Number], default: 36, category: "Chart Settings"},
    legendShow: {},
    legendLabel: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.grid = this.svg.append("circle").attr({"class": "grid"});
    this.name = this.svg.append("text").attr({"class": "title"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.popup = plotd3.html.tooltip(this.root).on("mousemove",function(d,i,popup) {
      popup.select(".title").text(d.name || "-");
      popup.select(".value").text(parseInt(d.color * 100) / 100);
    });
  },
  parse: function() {
    this.distances = this.data.map(function(it) { return it.distance; });
    this.directions = this.data.map(function(it) { return it.direction; });
    this.sizes = this.data.map(function(it) { return it.size; });
    this.values = this.data.map(function(it) { return it.color; });
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("g.lines").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr("class", "lines chart").each(function(d,i) {
      d3.select(this).append("line").attr({class: "connect"});
    });
    sel = this.svg.selectAll("g.bubbles").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr("class", "bubbles chart").each(function(d,i) {
      var node = d3.select(this)
      node.append("circle").attr("class","node data");
    });
    this.lines = this.svg.selectAll("g.lines");
    this.bubbles = this.svg.selectAll("g.bubbles");
    this.popup.nodes(this.bubbles);
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    var m = this.config.margin;
    this.mobile = (width < 480 || height < 320);
    this.svg.attr({
      width: width, height: height,
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    var len = this.config.palette.colors.length;
    this.cScale = plotdb.Palette.scale.linear(this.config.palette).domain(
      d3.range(len).map(function(it) {
        return d3.quantile(d3.extent(that.values), it / len); 
      })
    );
    this.legend = plotd3.rwd.legend()
      .orient("right")
      .scale(this.cScale)
      .ticks(10)
      .fontSize(this.config.fontSize);
    this.legend.label(this.config.legendLabel || this.dimension.color.fieldName || " ");
    this.legendGroup.call(this.legend);
    this.legendSize = (this.config.legendShow ? this.legend.offset() : [0,0]);
    var iw = width - (this.config.legendShow ? this.legendSize[0] + this.config.fontSize : 0);
    this.size = (iw > height? height : iw);
    this.dScale = d3.scale.linear()
      .domain([0,d3.max(this.distances)])
      .range([this.size/4, (this.size / 2.1) - 20]);
    this.aScale = d3.scale.linear().domain([0,d3.max(this.directions)]).range([0, Math.PI * 2]);
    this.daScale = function(it) { 
      if(that.config.discrete) {
        return Math.PI * 2 * (
          parseInt((that.config.discreteDiv || 1)* (that.aScale(it) / (Math.PI * 2))) / (that.config.discreteDiv || 1)
        );
      } else return that.aScale(it);
    };
    this.rScale = d3.scale.sqrt().domain([0,d3.max(this.sizes)]).range([1, (this.mobile ? 6 : 12)]);
  },
  render: function() {
    var that = this;
    var legendOffset = this.legend.offset();
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.svg.selectAll("text").attr({
      "font-size": that.config.fontSize,
      "fill": that.config.textFill
    });
    this.legendGroup.attr({
      transform: [
        "translate(",
        this.width - legendOffset[0] - this.config.margin,
        (this.height - legendOffset[1])/2,
        ")"
      ].join(" "),
      display: (this.config.legendShow ? "block" : "none")
    });
    this.name.attr({
      x: function(it) { return (that.width - that.legendSize[0]) / 2;},
      y: function(it) { return that.height / 2; },
      "font-size": this.config.fontSize
    }).style({
      "text-anchor": "middle",
      "dominant-baseline": "central"
    }).text(that.config.title);
    this.grid.attr({
      cx: function(it) { return (that.width - that.legendSize[0]) / 2;},
      cy: function(it) { return that.height / 2;},
      r: function(it) { return that.size / 6; },
    });
    this.svg.selectAll("g.chart")
      .attr({
        transform: function(it) {
          var x,y;
          x = (that.width - that.legendSize[0])/ 2;
          y = that.height / 2;
          return "translate("+x+","+y+")";
        }
      });
    this.bubbles.selectAll("circle")
      .attr({
         cx: function(it) { 
           return Math.cos(that.daScale(it.direction)) * that.dScale(it.distance);
         },
         cy: function(it) { 
           return Math.sin(that.daScale(it.direction)) * that.dScale(it.distance);
         },
         r: function(it) {
           return that.rScale(it.size);
         },
         stroke: that.config.nodeStroke,
         "stroke-width": that.config.nodeStrokeWidth
      }).style({
         fill: function(it) {
           return that.cScale(it.color);
         },
      });
    this.lines.selectAll("line")
      .attr({
        x1: function(it) { return Math.cos(that.daScale(it.direction)) * that.size / 6; },
        x2: function(it) { return Math.cos(that.daScale(it.direction)) * that.dScale(it.distance); },
        y1: function(it) { return Math.sin(that.daScale(it.direction)) * that.size / 6; },
        y2: function(it) { return Math.sin(that.daScale(it.direction)) * that.dScale(it.distance); },
        stroke: this.config.stroke,
        "stroke-width": this.config.strokeWidth
      });
    this.grid.attr({
      fill: this.config.fill,
      stroke: this.config.stroke,
      "stroke-width": this.config.strokeWidth
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(20);
    return {
      value: [{name: "Contribution", data: list.map(function(d,i) { return Math.round(100 * Math.random()); })}],
