      });
      var fontSize = that.config.fontSize, width = node.select("text")[0][0].getBBox().width;
      if(fontSize<12) fontSize = 12;
      if(width > d.r * 2) fontSize = fontSize * d.r * 2 / width;
      node.selectAll("text").attr({
        "font-size": fontSize,
        dy: fontSize/2.3,
        opacity: (fontSize < 12 ? 0 : 1)
      });
      node.select("text.shadow").attr({
        stroke: function(d,i) {
          var hsl = d3.hsl(that.cScale(d.category));
          if(hsl.l > 0.65) return "#fff"; else return "#000";
        },
        "stroke-width": 3
      });
    });
    this.dataGroup.selectAll("g.data").transition().attr({
      opacity: function(d,i) {
        return (!that.activeGroup || that.activeGroup == d.category ? 1 : 0.1);
      }
    });
    var rate, bbox = this.dataGroup[0][0].getBBox();
    var cw = this.width - this.config.margin * 2;
