    this.barHeight = this.yScale.rangeBand();
  },
  render: function() {
    var that = this;
    this.yAxisGroup.attr({
      transform: ["translate(", this.config.margin + this.yAxisWidth, 0, ")"].join(" ")
    });
    this.dataGroup.selectAll(".data").attr({
      transform: function(d,i) {
        return [
          "translate(",
          (that.width + that.yAxisWidth + that.config.fontSize)/2, 
          that.yScale(d.name),
          ")"
        ].join(" ");
      }
    });
    this.dataGroup.selectAll("text.data").each(function(d,i) {
      var node = d3.select(this);
      node.text(d.value).attr({
        x: 0,
        y: that.barHeight/2, "text-anchor": "middle",dy: that.config.fontSize/2, "font-size": that.config.fontSize,
        fill: function(d,i) {
          var c = d3.hsl(that.cScale(d.name));
          return (c.l >=0.7 ? "#000" : "#fff");
        }
      });
      var width = node[0][0].getBoundingClientRect().width;
      var barSize = that.xScale(d.value) * 2;
      if(barSize < width) {
        node.attr({
          x: barSize/2 + that.config.fontSize,
          fill: "#000",
          "text-anchor": "start"
        });
      }
    });
    this.overlap.nodes(this.dataGroup.selectAll("text.data"));
    this.dataGroup.selectAll("text.data").attr({
      opacity: function(d,i) { return d.overlap ? 0 : 1; }
    });
    this.dataGroup.selectAll("path.data").attr({
      d: function(d,i) {
        return [
          "M", -that.xScale(d.upValue), 0,
          "L", -that.xScale(d.downValue), that.barHeight,
          "L", that.xScale(d.downValue), that.barHeight,
          "L", that.xScale(d.upValue), 0,
          "Z"
        ].join(" ");
      },
      fill: function(d,i) { return that.cScale(d.name); }
    });
    this.unit.attr({
      x: this.width - this.config.margin,
      y: this.height - this.config.margin,
      "text-anchor": "end",
      "font-size": this.config.fontSize * 0.9
    }).text("( " + this.config.unit + " )");
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(7);
    return {
      name: [{name: "Name", data: list.map(function(d,i) { return plotdb.data.sample.name.get(i); })}],
      value: d3.range(4).map(function(d,i) { return {
        name: 1980 + 4 * d, data: list.map(function(d,j) {
          return parseInt(Math.random()* 20) + i * 5;
        })
      };})
    };
    src = plotdb.data.sample.lifeExpectancy;
    return {
      name: [src.Country],
      value: [src[1985], src[2000],src[2015]]
    };
  },
  dimension: {
    name: { type: [plotdb.String], require: false, desc: "Name of this line in slopegrape" },
    value: { type: [plotdb.Number], multiple: true, require: true, desc: "Each point of this line in slopegraph" }
  },
  config: {
    margin: {},
    fontSize: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.tooltip = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name);
      popup.select(".value").text(d);
    });
  },
  parse: function() {
    var that = this,i,j,field,minDiff = -1,diff,data;
    this.xValues = this.dimension.value.fieldName || d3.range(this.dimension.value.fields.length);
    this.yRange = d3.extent(this.data.map(function(d,i) { return d3.extent(d.value); })
      .reduce(function(a,b) { return a.concat(b); }, []));
    for(i=0;i<this.dimension.value.fields.length;i++) {
      data = this.dimension.value.fields[i].data.map(function(d,i) { return +d; });
      data.sort(function(a,b) { return a - b; });
      for(j=0;j<data.length - 1;j++) {
        diff = data[j + 1] - data[j];
        if(minDiff == -1 || minDiff > diff && diff > 0) minDiff = diff;
      }
    }
    this.minDiff = minDiff;
    this.data.map(function(d,i) {
      d.pairs = d3.pairs(d.value);
    });
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("g.data-group").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("text").attr({class: "label left"}).text(d.name);
      node.append("text").attr({class: "label right"}).text(d.name);
    });
    this.dataGroup.selectAll("g.data-group").each(function(d,i) {
      var node = d3.select(this),sel;
      sel = node.selectAll("line.connect").data(d.pairs);
      sel.exit().remove();
      sel.enter().append("line").attr({class: "connect"});
      sel = node.selectAll("circle.data").data(d.value);
      sel.exit().remove();
      sel = sel.enter().append("circle").attr({class: "data"});
      that.tooltip.nodes(sel);
    });
    this.resize();
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.height = height = 2 * this.config.fontSize * (this.yRange[1] - this.yRange[0]) / (this.minDiff || 1);
    if(height > 10000) this.height = height = 10000;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.tooltip.fontSize(this.config.fontSize);
    this.labelWidth = d3.max(this.dataGroup.selectAll("text").attr({
      "font-size": this.config.fontSize
    })[0].map(function(d) { return d.getBoundingClientRect().width; })) + this.config.fontSize;
    this.yScale = d3.scale.linear()
      .domain(this.yRange)
      .range([this.height - this.config.margin, this.config.margin]);

    this.xScale = d3.scale.ordinal()
      .domain(this.xValues)
      .rangeBands([
        this.config.margin + this.labelWidth,this.width - this.config.margin - this.labelWidth
      ]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .tickValues(this.xValues)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.xAxisHeight = this.xAxis.offset();
    this.xStep = this.xScale.rangeBand();
    this.yScale
      .range([this.height - this.config.margin - this.xAxisHeight - this.config.fontSize, this.config.margin + this.config.fontSize]);
  },
  render: function() {
    var that = this;
    this.xAxisGroup.attr({
      transform: ['translate(', 0, (this.height - this.config.margin - this.xAxisHeight), ')'].join(" ")
    });
    this.dataGroup.selectAll("g.data-group").each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("circle.data").attr({
        cx: function(d,i) { return that.xScale(that.xValues[i]) + that.xStep/2; },
        cy: function(d,i) { return that.yScale(d); },
        r: 4,
        fill: "black",
        stroke: "white",
        "stroke-width": 2
      });
      node.selectAll("line.connect").attr({
        x1: function(d,i) { return that.xScale(that.xValues[i]) + that.xStep/2; },
        x2: function(d,i) { return that.xScale(that.xValues[i + 1]) + that.xStep/2; },
        y1: function(d,i) { return that.yScale(d[0]); },
        y2: function(d,i) { return that.yScale(d[1]); },
        stroke: "black",
        "stroke-width": 1
      });
    });
    this.dataGroup.selectAll("text.left").attr({
      x: function(d,i) { return that.xScale(that.xValues[0]) + that.xStep/2 - that.config.fontSize/2; },
      y: function(d,i) { return that.yScale(d.value[0]); },
      "text-anchor": "end",
      dy: this.config.fontSize/2,
      "font-size": this.config.fontSize
    });
    this.dataGroup.selectAll("text.right").attr({
      x: function(d,i) { return that.xScale(that.xValues[that.xValues.length - 1]) + that.xStep/2 + that.config.fontSize/2; },
      y: function(d,i) { return that.yScale(d.value[d.value.length - 1]); },
      "text-anchor": "start",
      dy: this.config.fontSize/2,
      "font-size": this.config.fontSize
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(8);
    return {
      value: [{name: "Value", data: list.map(function(d,i) { return Math.sin(d * Math.PI / 5) * 2 + Math.random(); })}],
      order: [{name: "Order", data: list.map(function(d,i) { return plotdb.data.sample.name.get(i); })}]
    };
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "" },
    order: { type: [plotdb.Order], require: false, desc: "" }
  },
  config: {
    fontFamily: {},
    background: {},
    textFill: {},
    margin: {},
    fontSize: {},
    colorPositive: {},
    colorNegative: {},
    showLabel: {},
    yAxisShow: {},
    yAxisLabel: {},
    nodeSize: {default: 12},
    nodeFill: {default: "#000"},
    nodeStroke: {},
    nodeStrokeWidth: {default: 0},
    strokeWidth: {},
    yAxisTickPadding: {},
    xAxisShow: {},
    xAxisLabel: {},
    xAxisTickSizeInner: {},
    xAxisTickSizeOuter: {},
    xAxisTickPadding: {},
    xAxisShowDomain: {default: false},
    xAxisTickCount: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.alignLine = this.svg.append("line");
    this.dataGroup = this.svg.append("g").attr({class: "data-group"});
    this.overlap = plotd3.rwd.overlap();
    this.tooltip = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.order);
      popup.select(".value").text(Math.round(100 * d.value)/100);
    });
  },
  parse: function() {
    plotdb.Order.sort(this.data, "order");
    this.orders = this.data.map(function(d,i) { return d.order; });
    this.values = this.data.map(function(d,i) { return d.value; });
    this.valueRange = d3.extent(this.values);
    if(this.valueRange[0] > 0) this.valueRange[0] = 0;
    if(this.valueRange[1] < 0) this.valueRange[1] = 0;
  },
  bind: function() {
    var that = this, sel;
    sel = this.dataGroup.selectAll("g").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("g").attr({class: "data"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("line").attr({class: "data"});
      node.append("circle").attr({class: "node"});
      node.append("text").attr({class: "data label shadow"});
      node.append("text").attr({class: "data label"});
    });
    this.tooltip.nodes(sel.selectAll("circle"));
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.tooltip.fontSize(this.config.fontSize);
    this.yScale = d3.scale.ordinal()
      .domain(this.orders)
      .rangeBands([this.config.margin, this.height - this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .orient("left")
      .scale(this.yScale)
      .label(this.config.yAxisLabel || " ")
      //.tickPadding(this.config.yAxisTickPadding || 0)
      .fontSize(this.config.fontSize);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisOffset = (this.config.yAxisShow ? this.yAxis.offset() : 0);
    this.xScale = d3.scale.linear()
      .domain(this.valueRange)
      .range([this.config.margin + this.yAxisOffset, this.width - this.config.margin]);

    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .label(this.config.xAxisLabel || " ")
      .tickValues(this.xScale.ticks(this.config.xAxisTickCount))
      .tickSize(this.config.xAxisTickSizeInner, this.config.xAxisTickSizeOuter)
      .tickPadding(this.config.xAxisTickPadding)
      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis);
    this.xAxisOffset = (this.config.xAxisShow ? this.xAxis.offset() : 0);
    this.yScale.rangeBands([this.config.margin, this.height - this.xAxisOffset - this.config.margin]);
    this.yAxisGroup.call(this.yAxis);
    this.yAxisOffset = (this.config.yAxisShow ? this.yAxis.offset() : 0);
    this.barHeight = this.yScale.rangeBand();
  },
  render: function() {
    var that = this, values = [];
    if(this.config.fontFamily) d3.select(this.root).style("font-family", this.config.fontFamily);
    d3.select(this.root).style("background-color", this.config.background);
    this.xAxisGroup.attr({
      transform: ["translate(0", (this.height - this.config.margin - this.xAxisOffset), ")"].join(" "),
      display: (this.config.xAxisShow? "block" : "none")
    });
    this.yAxisGroup.attr({
      transform: ["translate(", (this.config.margin + this.yAxisOffset), "0)"].join(" "),
      display: (this.config.yAxisShow? "block": "none")
    })
    this.svg.selectAll(".axis text").attr({fill: this.config.textFill});
    this.yAxisGroup.select(".domain").style({display: "none"});
    this.xAxisGroup.select(".domain").style({
      display: (this.config.xAxisShowDomain ? "block" :"none")
    });
    this.yAxisGroup.selectAll(".tick line").style({display: "none"});
    this.dataGroup.selectAll("g.data").attr({
      transform: function(d,i) {
        return ["translate(0 ", (that.yScale(d.order) + that.barHeight/2), ")"].join(" ");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      var v = Math.round(d.value * 100) / 100;
      node.selectAll("text").attr({
        "font-size": that.config.fontSize,
        display: that.config.showLabel ? "block" : "none"
      }).text( (d.value>0?"+":"") + v );
      v = parseFloat(node.selectAll("text")[0][0].getBoundingClientRect().width) +  parseFloat(that.config.fontSize);
      values.push(v);
    });
    var max = d3.max(values);
    this.xScale.range([this.config.margin + this.yAxisOffset + max, this.width - this.config.margin - max]);
     this.dataGroup.selectAll("g.data").each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("text").attr({
        x: that.xScale(d.value), y: 0,
        dx: (d.value < 0 ? -1 : 1) * that.config.fontSize,
        dy: that.config.fontSize/3,
        "text-anchor": (d.value < 0 ? "end" : "start" ),
        "fill": that.config.textColor
      });
      node.select("text.shadow").attr({
        stroke: "#fff", "stroke-width": 2
      });
      node.select("line").attr({
        x1: that.xScale(0),
        x2: that.xScale(d.value),
        y1: 0, y2: 0,
        "stroke-width": that.config.strokeWidth,
        stroke: (d.value>=0?that.config.colorPositive:that.config.colorNegative),
      });
      node.select("circle").attr({
        cx: that.xScale(d.value), cy: 0, r: that.config.nodeSize/2,
        fill: that.config.nodeFill,
        stroke: that.config.nodeStroke,
        "stroke-width": that.config.nodeStrokeWidth
      });
    });
    this.xAxisGroup.call(this.xAxis);
    this.overlap.nodes(this.dataGroup.selectAll("text.label.shadow"), function(d,i) { return Math.abs(d.value); });
    this.dataGroup.selectAll("text.label").attr({
      opacity: function(d,i) { return (d.overlap?0:1); }
    });
    this.alignLine.attr({
      x1: this.xScale(0), x2: this.xScale(0), y1: this.config.margin, y2: this.height - this.config.margin - this.xAxisOffset,
      stroke: "#000", "stroke-width": that.config.strokeWidth
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = ["Safe","Warning","Danger","Extreme","Maximum"];
    return {
      name: [{name: "value", data: list}],
      value: [{name: "value", data: [5]}],
      threshold: [{name: "threshold", data: list.map(function(d,i) { return i * 2; })}]
    };
  },
  dimension: {
    name: { name: "name", type: [plotdb.String], require: false, desc: ""},
    value: { name: "value", type: [plotdb.Number], require: true, desc: ""},
    threshold: {name: "threshold", type: [plotdb.Number], required: false, desc: ""}
  },
  config: {
    padding: {},
    margin: {},
    fontSize: {},
    palette: {}
  },
  init: function() {
    var that = this;
    this.id = "plotdb-gauge-" + Math.round(Math.random() * 100000000);
    this.svg = d3.select(this.root).append("svg");
    this.defs = this.svg.append("defs");
    this.arc = d3.svg.arc()
      .startAngle(0)
      .endAngle(180);
    this.arcGroup = this.svg.append("g");
    this.textGroup = this.svg.append("g");
    this.nameGroup = this.svg.append("g");
    this.pin = this.svg.append("path");
  },
  parse: function() {
    var that = this;
    this.index = ((this.data.filter(function(d,i) { return d.value; })[0] || {}).value) || 0;
    this.data.sort(function(a,b) { return a.threshold - b.threshold; });
    this.pairs = d3.pairs(this.data);
    this.max = d3.max(this.data.map(function(d,i) { return d.threshold; }));
  },
  bind: function() {
    var that = this,sel;
    sel = this.arcGroup.selectAll("path").data(this.pairs);
    sel.exit().remove();
    sel.enter().append("path");
    sel = this.defs.selectAll("path").data(this.pairs);
    sel.exit().remove();
    sel.enter().append("path").attr({id: function(d,i) { return that.id + "-" + i; }});
    sel = this.textGroup.selectAll("text").data(this.data);
    sel.exit().remove();
    sel.enter().append("text");
    sel = this.nameGroup.selectAll("text").data(this.pairs);
    sel.exit().remove();
    sel.enter().append("text").append("textPath");
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.size = (width/2 > height ? height : width/2) - that.config.fontSize * 2.5;
  },
  render: function() {
    var that = this;
    var offset = this.config.fontSize/2;
    if(offset < 13) offset = 13;
    var pathAttr = {
      transform: ["translate(", (this.width/2), this.height - this.config.margin - offset, ")"].join(" "),
      d: function(d,i) { 
        return that.arc
          .startAngle(Math.PI * d[0].threshold / that.max - Math.PI/2)
          .endAngle(Math.PI * d[1].threshold / that.max - Math.PI/2)();
      },
      fill: function(d,i) {
        return that.cScale(d[0].name);
      },
    };
    this.arc
      .innerRadius(this.size/2 - this.config.margin)
      .outerRadius(this.size - this.config.margin);
    this.arcGroup.selectAll("path").attr(pathAttr);
    var labelRad = this.size - this.config.margin;
    if(labelRad - this.config.fontSize * 2 < this.size / 2 - this.config.margin) {
      labelRad = this.size / 2 - this.config.margin
    } else {
      labelRad = labelRad - this.config.fontSize * 2;
    }
    this.arc
      .innerRadius(labelRad)
      .outerRadius(labelRad);
    this.defs.selectAll("path").attr(pathAttr);
    this.textGroup.selectAll("text").attr({
      dx: 0,dy: -that.size + that.config.margin - offset,
      "font-size": that.config.fontSize,
      "text-anchor": "middle",
      transform: function(d,i) {
        var ret = [
          "translate(",that.width/2,that.height - that.config.margin - offset,
          ") rotate(",(180 * d.threshold/that.max - 90),")"].join(" ");
        return ret;
      }
    }).text(function(d,i) { return d.threshold; });
    var fsize = this.config.fontSize * 0.75;
    this.nameGroup.selectAll("text").each(function(d,i) {
      var len = document.getElementById(that.id + "-" + i).getTotalLength()/2;
      var size = len / d[0].name.length;
      if(fsize > size) fsize = size;
    });
    this.nameGroup.selectAll("text").attr({
      dy: -that.config.fontSize/2,
      "font-size": fsize,
      "opacity": (fsize< 10 ? 0 : 1),
      "text-anchor": "middle",
      fill: function(d,i) {
        var c = d3.hsl( that.cScale(d[0].name) );
        return (c.l > 0.7 ? "#000" : "#fff");
      }
    });
    this.nameGroup.selectAll("text textPath").attr({
      "startOffset": "25%",
      "xlink:href": function(d,i) { return ("#" + that.id + "-") + i; }
    }).text(function(d,i) { return d[0].name; });
    this.pin.attr({
      d: function(d,i) {
        var ret = [
          "M",  -13, 0,
          "A", 13, 13, 0, 0, 0, 13, 0,
          "L", 0, -that.size,
          "Z"
        ].join(" ");
        return ret;
      },
      transform: function(d,i) {
        return [
          "translate(", that.width/2, that.height - that.config.margin - offset,
          ") rotate(", (180 * that.index/that.max - 90), ")"].join(" ");
      }
    });
  }
});

