      popup.select(".title").text(d.properties.COUNTYNAME);
      popup.select(".value").text(
        (d.properties.value == undefined ? "無數值"
         :Math.round(d.properties.value*100)/100)
      );
    });
    this.countyfile = this.assets["twCounty2010.topo.json"];
    this.valueRange = [0,1];
    this.counties = [];
    this.data.map(function(d,i) { d.name = that.normalName(d.name); });
    d3.json(this.countyfile.datauri, function(ret) {
      var features = topojson.feature(ret, ret.objects.layer1).features;
      for(var i = 0; i < features.length; i++) {
        features[i].properties.COUNTYNAME = that.normalName(features[i].properties.COUNTYNAME);
      }
      that.counties = features;
      that.parse();
      that.resize();
      that.bind();
      that.render();
    });
  },
  normalName: function(it) {
    it = it.replace(/臺/g, "台");
    if(it == "台北縣") return "新北市";
    if(it == "台中縣") return "台中市";
    if(it == "高雄縣") return "高雄市";
    if(it == "台南縣") return "台南市";
    if(it == "桃園縣") return "桃園市";
