      matched = this.data.filter(function(it) {
        return it.name == that.counties[idx].properties.COUNTYNAME;
      })[0];
      if(matched) this.counties[idx].properties.value = matched.value;
    }
    this.valueRange = d3.extent(this.counties.map(function(it) { return it.properties.value; }));
    if(isNaN(this.valueRange[0])) this.valueRange[0] = 0;
