      width: this.width, height: this.height,
      viewBox: [0,0,this.width,this.height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.threshold = this.config.threshold;
    if(this.threshold < this.valueRange[0]) this.threshold = this.valueRange[0];
    if(this.threshold > this.valueRange[1]) this.threshold = this.valueRange[1];
    this.cScale = d3.scale.linear()
      .domain([this.valueRange[0], (this.threshold || 0), this.valueRange[1]])
      .range([this.config.colorNegative, this.config.colorNeutral, this.config.colorPositive]);

    this.legend = plotd3.rwd.legend()
      .orient("right")
      .scale(this.cScale)
      .fontSize(this.config.fontSize)
    this.legend.label(this.config.legendLabel || this.dimension.value.fieldName || "");
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    var rate = [(this.width - this.config.margin * 2 - this.legendSize[0]) * 7.69231, (this.height - this.config.margin * 2 ) * 14.81481];
    rate = d3.min(rate);
    this.mercator = d3.geo.mercator().center([121,23.6]).scale(rate).translate([this.width/2 - this.legendSize[0],this.height/2]);
    this.path = d3.geo.path().projection(
      function(coord) {
        if(coord[1]>25.5) coord[1] = coord[1] - 1;
        if(coord[0]<119) coord[0] = coord[0] + 1.2;
        return that.mercator(coord);
      }
    );
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: ["translate(", (this.width - this.legendSize[0] - this.config.margin), (this.height - this.legendSize[1])/2, ")"].join(" ")
    });
    this.svg.selectAll("path.county.data")
      .attr({
        "d": that.path,
        "fill": function(it) {
          var v = it.properties.value;
          if(typeof(v) == "undefined" || v == null) return that.config.colorEmpty;
          return that.cScale(v);
        },
        "stroke": that.config.stroke,
        "stroke-width": (this.mobile ? 0.5 : 1.5)
      });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
