          if(i==2) return "Type " + Math.round(Math.random()*2 + 1);
          return Math.round(Math.random() * 10);
        })};
      })
    };
  },
  dimension: {
    name: { type: [plotdb.String], require: false, desc: "Name of the series" }, 
    values: { type: [plotdb.Numstring], require: true, multiple: true, desc: "Values in this series" }
  },
  config: {
    margin: {},
    fontSize: {},
    palette: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.dataGroup = this.svg.append("g").attr({class: "data-groups"});
  },
  parse: function() {
    var that = this, i, list, hash, unique;
    this.attrs = [this.dimension.name.fieldName].concat(this.dimension.values.fieldName);
    this.parsed = this.data.map(function(it,i) {
      var ret = {
        name: it.name,
        values: [{value: it.name, x: 0, name: it.name, y: i}].concat(it.values.map(function(d,i) { return {value: d, x: i+1, name: it.name};}))
      };
      ret.links = d3.pairs(ret.values);
      return ret;
    });
    for(i=0;i<this.dimension.values.fields.length;i++) {
      hash = {};
      unique = [];
      list = this.parsed.map(function(d) { return d.values[i + 1]; }); 
      list.sort(function(a,b) {
        return  plotdb.Numstring.order.Descending(a.value, b.value); 
      });
      list.map(function(d,i) { hash[d.value.raw || d.value] = 1; });
      for(k in hash) unique.push(k);
      unique.sort(plotdb.Numstring.order.Descending);
      unique.map(function(d,i) { hash[d] = i; });
      if(/^[0-9.]+$/.exec(list[0].value.raw || list[0].value)) {
        list.map(function(d,i) { d.y = i; });
      } else {
        var offset = parseInt(( list.length - unique.length ) / 2);
        list.map(function(d,i) { d.y = hash[d.value.raw || d.value] + offset; });
      }
    }
  },
  bind: function() {
    var that = this, sel;
    var handler = function(nodes) {
      nodes
        .on("mouseover", function(d,i) { that.activeGroup = d[0] || d; that.render(); })
        .on("mouseout", function(d,i) { that.activeGroup = null; that.render(); });
    };
    sel = this.dataGroup.selectAll("g.data-group").data(this.parsed);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this),sel;
      sel = node.selectAll("path.connect").data(d.links);
      sel.exit().remove();
      sel.enter().append("path").attr({class: "connect", opacity: 1});
      handler(sel);
      sel = node.selectAll("rect.data").data(d.values);
      sel.exit().remove();
      sel.enter().append("rect").attr({class: "data", opacity: 1});
      handler(sel);
      sel = node.selectAll("text.label.data").data(d.values);
      sel.exit().remove();
      sel.enter().append("text").attr({class: "label data", opacity: 1, "text-anchor": "middle"});
      handler(sel);
