      .fontSize(this.config.fontSize);
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.xAxisGroup.selectAll(".tick line").remove();
    this.xAxisHeight = this.xAxis.offset();
    this.yScale = d3.scale.ordinal()
      .domain(d3.range(this.data.length))
      .rangeBands([this.config.margin + this.xAxisHeight, this.height - this.config.margin],0.2,0);
    this.xBand = this.xScale.rangeBand();
    this.yBand = this.yScale.rangeBand();
  },
  render: function() {
    var that = this;
    this.xAxisGroup.attr({
      transform: ["translate(", 0, (this.config.margin + this.xAxisHeight), ")"].join(" ")
    });
    this.dataGroup.selectAll("rect.data").attr({
      x: function(d,i) { return that.xScale(d.x); },
      y: function(d,i) { return that.yScale(d.y); },
      width: this.xBand,
      height: this.yBand,
      fill: function(d,i) { return that.cScale(d.name); }
    }).transition().attr({
      opacity: function(d,i) { return (!that.activeGroup || that.activeGroup.name == d.name ? 1 : 0.1); },
      stroke: "#000",
      "stroke-width": function(d,i) { return ( that.activeGroup && that.activeGroup.name == d.name ? 1 : 0); }
    });
    this.dataGroup.selectAll("path.connect").attr({
      d: function(d,i) {
        var x = [ that.xScale(d[0].x) + that.xBand, that.xScale(d[1].x) ];
        var y = [ that.yScale(d[0].y) + that.yBand/2, that.yScale(d[1].y) + that.yBand/2 ];
        return ["M", x[0] - 2, y[0], "L", x[0], y[0], "L", x[1], y[1], "L", x[1] + 2, y[1]].join(" ");
      },
    }).style({
      "stroke-linejoin": "round",
