      for(var j = 0 ; j < this.data.length ; j++) {
        it = this.data[i];
        jt = this.data[j];
        if(i==j) continue; // not collide with self
        r = it.r + jt.r;
        itx = it.x;
        ity = it.y;
        jtx = jt.x;
        jty = jt.y;
        d = Math.sqrt( (itx - jtx) * (itx - jtx) + (ity - jty) * (ity - jty) );
        if(r > d) { // distance smaller than radius means collision
          dr = ( r - d ) / ( d * 2 );
          it.x = it.x + ( itx - jtx ) * dr * 1.5;
          it.y = it.y + ( ity - jty ) * dr * 1.5;
          it.px = it.x;
          it.py = it.y;
        }
    }};                                           
    for(var i=0,node;i<this.data.length;i++) {
      node = this.data[i];
      if(node.x <= node.r) node.x = node.r;
      if(node.x >= this.width - node.r) node.x = this.width - node.r;
      if(node.y <= node.r) node.y = node.r;
