      c = ni.feature.properties.c;
      ni.x = ni.x + (c[0] - ni.x ) * 0.8 * alpha;
      ni.y = ni.y + (c[1] - ni.y ) * 0.8 * alpha;
    }
    for(i=0;i<this.data.length;i++){
      ni = this.data[i];
