    this.yAxis = d3.svg.axis().scale(this.yScale).orient("left").tickValues(this.yTicks).tickFormat(d3.format(".1f"));
    this.yAxisGroup.call(this.yAxis);
    var bbox = this.yAxisGroup[0][0].getBBox();
    this.yAxisWidth = bbox.width;
    this.xScale.range([this.yAxisWidth + m, this.width - m - this.maxRadius]);
    this.xAxisGroup.call(this.xAxis);
  },
