      .range([this.height - this.config.margin - this.config.fontSize * 1.5,
              this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .orient("left").scale(this.yScale).fontSize(this.config.fontSize);
    this.yAxis.label(this.config.yAxisLabel || this.dimension.length.fieldName || " ");
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.ordinal()
      .domain(this.xRange)
      .rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .tickFormat(function(d,i) { return that.names[d]; })
      .fontSize(this.config.fontSize);
