      this.height - this.config.margin - this.xAxisHeight,
      this.config.margin + this.config.fontSize * 1.5
    ]);
    this.yAxisGroup.call(this.yAxis);
    var pbw = this.barWidth = this.xScale.rangeBand();
    var rate = this.config.padding/this.barWidth;
