    this.barWidth = this.xScale.rangeBand();
    if(this.barWidth < 5) {
      var w = this.width - this.config.margin * 2 - this.yAxisWidth;
      w = w / this.data.length
      rate = ( w - 5 ) / w;
      this.xScale.rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin],rate);
      this.barWidth = this.xScale.rangeBand();
