        if(a.parsed > b.parsed) { return 1; }
        else if (a.parsed < b.parsed) { return -1; }
        return 0;
      });*/
      p.order.forEach(function(d,i) { d.idx = i; });
      for(var j=0;j < this.data[0].value.length; j++) {
