    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.threshold = this.config.threshold;
    if(this.threshold < this.valueRange[0]) this.threshold = this.valueRange[0];
    if(this.threshold > this.valueRange[1]) this.threshold = this.valueRange[1];
    this.popup.fontSize(this.config.fontSize);
    this.cScale = d3.scale.linear()
      .domain([this.valueRange[0], this.threshold, this.valueRange[1]])
      .range([this.config.colorNegative, this.config.colorNeutral, this.config.colorPositive]);
    this.legend = plotd3.rwd.legend()
      .scale(this.cScale)
      .orient("right")
      .fontSize(this.config.fontSize);
    this.legend.label(this.config.legendLabel || this.dimension.value.fieldName || "");
    this.legendGroup.call(this.legend);
    this.legendSize = this.legend.offset();
    var rate = [this.width * 0.615384, this.height * 1.185185];
    rate = d3.min(rate);
    this.path = d3.geo.path().projection(d3.geo.mercator()
      .center([103.55, 38])
      .scale(rate).translate([width / 2, height / 2 ]).precision(0.1));
    /*this.ticks = this.xScale.ticks(5);
    this.ticks.sort(function(a,b) { return b - a; });
    this.legendWidth = (2 + d3.max(this.ticks.map(function(it) { return (""+it).length; }))) * that.config.fontSize;*/
  },
  render: function() {
    var that = this;
    this.legendGroup.attr({
      transform: ["translate(", (this.width - this.legendSize[0] - this.config.margin), (this.height - this.legendSize[1])/2,")"].join(" ")
    });
    this.dataGroup.selectAll("path.data").attr({
      d: this.path,
      fill: function(it) { 
        return that.cScale(it.properties.value);
      },
      stroke: that.config.stroke,
      "stroke-width": 1
    });
  }
});

