module = {};
module.exports = plotdb.chart.create({
  sample: [],
  dimension: {
    "value": { type: [plotdb.Number], require: true, desc: "value for the country" },
    "country": { type: [], require: false, desc: "country name" }
  },
  config: {
    padding: { type: [plotdb.Number], default: 10, rebindOnChange: true },
    emptyColor: { type: [plotdb.Color], default: "#000", rebindOnChange: false},
    baseColor: { type: [plotdb.Color], default: "#48b", rebindOnChange: false},
    strokeColor: { type: [plotdb.Color], default: "#444", rebindOnChange: false}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.countryfile = this.assets["world-110m.json"];
    this.codemapfile = this.assets["country-code.json"];
    this.parsed = {}
    for(i=0;i<this.data.length;i++) {
      this.parsed[this.data[i].country.toUpperCase()] = this.data[i].value;
    }
    d3.json(this.codemapfile.datauri, function(codemap) {
    d3.json(that.countryfile.datauri, function(ret) {
      var features = topojson.feature(ret, ret.objects.countries).features;
      for(var i=0;i<features.length;i++) {
        var ret = that.parsed[codemap[features[i].id]];
        if(typeof(ret)!="undefined") features[i].value = ret;
      }
      that.valuerange = d3.extent(features.map(function(it) { return it.value; }));
      that.countries = features;
      that.svg.selectAll("path.country").data(features)
        .enter().append("path").attr({class: "country"})
        .on("mouseover", function(it) {
          that.active = it;
          it.x = d3.event.clientX;
          it.y = d3.event.clientY;
          that.render();
        });
      that.svg.selectAll("text.country").data(features)
        .enter().append("text").attr({class: "country"}).
        text(function(it) {
          return(codemap[it.id] || "UNKNOWN");
      });
      that.resize();
      that.render();
    });
    });
  },
  bind: function() {
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var svgbox = this.svgbox = d3.select(this.root).select("svg")[0][0].getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10 - svgbox.top;

    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.projection = d3.geo.mercator().translate([width/2, height * 0.7]);
    this.path = d3.geo.path().projection(function(coord) {
      coord[0] = coord[0] - 11.5;
      coord = that.projection(coord);
      coord[0] = (width / 2)  + (width / 2) * (coord[0] - that.width / 2) / 720;
      coord[1] = (height / 2) + (height/ 2) * (coord[1] - that.height / 2) / 320;
      return coord;
    });
    this.oscale = d3.scale.linear().domain(this.valuerange || [0,1]).range([0.5,1]);
  },
  render: function() {
    var that = this;
    this.svg.selectAll("path.country")
      .attr({
        "d": that.path,
        class: function(it) {
          return "country "+it.properties.name;
        },
        "fill": function(it) {
          if(typeof(it.value)=="undefined") return "#eee";
          return "#f94";
        },
        "stroke": function(it) {
          return "#fff";
        },
        opacity: function(it) {
          return that.oscale(it.value || 0);
        },
        "stroke-width": 1.5
      });
    this.svg.selectAll("text.country").attr({
      x: function(it) { return it.x - that.svgbox.left; },//that.path.centroid(it)[0]; },
      y: function(it) { return it.y - that.svgbox.top; },//that.path.centroid(it)[1]; },
      "text-anchor": "middle",
      "dominant-baseline": "central",
      "font-size": "12",
       opacity: function(it) {
         if(that.active && that.active.id == it.id) return 1;
         return 0;
       }
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var src = plotdb.data.sample.oldFaithful;
    return {
      x: [src["waiting"]],
      y: [src["eruptions"]]
    };
  },
  dimension: {
    x: { type: [plotdb.Number], require: true, desc: "X coordinate" },
    y: { type: [plotdb.Number], require: true, desc: "Y coordinate" }
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    histogramSize: { name: "Size of Histogram", type: [plotdb.Number], default: 20},
    xAxisLabel: {},
    yAxisLabel: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xHistGroup = this.svg.append("g").attr({class: "data-group"});
    this.yHistGroup = this.svg.append("g").attr({class: "data-group"});
    this.dataGroup  = this.svg.append("g").attr({class: "data-group"});
    this.yScale = d3.scale.linear();
  },
  parse: function() {
    var that = this,scale;
    this.xRange = d3.extent(this.data.map(function(d,i) { return d.x; }));
    this.yRange = d3.extent(this.data.map(function(d,i) { return d.y; }));
    ["xRange","yRange"].map(function(d,i) {
      if(that[d][0] == that[d][1]) that[d][1]++;
    });
    this.yScale.domain(this.yRange);
    scale = d3.scale.quantize().domain(this.xRange).range(d3.scale.linear().domain(this.xRange).ticks(100));
    this.xHist = d3.nest().key(function(d,i) { return scale(d.x); }).entries(this.data);
    scale = d3.scale.quantize().domain(this.yRange).range(d3.scale.linear().domain(this.yRange).ticks(50));
    this.yHist = d3.nest().key(function(d,i) { return scale(d.y); }).entries(this.data);
    this.xHistRange = d3.extent(this.xHist, function(d,i) { return d.values.length; });
    this.yHistRange = d3.extent(this.yHist, function(d,i) { return d.values.length; });
    ["xHistRange","yHistRange"].map(function(d,i) {
      if(that[d][0] == that[d][1]) that[d][1]++;
    });
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("circle.data").data(this.data);
    sel.exit().remove();
    sel.enter().append("circle").attr({class: "data"});
    [[this.xHistGroup, this.xHist], [this.yHistGroup, this.yHist]].map(function(g) {
      sel = g[0].selectAll("g.data-group").data(g[1]);
      sel.exit().remove();
      sel.enter().append("g").attr({class: "data-group"});
      g[0].selectAll("g.data-group").each(function(d,i) {
        var node = d3.select(this),sel;
        sel = node.selectAll("circle.data").data(d.values);
        sel.exit().remove();
        sel.enter().append("circle").attr({class: "data"});
      });
    });
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });

    this.yScale.range([this.height - this.config.histogramSize - this.config.margin, this.config.margin]);
    this.yAxis = plotd3.rwd.axis()
      .scale(this.yScale)
      .orient("left")
      .fontSize(this.config.fontSize)
      .label(this.config.yAxisLabel || this.dimension.y.fieldName || " ");
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();

    this.xScale = d3.scale.linear()
      .domain(this.xRange)
      .range([this.config.margin + this.config.histogramSize + this.yAxisWidth + this.config.padding, this.width - this.config.margin]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .fontSize(this.config.fontSize)
      .label(this.config.xAxisLabel || this.dimension.x.fieldName || " ");
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.xAxisHeight = this.xAxis.offset();
    this.yScale.range([
      this.height - this.config.histogramSize - this.config.margin - this.xAxisHeight - this.config.padding,
      this.config.margin
    ]);
    this.yAxisGroup.call(this.yAxis).select(".domain").remove();
  },
  render: function() {
    var that = this;
    this.xAxisGroup.attr({
      transform: ["translate(", 0, this.height - this.config.margin - this.xAxisHeight, ")"].join(" ")
    });
    this.yAxisGroup.attr({
      transform: ["translate(", this.config.margin + this.yAxisWidth, ")"].join(" ")
    });
    this.dataGroup.selectAll("circle.data").attr({
      cx: function(d,i) { return that.xScale(d.x); },
      cy: function(d,i) { return that.yScale(d.y); },
      r: 2
    });
    this.xHistGroup.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return ["translate(",
          that.xScale(+d.key),
          that.height - that.config.margin - that.xAxisHeight - that.config.padding,
          ")"].join(" ");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("circle.data").attr({
        cx: 0,
        cy: function(d,i) {
          var ret = (that.config.histogramSize * i / (that.xHistRange[1] || 1))
          return -(ret - ret%3);
        },
        r: 0.6,
        fill: "#f00"
      });
    });
    this.yHistGroup.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return ["translate(",
          that.config.margin + that.yAxisWidth + that.config.padding,
          that.yScale(+d.key),
          ")"].join(" ");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("circle.data").attr({
        cy: 0,
        cx: function(d,i) {
          var ret = (that.config.histogramSize * i / (that.yHistRange[1] || 1))
          return ret - ret%3;
        },
        r: 0.6,
        fill: "#f00"
      });
    });
  }
});

