var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(10);
    return {
      oldValue: [{name: "Last Year", data: list.map(function(d,i) { return parseInt(Math.random() * 100); })}],
      newValue: [{name: "This Year", data: list.map(function(d,i) { return parseInt(Math.random() * 100); })}],
      name: [{name: "Name", data: list.map(function(d,i) { return plotdb.data.sample.name[i % plotdb.data.sample.name.length]; })}]
    };
  },
  dimension: {
    oldValue: { type: [plotdb.Number], require: true, desc: "old value" },
    newValue: { type: [plotdb.Number], require: true, desc: "new value"},
    name: { type: [plotdb.Order], reqire: false, desc: "name for this value set"}
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    colorPositive: {},
    colorNeutral: {},
    colorNegative: {},
    yAxisLabel: {}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.xAxisGroup.append("line").attr({class: "domain"});
    this.popup = plotd3.html.tooltip(this.root).on("mousemove", function(d,i,popup) {
      var arrow = (d.newValue > d.oldValue ? "▲" : (d.newValue == d.oldValue ? "-" : "▼"));
      var color = (d.newValue > d.oldValue ? that.config.colorPositive : (d.newValue == d.oldValue ? that.config.colorNeutral : that.config.colorNegative));
      popup.select(".title").text(arrow + " " + d.name).style({
        background: color,
        "text-align": "center",
        padding: "2px"
      });
      popup.select(".value").html([
        that.oldValueLabel + ": " + d.oldValue,
        that.newValueLabel + ": " + d.newValue,
      ].join("<br>"));
    });;
  },
  parse: function() {
    plotdb.Order.sort(this.data, "name");
    this.oldValues = this.data.map(function(it) { return it.oldValue; });
    this.newValues = this.data.map(function(it) { return it.newValue; });
    this.names = this.data.map(function(it) { return it.name; });
    this.indexes = d3.range(this.data.length);
    this.maxNameLength = d3.max(this.names.map(function(it) { return (it || "").length; }));
    this.oldrange = d3.extent(this.oldValues);
    this.newrange = d3.extent(this.newValues);
    this.valuerange = d3.extent(this.oldrange.concat(this.newrange));
    if(this.valuerange[0] == this.valuerange[1]) this.valuerange[1]++;
    this.valuerange[0] = 0;
    this.minDeltaOld = -1;
    this.minDeltaNew = -1;
    var dOld = 0;
    var dNew = 0;
    this.oldValues.sort();
    this.newValues.sort();
    for(var i=0;i<this.data.length - 1; i++) {
      dOld = this.oldValues[i + 1] - this.oldValues[i];
      dNew = this.newValues[i + 1] - this.newValues[i];
      if(dOld < this.minDeltaOld || this.minDeltaOld < 0) this.minDeltaOld = dOld;
      if(dNew < this.minDeltaNew || this.minDeltaNew < 0) this.minDeltaNew = dNew;
    }
    this.minDelta = d3.min(this.minDeltaOld, this.minDeltaNew);
    this.heightRate = this.config.fontSize / this.minDelta;
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("g.data").data(this.data);
    sel.exit().remove();
    sel.enter().append("g").attr({class: "data"}).each(function(d,i) {
      var node = d3.select(this);
      node.append("rect");
      node.append("text").attr({class: "label left"});
      node.append("text").attr({class: "label right"});
      node.append("line").attr({class: "connect"});
      node.append("line").attr({class: "node left"});
      node.append("line").attr({class: "node right"});
      node.append("line").attr({class: "domain"});
      node.append("circle").attr({class: "node left"});
      node.append("circle").attr({class: "node right"});
    });
    this.popup.nodes(this.svg.selectAll("g.data"));

  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - this.svg[0][0].getBoundingClientRect().top - 10;
    var p = this.config.padding;
    this.oldValueLabel = this.config.oldValueLabel || this.dimension.oldValue.fieldName || "-";
    this.newValueLabel = this.config.newValueLabel || this.dimension.newValue.fieldName || "-";
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.yScale = d3.scale.linear().domain(this.valuerange).range([this.height - this.config.margin, this.config.margin]);
    this.yAxis = plotd3.rwd.axis().orient("left").scale(this.yScale)
      .fontSize(this.config.fontSize)
      .label(this.config.yAxisLabel || "").labelPosition("in");
    this.yAxisGroup.call(this.yAxis);
    this.yAxisWidth = this.yAxis.offset();
    this.xScale = d3.scale.ordinal().domain(this.indexes)
      .rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin]);
    var rate, band = this.xScale.rangeBand();
    if(band - this.config.padding < 8) {
      rate = ( band - 8 ) / band;
    } else rate = this.config.padding / band;
    this.xScale.rangeBands([this.config.margin + this.yAxisWidth, this.width - this.config.margin],rate,rate);
    this.xAxis = plotd3.rwd.axis().orient("bottom").scale(this.xScale).tickSize(5,0)
      .fontSize(this.config.fontSize).tickFormat(function(d,i) { return that.data[d].name; });
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = this.xAxis.offset();
    this.slopeWidth = this.xScale.rangeBand();
    this.yScale.range([this.height - this.config.margin - this.xAxisHeight, this.config.margin]);
    this.yAxisGroup.call(this.yAxis);
  },
  render: function() {
    var that = this;
    var m = this.config.margin;
    var p = this.config.padding;
    var f = this.config.fontSize;
    var baseY = this.yScale(this.yScale.domain()[0]);
    this.yAxisGroup.attr({
      transform: "translate(" + (that.yAxisWidth + this.config.margin) + ",0)"
    });
    this.xAxisGroup.attr({
      transform: "translate(0 "+ ( this.height - this.xAxisHeight - this.config.margin ) + ")"
    });
    this.svg.selectAll("g.data").attr({
      transform: function(d,i) { return ["translate(",
        that.xScale(i), 0, ")"].join(" ");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      var color = (d.newValue >= d.oldValue ? that.config.colorPositive : that.config.colorNegative);
      if(d.newValue == d.oldValue) color = that.config.colorNeutral;
      var darkColor = d3.rgb(color).darker(1.4).toString();
      var x1 = 0, x2 = that.slopeWidth, y1 = that.yScale(d.oldValue), y2 = that.yScale(d.newValue);
      var r = that.config.fontSize / 3;
      node.select("rect").attr({
        x: 0, y: 0, width: that.slopeWidth, height: that.height, fill: "rgba(255,255,255,.01)"
      });
      node.select("line.domain").attr({
        x1: x1, x2: x2, y1: baseY, y2: baseY,stroke: "#999", "stroke-width": 1
      });
      node.select("circle.node.left").attr({
        cy: y1,
        r: r, fill: color
      });
      node.select("circle.node.right").attr({
        cx: x2, cy: y2,
        r: r, fill: color
      });
      node.select("line.connect").attr({
        x1: x1, x2: x2, y1: y1, y2: y2, stroke: color,
        class: "connect " + (d.newValue >= d.oldValue ? "positive" : "negative")
      });
      node.select("line.node.left").attr({x1: x1, x2: x1, y1: baseY, y2: y1});
      node.select("line.node.right").attr({x1: x2, x2: x2, y1: baseY, y2: y2});
      node.selectAll("line.node").attr({
        stroke: "#ccc", "stroke-dasharray": "2 2"
      });
    });
  }
});

