var module = {};
module.exports = plotdb.chart.create({
  sample: d3.range(20).map(function(it) {
    return {
      value: Math.random() * 10 + 2,
      name: ["Joe","John","Jessica","Jacob"][it % 4],
      category: [2010,2011,2012,2013,2014,2015][parseInt(it/4)]
    };
  }),
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "length of bar" },
    name: { type: [], require: false, desc: "name of bar" },
    category: { type: [plotdb.Number], require: true, desc: "group of bar" },
  },
  config: {
    padding: { name: "Padding", type: [plotdb.Number], default: 10 },
    margin: { name: "Margin", type: [plotdb.Number], default: 10 },
    fontSize: { name: "Font Size", type: [plotdb.Number], default: 10 },
    palette: { name: "Palette", type: [plotdb.Palette], default: plotdb.Palette.default,
              hint: plotdb.Palette.subtype.qualitative}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.valuerange = d3.extent(this.data.map(function(it) { return it.value; }));
    this.parsed = d3.nest().key(function(it) { return it.category}).entries(this.data);
    this.maxlength = d3.max(this.parsed.map(function(it) { return it.values.length; }));
  },
  bind: function() {
    var that = this;
    this.svg.selectAll("g.data-group").data(this.parsed).enter().append("g").attr({class: "data-group"}).each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("rect.data").data(d.values).enter().append("rect").attr({class: "data"});
    });
    this.xAxisGroup.selectAll("g.tick").data(this.parsed).enter().append("g").attr({class: "tick"}).append("text");
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var svgbox = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - svgbox.top;
    var m = this.config.margin;
    var p = this.config.padding;
    var f = this.config.fontSize;
    this.xAxisHeight = f * 2;
    this.yAxisWidth = f * 3;
    this.barGroupWidth = (this.width - 2 * m - this.yAxisWidth) / this.parsed.length;
    this.barWidth = ( this.barGroupWidth - p ) / this.maxlength;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.yscale = d3.scale.linear()
      .domain([(this.valuerange[0] > 0 ? 0 : this.valuerange[0]), this.valuerange[1]])
      .range([this.height - m - this.xAxisHeight, m]);
    this.cscale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.yAxis = d3.svg.axis().orient("left").scale(this.yscale).tickSize(2,1);
    this.yAxisGroup.call(this.yAxis);
  },
  render: function() {
    var that = this;
    this.yAxisGroup.attr({
      transform: function(d,i) {
        return ["translate(", (that.yAxisWidth + that.config.margin), ",0)"].join("");
      }
    });
    this.svg.selectAll("g.data-group").attr({
      transform: function(d,i) {
        return ["translate(", (i * that.barGroupWidth + that.yAxisWidth + that.config.margin), ", 0)"].join("");
      }
    }).each(function(d,i) {
      var node = d3.select(this);
      node.selectAll("rect.data").attr({
        x: function(d,i) { return i * that.barWidth; },
        y: function(d,i) { return that.yscale(d.value); },
        width: that.barWidth,
        height: function(d,i) { return that.yscale((that.valuerange[0] > 0 ? 0 : that.valuerange[0])) - that.yscale(d.value); },
        fill: function(d,i) { return that.cscale(d.name); }
      });
    });
    this.xAxisGroup.selectAll("text").attr({
      rx: this.config.radius || 0,
      ry: this.config.radius || 0,
      y: this.height - this.xAxisHeight + 2,
      x: function(d,i) {
        return that.yAxisWidth + (i + 0.5) * that.barGroupWidth;
      },
      "text-anchor": "middle",
      "dominant-baseline": "cnetral"
    }).text(function(d,i) { return d.key; });
    this.svg.selectAll("text").attr({
      "font-size": this.config.fontSize
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: null,
  dimension: {
    name: { type: [], require: true, desc: "name of station" },
    size: {type: [plotdb.Number], require: false, desc: "size of circle"},
  },
  config: {
    fontSize: { name: "Font Size", type: [plotdb.Number], default: 12 },
    padding: { name: "Padding", type: [plotdb.Number], default: 10 },
    margin: { name: "Margin", type: [plotdb.Number], default: 10},
    radius: { name: "Max Radius", type: [plotdb.Number], default: 15},
    palette: { name: "Palette", type: [plotdb.Palette], default: plotdb.Palette["default"]}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    d3.json(this.assets["mrt.json"].datauri,function(data) {
    that.mrt = data;
    this.values = d3.map(this.data || [],function(it) { return it.name; });
    that.sites = that.mrt.map(function(it) { return it.name; });
    that.links = [];
    that.sitemap = {}
    for(var idx = 0; idx < that.mrt.length; idx++) {
      that.sitemap[that.mrt[idx].name] = that.mrt[idx];
      that.mrt[idx].value = (that.data && that.data.length
         ? (that.values[that.mrt[idx].name] || 0)
         :  parseInt(Math.random() * 20 + 3));
    }
    that.valuerange = that.mrt.map(function(it) { return it.value; });
    for(var idx = 0; idx < that.mrt.length; idx++) {
      var item = that.mrt[idx];
      var nodes = (that.mrt[idx].destination || "").split(",").map(function(it) {
        return that.sitemap[it];
      }).filter(function(it) { return it; });
      for(var jdx = 0; jdx < nodes.length; jdx++) {
        that.links.push({source: that.mrt[idx], target: nodes[jdx]});
      }
    }
    that.lngRange = d3.extent(that.mrt.map(function(it) { return it.longitude; }));
    that.latRange = d3.extent(that.mrt.map(function(it) { return it.latitude; }));
    that.resize();
    that.bind();
    that.render();
    });
  },
  bind: function() {
    var that = this;
    if(!this.mrt) return;
    this.lines = this.svg.selectAll("line.connect")
      .data(this.links)
      .enter().append("line").attr({"class": "connect"});
    this.circles = this.svg.selectAll("circle.data.node")
      .data(this.mrt)
      .enter().append("circle").attr({"class":"data node"});
    this.labels = this.svg.selectAll("text.label")
      .data(this.mrt)
      .enter().append("text").attr({class: "label"});
    this.nameShadows = this.svg.selectAll("text.label.shadow")
      .data(this.mrt)
      .enter().append("text").attr({class: "label shadow"});
    this.names = this.svg.selectAll("text.label.name")
      .data(this.mrt)
      .enter().append("text").attr({class: "label name"});
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10;
    var m = this.config.margin;
    this.radius = (width > height? height : width ) / 2 - 2 * m;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    if(!this.mrt) return;
    this.xscale = d3.scale.linear().domain(this.lngRange).range([
        width / 2 - this.radius, width / 2 + this.radius
    ]);
    this.yscale = d3.scale.linear().domain(this.latRange).range([
        height / 2 + this.radius, height / 2 - this.radius
    ]);
    this.mrt.map(function(d,i) {
      d.x = d.px = that.xscale(d.longitude);
      d.y = d.py = that.yscale(d.latitude);
    });
    var max = d3.max(this.mrt.map(function(d,i) { return d.value; }));
    this.rscale = d3.scale.linear()
      .domain([0,max])
      .range([this.config.fontSize/1.8,this.config.radius]);
    this.cscale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.force = d3.layout.force().size([width - 2 * m, height - 2 * m])
      .gravity(0.05)
      .charge(function(it) { return -Math.pow(that.rscale(it.value),1.3);})
      .friction(0.9)
      .nodes(this.mrt)
      .on("tick", function(it) { that.tick(); });
    this.mrt.map(function(d) { d.r = that.rscale(d.value); }); 
    this.force.start();
  },
  tick: function() {
    for(var i=0,node;i<this.mrt.length;i++) {
      node = this.mrt[i];
      if(node.x < node.r) node.x = node.r;
      if(node.x > this.width - node.r) node.x = this.width - node.r;
      if(node.y < node.r) node.y = node.r;
      if(node.y > this.height - node.r) node.y = this.height - node.r;      
    }
    this.render();
  },
  render: function() {
    var that = this;
    if(!this.mrt) return;
    this.circles.attr({
      cx: function(it) { return it.x; },
      cy: function(it) { return it.y; },
      r : function(it) { return it.r; },
      fill: function(it) { return that.cscale(it.category); },
      stroke: function(it) { return that.cscale(it.category); },
      "stroke-width": 3,
    });
    this.labels.attr({
      x: function(it) { return it.x; },
      y: function(it) { return it.y; },
      "font-size": this.config.fontSize,
      "text-anchor": "middle",
      "dominant-baseline": "central",
      dy: -this.config.fontSize * 0.5,
      fill: function(it,i) {
        var c = d3.hsl(that.cscale(it.category));
        return (c.l > 0.6 ? "#000" : "#fff");
      },
    }).text(function(it) { return it.value; });
    this.nameShadows.attr({
      x: function(it) { return it.x; },
      y: function(it) { return it.y; },
      "font-size": this.config.fontSize * 0.7,
      "text-anchor": "middle",
      "dominant-baseline": "central",
      dy: this.config.fontSize * 0.6,
      stroke: function(it,i) {
        var c = d3.hsl(that.cscale(it.category));
        return (c.l > 0.6 ? "#fff" : "#000");
      },
      "stroke-width": 2
    }).text(function(it) { return it.name; });
    this.names.attr({
      x: function(it) { return it.x; },
      y: function(it) { return it.y; },
      "font-size": this.config.fontSize * 0.7,
      "text-anchor": "middle",
      "dominant-baseline": "central",
      dy: this.config.fontSize * 0.6,
      fill: function(it,i) {
        var c = d3.hsl(that.cscale(it.category));
        return (c.l > 0.6 ? "#000" : "#fff");
      },
    }).text(function(it) { return it.name; });
    this.lines.attr({
      x1: function(it) { return it.source.x; },
      x2: function(it) { return it.target.x; },
      y1: function(it) { return it.source.y; },
      y2: function(it) { return it.target.y; },
      stroke: function(it) { return that.cscale(it.source.category); },
      "stroke-width": 4
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var count = 100;
    var x = [{name: "X", data: d3.range(count).map(function() { return Math.random(); })}];
    var y = [{name: "Y", data: d3.range(count).map(function() { return Math.random(); })}];
    var radius = [{name: "Radius", data: d3.range(count).map(function() { return Math.random(); })}];
    var category = [{name: "Category", data: d3.range(count).map(function() { return plotdb.data.sample.category.rand(); })}];
    var name = [{name: "Name", data: d3.range(count).map(function() { return plotdb.data.sample.name.rand(); })}];
    return {x: x, y: y, radius: radius, category: category, name: name};
  },
  dimension: {
    radius: { type: [plotdb.Number], require: true, desc: "radius of circle" },
    x: { type: [plotdb.Number], require: true, desc: "x axis of circle"},
    y: { type: [plotdb.Number], require: true, desc: "y axis of circle"},
    category: { type: [], require: false, desc: "category of circle"},
    name: { type: [], require: false, desc: "name of circle"}
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    palette: {},
    xAxisLabel: {},
    yAxisLabel: {},
    maxRadius: { name: "Max Radius", type: [plotdb.Number], default: 10 },
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.frame = this.svg.append("rect").attr({class: "grid frame"});
    this.frameInner = this.svg.append("rect").attr({class: "grid frame inner"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.gridGroup = this.svg.append("g").attr({class: "grid-group"});
    this.legendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.popup = plotd3.html.popup(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.name || "-");
      popup.select(".value").text(parseInt(100 * d.radius)/100);
    });
    setInterval(function() {
      that.tick();
    }, 100);
  },
  parse: function() {
    this.xRange = d3.extent(this.data.map(function(it) { return it.x; }));
    this.yRange = d3.extent(this.data.map(function(it) { return it.y; }));
    this.rRange = d3.extent(this.data.map(function(it) { return it.radius; }));
    this.categories = d3.map(this.data, function(d) {return d.category || ""; }).keys();
    if(this.xRange[0] == this.xRange[1]) this.xRange[1]++;
    if(this.yRange[0] == this.yRange[1]) this.yRange[1]++;
    if(this.rRange[0] == this.rRange[1]) this.rRange[1]++;
  },
  bind: function() {
    var that = this,sel;
    sel = this.svg.selectAll("circle.data").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("circle").attr({class:"data"}).attr({ opacity: 0});
    this.popup.nodes(sel);
    sel = this.gridGroup.selectAll("line.grid.vertical").data(this.xticks);
    sel.exit().remove();
    sel.enter().append("line").attr({class: "grid vertical"});
    sel = this.gridGroup.selectAll("line.grid.horizontal").data(this.yticks);
    sel.exit().remove();
    sel.enter().append("line").attr({class: "grid horizontal"});
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var svgbox = d3.select(this.root).select("svg")[0][0].getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height - 10 - svgbox.top;
    var m = this.config.margin;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.maxRadius = this.config.maxRadius;
    if(this.maxRadius > this.width / 30) this.maxRadius = this.width / 30;
    if(this.maxRadius > this.height / 15) this.maxRadius = this.height / 15;
    this.popup.fontSize(this.config.fontSize);
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.legend = plotd3.rwd.legend().orient("right")
      .scale(this.cScale)
      .tickValues(this.categories)
      .size([220,this.height - 2 * this.config.margin])
      .fontSize(this.config.fontSize);
    this.legendGroup.call(this.legend).selectAll(".legend").on("mouseover", function(d,i) {
      that.activeGroup = d;
      that.renderHighlight();
    }).on("mouseout", function(d,i) {
      that.activeGroup = null;
      that.renderHighlight();
    });
    this.legendSize = this.legend.offset();
    this.rScale = d3.scale.sqrt().domain([0,this.rRange[1]]).range([0, this.maxRadius]);
    this.yScale = d3.scale.linear().domain(this.yRange).range([
      height - this.maxRadius - m, this.maxRadius + m
    ]);
    this.yAxis = plotd3.rwd.axis().scale(this.yScale).orient("left")
      .fontSize(this.config.fontSize)
      .labelPosition("in")
      .tickPadding(this.config.axisTickPadding || 6)
      .tickSize(this.config.axisTickInner || 0,this.config.axisTickOuter || 0);
    this.yAxis.label(this.config.yAxisLabel || this.dimension.y.fieldName || " ");

    this.yAxisGroup.call(this.yAxis).select(".domain").remove();
    this.yAxisWidth = this.yAxis.offset();
    this.yticks = this.yAxis.tickValues();

    this.xScale = d3.scale.linear().domain(this.xRange).range([
      this.yAxisWidth + this.maxRadius + m, width - this.maxRadius - m - this.legendSize[0] - this.config.padding
    ]);
    this.xAxis = plotd3.rwd.axis()
      .scale(this.xScale)
      .orient("bottom")
      .labelPosition("in")
      .fontSize(this.config.fontSize)
      .tickPadding(this.config.axisTickPadding || 6)
      .tickSize(this.config.axisTickInner || 0,this.config.axisTickOuter || 0);
    this.xAxis.label(this.config.xAxisLabel || this.dimension.x.fieldName);
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    this.xAxisHeight = this.xAxis.offset();
    this.xticks = this.xAxis.tickValues();
    this.yScale.range([ height - this.maxRadius - this.xAxisHeight - m, this.maxRadius + m ]);
    this.yAxisGroup.call(this.yAxis).select(".domain").remove();
    this.xAxisGroup.call(this.xAxis).select(".domain").remove();
    that.prerender();
  },
  tick: function() {
    var that = this;
    this.svg.selectAll("circle.data").each(function(d,i) {
      if(d.fired || Math.random() > 0.05) return;
      d.fired = true;
      var node = d3.select(this);
      var duration = Math.random() * 4000 + 4000;
      node.transition("snow").duration(duration).ease("cubic-out").tween("snow",function(d,i) {
        return function(t) {
          if(!d.fired) node.attr({cx: that.xScale(d.x), cy: 0, opacity: 0});
          else node.attr({
            cx: that.xScale(d.x) + Math.sin(t * Math.PI * 4) * 10,
            cy: that.yScale(d.y) * t,
            opacity: function(d,i) {
              return t * 0.99;
            }
          });
        };
      });
    });
  },
  prerender: function() {
    var that = this;
    this.data.map(function(d,i) { d.fired = false; });
    this.svg.selectAll("circle.data").attr({
      cx: function(it) { return that.xScale(it.x); },
      cy: 0,
      opacity: 0
    });
  },
  renderHighlight: function() {
    var that = this;
    that.svg.selectAll("circle.data").transition("highlight").attr({
      fill: function(d) {
        if(!that.activeGroup) return that.cScale(d.category);
        if(that.activeGroup == d.category) return "#ffffff";
        return "#aaa";
      }
    });
  },
  render: function() {
    var that = this;
    var m = this.config.margin;
    this.frame.attr({
      x: that.yAxisWidth + m,
      y: m,
      width: that.width - 2 * m - that.yAxisWidth - this.legendSize[0] - this.config.padding,
      height: that.height - 2 * m - that.xAxisHeight,
      fill: "#aaa",
      stroke: "#000",
      "stroke-width": 1
    });
    this.frameInner.attr({
      x: that.yAxisWidth + m + this.maxRadius,
      y: m + this.maxRadius,
      width: that.width - 2 * m - that.yAxisWidth - this.legendSize[0] - this.config.padding - 2 * this.maxRadius,
      height: that.height - 2 * m - that.xAxisHeight - 2 * this.maxRadius,
      fill: "none",
      stroke: "#777",
      "stroke-width": 1
    });
    this.legendGroup.attr({
      transform: ["translate(", this.width - this.config.margin - this.legendSize[0], (this.height - this.legendSize[1])/2, ")"].join(" ")
    });
    this.xAxisGroup.attr({
      transform: ["translate(", 0, ",", this.height - this.xAxisHeight - m,")"].join("")
    });
    this.yAxisGroup.attr({
      transform: ["translate(", this.yAxisWidth + m , ",", 0 ,")"].join("")
    });
    this.svg.selectAll("circle.data").attr({
      opacity: 0,
      r: function(it) { return that.rScale(it.radius); },
      fill: function(it) { return that.cScale(it.category); },
      stroke: "#ccc",
      "stroke-width": 1
    })
    this.gridGroup.selectAll("line.grid.vertical").attr({
      x1: function(it) { return that.xScale(it); },
      x2: function(it) { return that.xScale(it); },
      y1: that.yScale(that.yRange[0]),
      y2: that.yScale(that.yRange[1]),
      stroke: "#999",
      "stroke-dasharray": "2 4"
    });
    this.gridGroup.selectAll("line.grid.horizontal").attr({
      y1: function(it) { return that.yScale(it); },
      y2: function(it) { return that.yScale(it); },
      x1: that.xScale(that.xRange[0]),
      x2: that.xScale(that.xRange[1]),
      stroke: "#999",
      "stroke-dasharray": "2 4"
    });
  }
});

var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var continent = plotdb.data.sample.continent;
    var len = continent.length;
    var ret = {
      source: [{name: "From", data: []}],
      target: [{name: "To", data: []}],
      value: [{name: "Value", data: []}]
    };
    for(var i=0;i<len;i++) { for(var j=0;j<len;j++) {
      ret.source[0].data.push(continent.get(i));
      ret.target[0].data.push(continent.get(j));
      ret.value[0].data.push(Math.round(Math.random() * 90 + 10));
    }}
    return ret;
  },
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "flow from source to target" },
    source: { type: [], require: true, desc: "name of source"},
    target: { type: [], require: true, desc: "name of target"}
  },
  config: {
    fontSize: {},
    margin: {},
    padding: {},
    palette: {},
    thick: { name: "Thickness", type: [plotdb.Number], default: 10}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg");
    this.defs = this.svg.append("defs");
    this.dataGroup = this.svg.append("g");
  },
  parse: function() {
    var that = this;
    if(!this.dimension.value.fields.length) this.data.map(function(d,i) { d.value = 1; });
    this.sources = d3.nest().key(function(it) { return it.source; }).map(this.data, d3.map).keys();
    this.targets = d3.nest().key(function(it) { return it.target; }).map(this.data, d3.map).keys();
    this.names = d3.nest().key(function(it) { return it; }).map(this.sources.concat(this.targets), d3.map).keys();
    this.matrix = d3.range(this.names.length).map(function(it) {
      return d3.range(that.names.length).map(function(it) { return 0; });
    });
    this.data.forEach(function(it) {
      that.matrix[that.names.indexOf(it.source)][that.names.indexOf(it.target)] = it.value;
    });
  },
  bind: function() {
    var that = this,sel;
    sel = this.dataGroup.selectAll("path.arc").data(this.chord.groups);
    sel.exit().remove();
    sel.enter().append("path").attr({
      class: "arc data",
      opacity: 1
    }).on("mouseover", function(d,i) {
      that.activeGroup = d;
      that.render();
    }).on("mouseout", function() { 
      that.activeGroup = null;
      that.render();
    });
    sel = this.dataGroup.selectAll("path.chord").data(this.chord.chords);
    sel.exit().remove();
    sel.enter().append("path").attr({ class: "chord connect", opacity: 0.8 });
    sel = this.defs.selectAll("path.textpath").data(this.chord.groups);
    sel.exit().remove();
    sel.enter().append("path").attr({
      class: "textpath",
      id: function(d,i) { return "textpath" + i; }
    });
    sel = this.dataGroup.selectAll("text.name").data(this.chord.groups);
    sel.exit().remove();
    sel.enter().append("text").attr({class: "name"})
      .append("textPath").attr({"xlink:href": function(d,i) { return "#textpath" + i; }});
  },
  resize: function() {
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    this.size = (width>height?height:width)/2 - that.config.margin - that.config.padding - that.config.fontSize;
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.thick = this.config.thick;
    if(this.width < 480 || this.height < 320) this.thick = this.config.thick/2;
    this.cScale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.chord = d3.layout.chord().padding(0.05).matrix(this.matrix);
    this.chordPath = d3.svg.chord().radius(this.size - this.thick - this.config.margin);
    this.arc = d3.svg.arc()
      .innerRadius(this.size - this.thick - this.config.margin)
      .outerRadius(this.size - this.config.margin);
  },
  render: function() {
    var that = this;
    this.arc
      .innerRadius(this.size - this.thick - this.config.margin)
      .outerRadius(this.size - this.config.margin);
    this.dataGroup.attr({
      transform: ["translate(",(this.width/2),",",(this.height/2),")"].join("")
    });
    this.dataGroup.selectAll("path.arc").attr({
      d: this.arc,
      fill: function(d,i) {
        return that.cScale(d.index);
      },
      stroke: function(d,i) {
        return d3.rgb(that.cScale(d.index)).darker(2.2).toString();
      },
    }).transition().attr({
      opacity: function(d,i) {
        if(!that.activeGroup || that.activeGroup == d) return 1;
        return 0.1;
      }
    });
    this.dataGroup.selectAll("path.chord").attr({
      d: this.chordPath,
      fill: function(d,i) {
        return that.cScale(d.source.index);
      },
      stroke: function(d,i) {
        return d3.rgb(that.cScale(d.source.index)).darker(1).toString();
      },
    }).transition().attr({
      opacity: function(d,i) {
        if(!that.activeGroup) return 0.8;
        var j = that.activeGroup.index;
        if(j == d.source.index || j == d.target.index) return 0.8;
        return 0.1;
      }
    });
    this.defs.selectAll("path.textpath").attr({
      d: this.arc.innerRadius(this.size).outerRadius(this.size),
    });
    this.dataGroup.selectAll("text.name").attr({
      "font-size": this.config.fontSize,
      "dominant-baseline": "central",
      "text-anchor": "middle"
    }).select("textPath").attr({
      "startOffset": function(d,i) {
        return (d.startAngle > Math.PI/2 && d.endAngle < Math.PI * 3 / 2? "75%" : "25%");
      }
    }).text(function(d,i) { return that.names[i]; });
  }
});
